INSERT INTO `ask_replies` VALUES (1,4,'Same question here :)','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649179/tp4f4nre7dci6xlsvz2l.jpg','Jeanne','Coleman','2016-04-28 13:49:36',2),(2,22,'same question.','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457696920/bqmrx96mrlddmgy79svo.jpg','Florent','Gautin','2016-05-12 10:28:15',7),(3,435,'You can buy their beautifully crafted products from http://www.shelter-shoponline.com/','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463289020/guo1cbbc5ulwbaa1lc36.jpg','Moiz','Hussain','2016-05-15 05:59:18',7),(4,126,'Right now it\'s available as  chrome extension, to start with. Mobile is definitely on the road map though, not too far away now!','https://lh6.googleusercontent.com/-tmYaon1pd1E/AAAAAAAAAAI/AAAAAAAAXtQ/13GqxkStsMM/photo.jpgsz=200','Tim','Perry','2016-05-15 10:21:42',3),(5,101,'Hello. Thanks for your message. More info about our product here: http://woodrover.eu','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAL2tuYOcdcOIKSNcwFOzY1ZAqyJqqDEZBw3ofkSNEU1YqT49bcbC5ZAklQG2MqSTNax12Yntk0GElqu1QjgMyg5ejYOC4Ox9wzg26DPQmPyBbNZAGmwjGEqtqH2ir8yhcx28skgSDGqImhXRIZCIjGIKvvrt46sbU6rxSOI8DtOuysedyxjF9n49VdiVZAJgZDZD','Valeriy','Gorbatov','2016-05-30 13:31:27',5),(6,101,'Hello. Yes, we are planning to produce othe type of bikes. Our second model- road bike','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAL2tuYOcdcOIKSNcwFOzY1ZAqyJqqDEZBw3ofkSNEU1YqT49bcbC5ZAklQG2MqSTNax12Yntk0GElqu1QjgMyg5ejYOC4Ox9wzg26DPQmPyBbNZAGmwjGEqtqH2ir8yhcx28skgSDGqImhXRIZCIjGIKvvrt46sbU6rxSOI8DtOuysedyxjF9n49VdiVZAJgZDZD','Valeriy','Gorbatov','2016-05-30 13:32:54',6),(7,14,'Any idea of the release date?','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','Max','Tolkin','2016-05-30 21:54:50',6),(8,101,'Bologna Design Week 30september-3 october 2016','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAL2tuYOcdcOIKSNcwFOzY1ZAqyJqqDEZBw3ofkSNEU1YqT49bcbC5ZAklQG2MqSTNax12Yntk0GElqu1QjgMyg5ejYOC4Ox9wzg26DPQmPyBbNZAGmwjGEqtqH2ir8yhcx28skgSDGqImhXRIZCIjGIKvvrt46sbU6rxSOI8DtOuysedyxjF9n49VdiVZAJgZDZD','Valeriy','Gorbatov','2016-05-31 05:53:51',6),(9,101,'But you can order earlier. We have all drafts now. For more info, please, contact us- valeriy@woodrover.eu','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAL2tuYOcdcOIKSNcwFOzY1ZAqyJqqDEZBw3ofkSNEU1YqT49bcbC5ZAklQG2MqSTNax12Yntk0GElqu1QjgMyg5ejYOC4Ox9wzg26DPQmPyBbNZAGmwjGEqtqH2ir8yhcx28skgSDGqImhXRIZCIjGIKvvrt46sbU6rxSOI8DtOuysedyxjF9n49VdiVZAJgZDZD','Valeriy','Gorbatov','2016-05-31 06:56:20',6),(10,1062,'We\'d definitely feel the effect if Britain left the EU, but English is already quite secure as the lingua franca, and the language of international business. Our initial interest is on providing English tuition and services to the Asian markets (which are growing rapidly and currently poorly served). Longer term we\'ll move into additional languages and subjects too.','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466447758/sqz1esjzlnls4pqxnmvg.jpg','Chris','Aram','2016-06-21 11:29:02',21),(11,539,'Hey! So in the upcoming months, you\'ll find postings for full time job and internship. Will range grom Sales, Marketing, Admin, Finance., Engineering... We won\'t focus on 1 field but will try to be as broad as possible. Although, it;s almost certain we won\'t have jobs for public administration, medicine etc.. which are really specifics for sure :-)','https://lh4.googleusercontent.com/-QbTQcj4Nc_w/AAAAAAAAAAI/AAAAAAAAHTc/QdqZfSVIZDM/photo.jpgsz=200','Kevin','Bosc','2016-06-21 14:12:26',20),(12,1,'Can\'t wait for the next steps ;)','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466521069/wzfqyt4fpqa9hcmij4cg.jpg','Quentin','Verriere','2016-07-05 23:14:10',27),(13,270,'Hey guys, I like the idea + that it\'s mobile first but it\'s sad that it\'s available only in french (pardon moi) and that I cannot dl or find it on apple store, that\'s probably because it\'s currently only available in france? Friends of mine are also working on quite the similar idea but they started off with the web version in english and it\'s available for global use. which is good...','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462430179/kkgzehn2ofnxib5rdhkf.jpg','Solomiya','Zahray','2016-07-29 07:31:45',17);
