INSERT INTO `feedback_replies` VALUES (4,27,5,'Cali ;)','2016-04-29 09:54:19','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649484/hlr71vj7alebi8xgrnso.jpg','Igor','Gourevitch'),(6,29,9,'Easy, go on \'Meet\' and use the search engine to find the profil your seeking. In your case, you\'re looking for someone that wants to \'join projects\'.','2016-05-03 11:47:23','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457688366/nfziqhnsu8123zazvz0w.jpg','Olivier','Hamelin'),(7,29,14,'What type of language are you using?','2016-05-03 15:22:29','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','Max','Tolkin'),(10,44,1,'Mh honestly, not sure i would pay or use a third party service to ride with people i already know. Third party services are meant to improve trust between individuals. Aren\'t you supposed to trust friends? Maybe you can monetize other features?','2016-05-24 18:06:46','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAI29AtFkf4G8wu2iO5fe9OzF5vI5hyeeCe6VZAxHJIedInKBlzR06uDBKI7aocWsDZCMmPZCRc5QqgHgyyPoQ4LvQuE3LrwbpZBpUxDe8ZBny86mVrzLA5SROIBvmpwFOaEIbFS6Hi0bAusZAEfHEDoieoq2Yb1emovvHsUZAgbLnQc9eXebUAZD','Quentin','Verriere'),(12,27,636,'Lots of things happening in Washington State too !','2016-05-25 14:56:08','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464187222/skryyg0spfflxmuxthqm.jpg','Sam','Linston'),(13,29,14,'Did you find someone?','2016-05-30 21:57:02','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','Max','Tolkin'),(14,29,241,'hi Max, no i didn\'t find any one yet! I\'m sorry if I didn\'t reply earlier to your other message, i didn\'t get any notifications. Do you have Skype maybe ? It would be easier to discuss and share documents. My Skype ID is : maximilien.lejeune\nThanks, Max','2016-05-30 22:24:35','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBABFZAYOiScZAX62SCTZABKNzT2bDrr5XXNusZCc1aiZBra9RZADTocgpVZCTFLR6LnRUu8zXX6p6ZCnlHHZAzx3FZBovw8P90NtC5OUNtGuEIjZCn2jKZC0YbCUbx28ZASRmJOqIzJaXTOZBe2ZBgwPiCpfBFQZD','Maximilien','Lejeune'),(15,29,14,'I\'m not available i have my own project for now. But i\'ll talk to some friends. Anyway you should detail a little more what you guys are doing, i see lots of skilled programers coming here.','2016-05-30 22:41:08','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','Max','Tolkin'),(16,46,14,'What type of service ? :) Marketplace is a very broad concept','2016-06-02 09:44:04','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','Max','Tolkin'),(17,46,752,'Sure, it involves freelance people ( or companies) providing services on one side, and customers ( hopefully ) on the other.\nI am looking for advice in oder to start : \n - which  marketplace provider (  Sharetribe ? )','2016-06-04 06:30:36','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464849471/nc3zg9qhbg19ivksxgle.jpg','Jeremie','Ensino'),(18,48,1,'Review coming in the morning ;)','2016-06-13 19:04:09','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAI29AtFkf4G8wu2iO5fe9OzF5vI5hyeeCe6VZAxHJIedInKBlzR06uDBKI7aocWsDZCMmPZCRc5QqgHgyyPoQ4LvQuE3LrwbpZBpUxDe8ZBny86mVrzLA5SROIBvmpwFOaEIbFS6Hi0bAusZAEfHEDoieoq2Yb1emovvHsUZAgbLnQc9eXebUAZD','Quentin','Verriere'),(19,48,14,'Looks pretty neat.','2016-06-13 19:19:36','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','Max','Tolkin'),(20,48,645,'In what countries are you launched ?','2016-06-13 20:15:27','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464264578/qcunjjhuqfxwdc5oeqjb.jpg','Frida','Wang'),(21,48,915,'Thanks! We\'re launching in France, and especially in Paris for now :)','2016-06-14 09:44:28','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465826848/y3dzxxu8abjpqslrebhz.jpg','Kim','Giaoui'),(22,48,925,'Great stuff','2016-06-14 12:26:11','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465907009/svz1fmwnh7ldqtvfanyj.jpg','Julie','Amy'),(23,48,1,'You did an awesome technical job, handling so may live streaming api with no lags, thats impressive.\nHowever i have a few UX concerns (purely personal):\n- Next Grab/Swipe down >> Swipe right (way more used in the mobile app standard, thanks to Tinder and others)\n-Progress bar is not clear enough / not really responsive, you should fix that.\n-i don\'t see the point about the daily musical journey eventhough it\'s pretty beautifull.. Maybe you could merge both features..?\n-Grab cards could be a bit more slick and easy to read.. Big strokes, big buttons, big lines.. a bit too big for me !\n\nOtherwise, one again you\'ve done the most difficult part, because it looks very very technically reliable. Well done to your developers. By the way, what about the javascript need you have ?','2016-06-14 12:26:34','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAI29AtFkf4G8wu2iO5fe9OzF5vI5hyeeCe6VZAxHJIedInKBlzR06uDBKI7aocWsDZCMmPZCRc5QqgHgyyPoQ4LvQuE3LrwbpZBpUxDe8ZBny86mVrzLA5SROIBvmpwFOaEIbFS6Hi0bAusZAEfHEDoieoq2Yb1emovvHsUZAgbLnQc9eXebUAZD','Quentin','Verriere'),(24,49,645,'Any more details you can share on your page? Looks neat.','2016-06-15 12:21:14','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464264578/qcunjjhuqfxwdc5oeqjb.jpg','Frida','Wang'),(25,49,4,'What type of maternity expert are you talking about? Other parents? Doctors? I like the idea.','2016-06-15 13:18:08','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649179/tp4f4nre7dci6xlsvz2l.jpg','Jeanne','Coleman'),(26,49,933,'Expert for me means graduated people : midwife, nurse for babies and pedetricians','2016-06-15 13:22:40','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465979936/vqjmyhhd4qcdrq5lx7jv.jpg','Caroline','Bercegeay'),(27,1,8,'Sure, you can pm me.','2016-06-15 15:29:57','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463276125/eve8apwdglglbbkxypdl.jpg','Jay','Ho'),(28,49,645,'Any timing infos about your launch? That\'s an interesting project.','2016-06-20 13:13:47','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464264578/qcunjjhuqfxwdc5oeqjb.jpg','Frida','Wang'),(29,49,933,'I wil pre-launch next week  :) My landing page petitequestion.fr will be updated with  details. Do you have kids ?','2016-06-20 15:00:21','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465979936/vqjmyhhd4qcdrq5lx7jv.jpg','Caroline','Bercegeay'),(30,52,8,'Seriously, I always want a service like this for my travels. When I travel and have to leave the hotel at noon for a fly or an evening train. I would use this service for some more free hours to visit without luggage on hand.','2016-06-21 23:19:03','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463276125/eve8apwdglglbbkxypdl.jpg','Jay','Ho'),(31,52,1088,'Really useful project. Would help me a lot when i come to Europe and can\'t leave my luggage at the hotel. Will you handle hotel to airport delivery?','2016-06-24 14:48:26','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466548349/oe8fwdyrvi6yvzgdwfoe.jpg','Abigail','Preston'),(32,53,1088,'Yep, 100%.','2016-06-24 14:48:41','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466548349/oe8fwdyrvi6yvzgdwfoe.jpg','Abigail','Preston'),(33,54,5,'Awesome project. Keep up the good work. I\'d personally follow news about space exploration, astronomy, renewable energies, medicine artificial intelligence.  That\'s of course a non exhaustive list!','2016-06-24 18:44:07','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649484/hlr71vj7alebi8xgrnso.jpg','Igor','Gourevitch'),(34,54,3,'I know lots of robotics blogs and newsletter, but i\'d be glad to see how you guys can differentiate.','2016-06-24 18:47:41','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457648516/tgaugxgkwjzj0ik5bhcu.jpg','Henry','Wei'),(35,55,3,'Is that to be one particular individual or do you plan to include organisations, companies, laboratories? For instance will i be able follow Boston Dynamics latest progress or projects like that?','2016-06-24 18:48:51','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457648516/tgaugxgkwjzj0ik5bhcu.jpg','Henry','Wei'),(36,54,15,'Very nice project.','2016-06-24 18:52:40','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457694177/nsei9eggjayb8ifodvdq.jpg','Hu','Tang'),(37,52,977,'Hi Abigail! We most certainly are planning this but stashpoint to airport is slightly more difficult than stashpoint-to-stashpoint, as it involves organizing a meet between you and the courier at the airport and some security issues. What we\'re thinking at the moment is that we could take the bag from your drop-off to meet you somewhere convenient on the way. E.g. if you\'re catching a train, we could move it to a stashpoint within 1 or 2 mins of the station you\'re leaving from. Would that still be of interest, or do you think we should really focus on trying to make stashpoint-to-airport work?','2016-06-25 10:22:18','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466273281/gwrkrzu4zn3xtvmwnado.jpg','Anthony','Collias'),(38,1,1150,'Hello, I live in Shanghai, what are you looking for in Shenzhen?','2016-06-28 16:46:21','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467131999/cda1d34yxp5sehxz6j9e.jpg','Benjamin','Patin');
/*!40000 ALTER TABLE `feedback_replies` ENABLE KEYS */;
