çaise et mon anglais laisse à désirer je l\'avoue :), mais je dois dire que votre profile est génial. Je suis très heureux de vous avoir parmi nous, que vous soyez active pour nous aider à bâtir les idées, notre avenir.','2016-05-22 21:13:49',1,0),(641,8,'Jay Ho',621,'Sonia Garcia',629,'Dans quelque jours, nous allons sortir de nouvelles fonctionnalités, je serai vraiment ravie d\'entendre votre avis. Et aussi, merci beaucoup pour vos chaleureux compliments, allow me to return the compliment, and wish you have a very nice evening. Best,','2016-05-22 21:27:26',1,0),(642,621,'Sonia Garcia',8,'Jay Ho',629,'Jay :)  c\'est un vrai compliment, un compliment inclus multiple, en tenant en compte que tu pensais que j\'étais française et aussi tes mots au niveau de mon profil. Je me sens très heureuse. Oui, je suis avec vous et vais vous aider en tout, j\'aiderai à pousser aussi notre fantastique Witty Circle, toutes les doutes que vous pourriez avoir en anglais, Italien ou l\'Espagnol, demandez-moi je sans douter :)  Mes compliments sont sincères haha and yes, I am going now to eat my dinner, I was swimming today.','2016-05-22 21:35:13',1,0),(643,621,'Sonia Garcia',8,'Jay Ho',629,'Je te donnerai mon opinion avec une vision globale mais spécifique en même temps sur les nouvelles fonctionnalités.','2016-05-22 21:36:41',1,0),(644,621,'Sonia Garcia',426,'Leo Scaff',1047,'Por lo tanto, puedo perfectamente desarrollar todo lo que el equipo pueda estar buscando.','2016-05-22 22:33:49',0,1),(645,1,'Quentin Verriere',160,'Christian Allouche',161,'Alors, elle arrive quand la page MeltingDoc ?! On sort une super feature pour les projets dans les heures à venir :)','2016-05-23 15:09:58',1,1),(646,8,'Jay Ho',621,'Sonia Garcia',629,'Haha, oui je n\'en doute pas une seule second que vous êtes sincères. Je suis content que vous soyez heureuse étant donné que c\'est vrai, vu votre maîtrise en français. Ça fait longtemps que vous apprenez le français ? Vous faites aussi de la natation ? Enfai