prochainement, je me dis que cumuler cette expérience avec la nouvelle génération serait sans doute une excellente idée.\nAu plaisir, bonne soirée,\n\nJulien','2016-06-04 19:51:30',1,1),(729,8,'Jay Ho',241,'Maximilien Lejeune',249,'f','2016-06-06 12:46:42',1,1),(730,241,'Maximilien Lejeune',8,'Jay Ho',249,'f ?? what do you mean ? Can i call you ? My number is 0669628788. Talk soon :)','2016-06-08 17:58:39',1,1),(731,241,'Maximilien Lejeune',7,'Maxence Mson',248,'Bonsoir Maxence, comment vas-tu? Je suis d\'accord pour faire un call avec toi? Quel est ton numéro? Le mien est le 0669628788. ou mon skype est : maximilien.lejeune','2016-06-08 17:59:37',1,1),(732,8,'Jay Ho',241,'Maximilien Lejeune',249,'Hi Max, I\'m sorry about the letter \"f\", I made a mistake while testing some functionalities on this message page. As you can see I\'m one of the cofounders of Wittycircle, I\'m fully engaged in the website that takes all my time but I have contact with developers, if you don\'t mind I can talk to them about your project and let you to get in touch with them later.','2016-06-09 00:10:19',1,1),(733,8,'Jay Ho',241,'Maximilien Lejeune',249,'One of my developers friends is on Wittycircle, His name is Roger Clanget, he is really good about web development. He may be interested :).','2016-06-09 00:16:25',1,1),(734,241,'Maximilien Lejeune',8,'Jay Ho',249,'Hi Jay, yes please talk about my project around you, and to Roger as well. Thank you ;)','2016-06-09 05:42:31',1,1),(735,900,'Dan Bessis',653,'Ela Haney',1553,'Hey Ela, just discovered this website and currently looking for someone cool to design a cool logo for my cool start-up :) \nWould you happen to be that person?\nThanks!','2016-06-09 16:33:53',0,1),(736,897,'Christopher Mariotte',1,'Quentin Verriere',898,'Hello Quentin, \n\nI hope you are well. Your idea and your website are amazing.\n Just to let you know there is a bug with the dropdown list in Experience... I can\'t choose the month and the year. Can you fix it please. Thanks a lot.\n\nBest regards.\n\nChris.','2016-06-09 18:41:09',1,1),(737,1,'Quentin Verriere',897,'Christopher Mariotte',898,'Thanks a lot Chris ! We\'re doing our best to quickly improve the service and we have sooo many ideas in mind to do so. I\'ll handle the experience issue right away and be right back to you when it\'s done.','2016-06-09 20:12:18',1,1),(738,62,'Jonathan Etaix',1,'Quentin Verriere',63,'ah ok, il font pas trop de seed Kima','2016-06-10 11:41:44',1,0),(739,62,'Jonathan Etaix',1,'Quentin Verriere',63,'il y en a d\'autre, mais pourtant ce mec est super. et tres tres bon','2016-06-10 11:42:08',1,0),(740,1,'Quentin Verriere',62,'Jonathan Etaix',63,'On verra bien, je l\'ai croisé aujourd\'hui, on avait rdv chez thefamily','2016-06-10 14:57:46',1,1),(741,1,'Quentin Verriere',905,'Rob Bbvr',906,'Content de te voir parmi nous Robert ! Je ne savais pas que tu te lançais aussi dans l\'aventure entrepreneuriale. Tu recherches quel genre de profil exactement pour Papyrus ? Les online payments c\'est large :)','2016-06-11 00:05:51',1,1),(742,908,'Antoine Grg',62,'Jonathan Etaix',970,'Bonjour Jonathan, \n\nNous sommes deux entrepreneurs et nous souhaitons lancer notre application mobile sur le thème des soirées et de la vie nocturne. Nous sommes à la recherche d’une personne qui a de l’expérience dans le développement d’applications et de préférence qui connaisse le langage Objective C ou Swift pour développer notre application. Possibilité de s’associer sur ce projet. \n\nN’hésitez pas à me contacter en message personnel pour plus d’informations \n\nMerci\n\nAntoine&Jeremy','2016-06-11 17:57:41',1,1),(743,908,'Antoine Grg',144,'Vladyslav Potapchuk',1052,'Hello Vladyslav , \n\nNous sommes deux entrepreneurs et nous souhaitons lancer notre application mobile sur le thème des soirées et de la vie nocturne. Nous sommes à la recherche d’une personne qui a de l’expérience dans le développement d’applications et de préférence qui connaisse le langage Objective C ou Swift pour développer notre application. Possibilité de s’associer sur ce projet. \n\nN’hésitez pas à me contacter en message personnel pour plus d’informations \n\nMerci\n\nAntoine&Jeremy','2016-06-11 18:01:02',1,1),(744,905,'Rob Bbvr',1,'Quentin Verriere',906,'Salut Quentin :) Content de te lire et d\'être sur Witty! Tu as raison, ma demande est très large alors que mon besoin est plutôt précis. Je recherche une personne qui a travaillé dans une boite similaire à Leetchi, avec un système de paiement au fournisseur (Papyrus ou Leetchi) qui reverse après le montant à la personne physique qui a effectué la prestation.','2016-06-12 22:02:22',1,1),(745,905,'Rob Bbvr',1,'Quentin Verriere',906,'C\'est pour mettre en place cette même ingénierie avec la banque d\'une part et le codeur du site d\'autre part.','2016-06-12 22:03:16',1,1),(746,905,'Rob Bbvr',1,'Quentin Verriere',906,'Ah oui, je cherche aussi un juriste spécialisé en droit du travail, notamment sur les différents modus sociaux: CDI, CDD, auto\nentreprenariat.','2016-06-12 22:04:47',1,1),(747,1,'Quentin Verriere',905,'Rob Bbvr',906,'D\'accord, l\'idéal serait que tu crées une page pour Papyrus pour expliquer tes besoins, et nos petites lignes de code pourront te matcher des profils derrière ;) D\'ailleurs si tu as des feedback à me faire sur le projet, n\'hésite pas ça nous aide beaucoup','2016-06-13 12:29:09',1,1),(748,1,'Quentin Verriere',905,'Rob Bbvr',906,'Pour ce qui est de ton système de paiement c\'est assez simple il te faut un bon dev, et il faut que tu utilises ce qu\'on appelle de l\'escrow payment, il y a de plus en plus de boîte qui le propose et leetchi, justement, a rendu son système de paiement accessible, ça s\'appelle Mangopay et ça fait exactement ce que tu cherches. A savoir l\'intermédiaire entre un acheteur et un vendeur, sans que tu aies à avoir toi même l\'accréditation bancaire de conserver des fonds puisque c\'est eux qui s\'en charge','2016-06-13 12:31:05',1,1),(749,1,'Quentin Verriere',905,'Rob Bbvr',906,'Stripe le fait aussi, et beaucoup d\'autres ! C\'est assez classique comme infrastructure de paiement. Mangopay est un des seuls Français mais il est très bien documenté avec un bon service client derrière, on a nous même commencé à l\'utiliser à une époque.','2016-06-13 12:32:17',1,1),(750,1,'Quentin Verriere',908,'Antoine Grg',909,'Rarement concluants les posts sur 42, tu vas vite te rendre compte que ce genre de communauté de devs est sans pitié, mais surtout sans aucune vraies connaissances de création de boîte. Ce qu\'on voit chez thefamily ou ce qu\'on lit sur techcrunch n\'est pas la vraie vie, donc ne te décourage pas face à ce genre de commentaires !','2016-06-14 00:39:53',1,1),(751,1,'Quentin Verriere',908,'Antoine Grg',909,'C\'est quoi exactement ton projet ? Et tu recherches un mec avec quelle stack? Je vais essayer de voir si je peux te trouver quelqu\'un !','2016-06-14 00:40:37',1,1),(752,435,'Moiz Hussain',11,'Serge Didenko',446,'Hi Serge.\n\nJust came across your profile.\n\nI noticed you mentioned developing a modular smartwatch. I had come across a company a little while ago that was already doing it. Please visit: https://new.chooseblocks.com for further information.\n\nIf you are already part of the above company\'s team, then I am an idiot for bringing this up.\n\nLooking forward to learning more about your product development.\n\nMoiz','2016-06-14 05:21:32',1,1),(753,908,'Antoine Grg',1,'Quentin Verriere',909,'Salut Quentin, merci pour ton ton aide. Oui, il fallait tenter le post mais je m\'attendais pas à grand chose.','2016-06-14 06:57:17',1,1),(754,908,'Antoine Grg',1,'Quentin Verriere',909,'Globalement on recherche un mec qui a déjà fait une application, qui connait donc déjà les bugs à éviter, et qui connaisse plus particulièrement soir SWIFT soit IONIC.','2016-06-14 06:58:31',1,1),(755,908,'Antoine Grg',1,'Quentin Verriere',909,'C\'est un projet qui veut modifier la façon de sortir et vivre sa soirée en créant une réelle communauté. L\'objectif est d\'apporter une nouvelle expérience aux \"partygoers\"  qui permet de combler les manques actuels quand tu veux sortir dans n\'importe quelle ville. On est que sur une appli mais le mieux serait tout de même un full stack qui serait le CTO de la startup','2016-06-14 07:05:06',1,1),(756,1,'Quentin Verriere',908,'Antoine Grg',909,'Ok cool pour swift ou ionic. Vous avez plus de détails sur l\'app, des wireframe, un petit pitch, des visuels ?','2016-06-14 11:53:35',1,1),(757,621,'Sonia Garcia (spain)',241,'Maximilien Lejeune',862,'Hello Maximilien, I am Sonia, Master degree in Marketing Direction and Digital Contents, I could be part of the team, even if I am not web and mobile development I know about Cybersecurity, Adwords, Facebook campaigns and Analytics, as well as big data and digital signage.\n\nFeel free to contact me :)','2016-06-14 12:23:01',1,1),(758,621,'Sonia Garcia (spain)',546,'Alex Weber',1167,'Hello Alex,\n\nI am Sonia, I think that I can help you in what you are exactly searching, I have read all the project, the history and story and I think that I am able to work and help you with what you need right now, I invite you and your   team to visit my profile and to ask me anything you would need to know.\n\nGreetings,\n\nSonia','2016-06-14 12:32:21',1,1),(759,241,'Maximilien Lejeune',621,'Sonia Garcia (spain)',862,'Hi Sonia, this is great ! Do you speak French ? Do you have Skype ? Please add me : maximilien.lejeune','2016-06-14 13:34:16',1,1),(760,905,'Rob Bbvr',1,'Quentin Verriere',906,'Super Quentin, merci pour le feedback :) Tu as un contact chez MangoPay ou je passe directement par leur site web? Attends le mieux c\'est qu\'on se téléphone si ça te va comme ça on échange aussi sur droit du travail et la page papyrus','2016-06-14 13:45:27',1,0),(761,905,'Rob Bbvr',1,'Quentin Verriere',906,'06 78 13 52 54','2016-06-14 13:45:35',1,0),(762,905,'Rob Bbvr',1,'Quentin Verriere',906,'Je suis dispo toute l\'après midi','2016-06-14 13:45:50',1,0),(763,621,'Sonia Garcia (spain)',241,'Maximilien Lejeune',862,'I will add you :) So good to know about you! Yeah, I speak French, 4 languages (English, French, Spanish, Italian) and currently studying Chinese, I did my exam HSK1 this last Sunday :)','2016-06-14 14:02:08',1,1),(764,908,'Antoine Grg',1,'Quentin Verriere',909,'Nous sommes trois entrepreneurs à la recherche d\'un développeur pour nous accompagner dans la création d\'une application mobile qui a pour vocation de révolutionner la façon de choisir et vivre sa soirée et de combler les manques actuels lorsque l’on sort le week-end (ou plus ;) ).  Le concept et le business plan de l’application ont été validés par le corps professoral de UC Berkeley et pitchés devant des investisseurs. \n\nL’application doit avoir plusieurs fonctionnalités : géolocalisation + pouvoir partag','2016-06-14 14:43:17',1,1),(765,908,'Antoine Grg',1,'Quentin Verriere',909,'(c\'est le pitch qui résume un peu tout)','2016-06-14 14:43:54',1,1),(766,908,'Antoine Grg',1,'Quentin Verriere',909,'D\'ailleurs félicitations pour le site :)','2016-06-14 14:46:59',1,1),(767,905,'Rob Bbvr',1,'Quentin Verriere',906,'J\'ai peut-être une idée pour notre besoin de juriste travail','2016-06-14 16:25:49',1,1),(768,1,'Quentin Verriere',905,'Rob Bbvr',906,'On peut s\'appeler demain ?!','2016-06-14 20:35:23',1,1),(769,1,'Quentin Verriere',908,'Antoine Grg',909,'Ahah','2016-06-14 20:35:47',1,0),(770,1,'Quentin Verriere',908,'Antoine Grg',909,'c\'est quoi l\'histoire de Berkeley ?','2016-06-14 20:36:00',1,0),(771,1,'Quentin Verriere',908,'Antoine Grg',909,'Merci, tu en penses quoi, des recommendations ?','2016-06-14 20:36:13',1,0),(772,1,'Quentin Verriere',908,'Antoine Grg',909,'Bon du coup postez votre projet et on va essayer de vous trouver quelqu\'un. Petit pitch en quelques lignes, une photo sympa (regarde youshould qui est dans la même veine que vous) pas besoin de vous prendre la tête.','2016-06-14 20:40:27',1,0),(773,908,'Antoine Grg',1,'Quentin Verriere',909,'Ok donc pitch plus court ;) je vais regarder youshould pour voir à quoi ça ressemble','2016-06-14 21:52:19',1,0),(774,908,'Antoine Grg',1,'Quentin Verriere',909,'Franchement gros potentiel pcq j\'ai l\'impression que c\'est un vrai soucis de trouver des gens qui correspondent aux attentes de chacun. Après, l\'idée de la recherche est géniale mais j\'ai jamais l\'impression qu\'elle me sort un mec qui correspond à ce que je recherche (peut-être n\'existe-t-il pas :) ).  Peut-être essayer de donner davantage d\'info sur les petites vignettes (du type 2-3 skills) du user pour simplifier la recherche de l\'internaute.','2016-06-14 21:56:34',1,0),(775,908,'Antoine Grg',1,'Quentin Verriere',909,'et Berkeley c\'est parce que j\'ai étudié la bas avec mes associés. On a pu rencontré quelques investisseurs et pitchés notre BP devant eux. Ils ont aimé l\'idée et nous ont donné des bonnes recos :)','2016-06-14 21:59:41',1,0),(776,931,'Nick Snopov',1,'Quentin Verriere',932,'Hello Quentin) Wittycircle is a great project. However, he is a little behind in functionality and UX from analogues.\nAt first sight, I was confused a few small details:\n- When I wrote the message and accidentally clicked on an area outside the pop-up - my message is lost completely.\n- Take a look at the cover of my profile - it is stretched and does not look like I was conceived. Probably it is necessary to implement a possibly adjust (as in Twitter)\n- Some pop-ups - have no pointers to scroll. it\n- In the','2016-06-14 22:15:10',1,1),(777,931,'Nick Snopov',1,'Quentin Verriere',932,'- In the wizard when creating a new project, the \"back\" button returns to the previous item on the current and back, if you press the \"back\" button on the third step, I will return to the second step, and with his back to the third step.\n- List of followers may be very large, it is now displayed in a pop-up - maybe it better to make on the page?\nSorry for my English)','2016-06-14 22:24:09',1,0),(778,1,'Quentin Verriere',931,'Nick Snopov',932,'Very useful feedback Nick. We are a very small team doing our best to improve ux and solve bugs. We obviously can\'t handle all of them at the same time but i\'ll do my best to fix those you listed in the coming days.','2016-06-14 23:46:21',1,1),(779,1,'Quentin Verriere',931,'Nick Snopov',932,'Can you tell me how you could use the platform for?','2016-06-14 23:46:49',1,1),(780,1,'Quentin Verriere',931,'Nick Snopov',932,'However i\'m quite confused about your cover pic issue, shouldn\'t be streched as we use auto witdh to keep image ratio and zoom into it if needed','2016-06-14 23:48:25',1,1),(781,1,'Quentin Verriere',908,'Antoine Grg',909,'Top. Pour ce qui est du pitch ne soyez pas forcément courts, donnez des détails, personne ne vous volera quoique ce soit, les visuels plaisent beaucoup. Et si vous voulez essayer de monter dans le ranking sollictez des upvotes.','2016-06-14 23:50:19',1,1),(782,1,'Quentin Verriere',908,'Antoine Grg',909,'Pour ce qui est de la recherche les algo sont assez compliqués et forcément on n\'a pas encore 1 million d\'utilisateurs donc chaud de fitter parfaitement. En l\'occurence on est en train de refaire un super truc pour les pages meet et discover. On trouve que la recherche est toujours très cool mais l\'affichage des résultats vraiment pas top et pas très clair. Je te préviendrai quand la nouvelle version sortira (soon) et l\'ajout des skills sur les user cards est au programme ;)','2016-06-14 23:52:02',1,1),(783,905,'Rob Bbvr',1,'Quentin Verriere',906,'Oui avec plaisir','2016-06-15 06:25:30',1,1),(784,908,'Antoine Grg',1,'Quentin Verriere',909,'Merci pour ton aide sur ce sujet. Une dernière reco si je peux me permettre (pour améliorer l\'exp utilisateur) , en tant qu\'user j\'aime bien ouvrir des nouveaux onglets en cliquant sur les user cards, sauf erreur de ma part, je ne peux pas le faire (on ne me propose pas ouvrir un nouvel onglet/fenêtre avec le click droit). Ainsi lorsque je cherche un projet ou un dev, je suis obligé d\'aller sur sa page avant de revenir sur la page de recherche etc.','2016-06-15 07:49:57',1,1),(785,11,'Serge Didenko',435,'Moiz Hussain',446,'Hi Moize, thanks ! I hadn\'t heard about blocks, it looks pretty neat. Modular smartwatch is on stand by for now. What are you up to ?','2016-06-15 09:59:00',1,1),(786,11,'Serge Didenko',562,'Jake Rosenthal',573,'Hi Jake, sorry for my late answer. Modular smartwatch is on standby now but i\'ll definitely call on you the day we need a gd. What are your other projets.','2016-06-15 10:00:58',0,1),(787,933,'Caroline Bercegeay',1,'Quentin Verriere',934,'Comment passe-t-on d\'un stage chez Lazard à Wittycircle ? :)\n\nJ\'ai eu connaissance du site dans ma recherche d\'un développeur en Intelligence Artificielle par Recast.\nPremières impressions: l\'ergonomie du site est très agréable, facile. Bon point!\n\nJe te donnerai plus de feedback le jour où j\'aurais trouvé quelqu\'un pour m\'accompagner dans mon projet :)\nBonne continuation!','2016-06-15 12:44:30',1,1),(788,62,'Jonathan Etaix',908,'Antoine Grg',970,'Hello Antoine,','2016-06-15 13:04:13',1,1),(789,62,'Jonathan Etaix',908,'Antoine Grg',970,'Oups le cmd+return ne marche pas sur Wittycircle :)','2016-06-15 13:04:47',1,0),(790,62,'Jonathan Etaix',908,'Antoine Grg',970,'heureux d\'attirer ton attention mais je ne fais ni d\'Objective C ni Swift. Je suis surtout orienté Web et Front -> ReactJs. Il y a effectivement react natif mais je ne suis pas asse expert pour prétendre passer une app en prod.','2016-06-15 13:06:56',1,0),(791,62,'Jonathan Etaix',908,'Antoine Grg',970,'en revanche je connais de bon dev Objective C/Swift en free','2016-06-15 13:07:27',1,0),(792,908,'Antoine Grg',62,'Jonathan Etaix',970,'Salut Jonathan, merci pour ta réponse :)','2016-06-15 13:10:30',1,1),(793,1,'Quentin Verriere',933,'Caroline Bercegeay',934,'Hello Caroline,','2016-06-15 13:13:13',1,1),(794,908,'Antoine Grg',62,'Jonathan Etaix',970,'Je pense que ReactJs marche également, le must était Swift (pour l\'UX) mais plus le temps passe, plus j\'affine la recherche. Je vise également des gens qui savent travailler via Ionic. Tu as déjà dev des applis ?','2016-06-15 13:13:25',1,1),(795,1,'Quentin Verriere',933,'Caroline Bercegeay',934,'Lazard n\'était pas ma tasse de thé, j\'ai donc commencé à bosser sur le projet la nuit, au chaud, là bas, avant de démissionner. Je vais voir si je peux te trouver des gens intéressé, mais ça vaudrait le coup de donner un peu plus de contenu sur ta page pour qu\'ils aient les idées plus claires. Vous avez des visuels?  Keep you posted','2016-06-15 13:15:06',1,0),(796,908,'Antoine Grg',62,'Jonathan Etaix',970,'On est globalement à la recherche d\'un associé qui deviendrait CTO de notre startup. Notre appli veut permettre à l\'user de trouver la soirée qui lui correspond réellement et d\'éviter les soirées \"galères\"','2016-06-15 13:15:55',1,1),(797,908,'Antoine Grg',62,'Jonathan Etaix',970,'Mais si tu connais des personnes qui savent donc Swift/Ionic ou même ReactJs qui pourrait être freelance (au pire au début de l\'aventure) puis de devenir notre associé par la suite, n\'hésite pas ça nous aiderait vraiment :) Si tu es toi-même intéréssé on peut s\'organiser un skype pour que je te présente plus en détail ce que l\'on souhaite faire','2016-06-15 13:17:37',1,1),(798,933,'Caroline Bercegeay',1,'Quentin Verriere',934,'Ahha, je vois tout à fait l\'expérience que tu as vécues. Bonne idée pour le contenu... Le truc, c\'est que je suis au stade de MVP...ça fait toujours un peu flipper de donner beaucoup de détails :)','2016-06-15 13:20:47',1,0),(799,1,'Quentin Verriere',933,'Caroline Bercegeay',934,'Mais tu dois savoir que ce flippe est infondé et que plus tu en parles, plus tu vas vite, plus tu corriges et j\'en passe ! Une MVP ça doit vivre ! Mais je comprend c\'est assez peu naturel de parler d\'un projet au stade embryonnaire, on est passé par là, mais in fine, tant de bénéfices pour WItty de l\'avoir partagé autour de nous, je t\'assure que ça vaut le coup !','2016-06-15 13:34:27',1,1),(800,62,'Jonathan Etaix',908,'Antoine Grg',970,'Yes on peut se faire un skype ou se boire un café/bière un soir ?','2016-06-15 15:14:15',1,1),(801,62,'Jonathan Etaix',908,'Antoine Grg',970,'je fais beaucoup de react depuis 2ans sur des grosse webapp/dashboard/monitoring. J\'ai aussi fait du ionic chez Kiwapp. Je suis curieux sur react natif quelque test mais rien en prod.','2016-06-15 15:16:26',1,1),(802,435,'Moiz Hussain',11,'Serge Didenko',446,'Hi Serge.','2016-06-15 18:16:37',1,1),(803,435,'Moiz Hussain',11,'Serge Didenko',446,'Yes, I Wanted to inform you about Blocks as they too are based in London, which is where you are too. Thought i\'d pass on the information so that you could see what your competition is like :) Well I am into Business Development, mostly dealing with Pipeline Components supplied to EPC\'s. My skills involve negotiations with manufacturers, management. I am highly interested to be a part of a Startup to develop and grow an innovative concept. It sounds very vague, but for now that is what it is. WittyCircle se','2016-06-15 18:20:27',1,1),(804,1,'Quentin Verriere',940,'Clara Riberolles',941,'Eheh, quel plaisir de te voir ici.','2016-06-15 23:43:46',1,1),(805,940,'Clara Riberolles',1,'Quentin Verriere',941,'Salut Quentin ! Et oui, il était temps ! J\'avoue que l\'anglais me freine un peu... Je débute juste, il va falloir que je me fasse un profil qui ressemble à quelque chose','2016-06-16 00:33:15',1,1),(806,1,'Quentin Verriere',940,'Clara Riberolles',941,'Si tu as besoin d\'aide, n\'hésite pas !','2016-06-16 00:45:02',1,1),(807,908,'Antoine Grg',62,'Jonathan Etaix',970,'Oui, tu es sur Paris ? Si oui tu penses que le vendredi 24 aprem tu serais dispo ? En ce moment tu es sur un projet ou tu es dispo pour un nouveau ? (simplement pour qu\'il n\'y est pas d’ambiguïté sur notre rencontre ;) )','2016-06-16 08:03:41',1,0),(808,62,'Jonathan Etaix',908,'Antoine Grg',970,'Oui je suis sur Paris. Actuellement je suis en CDI mais je regarde pour d\'autre opportunités/free.','2016-06-16 09:27:17',1,1),(809,908,'Antoine Grg',62,'Jonathan Etaix',970,'Dac, ben si ça t’intéresse on peut donc se rencontrer le 24 aprem, tu pourrais ?','2016-06-16 10:32:58',1,1),(810,11,'Serge Didenko',435,'Moiz Hussain',446,'Very nice. Obviously your message was cut.','2016-06-16 13:23:36',1,0),(811,435,'Moiz Hussain',11,'Serge Didenko',446,'What keeps you busy during work hours every day?','2016-06-16 14:01:12',1,1),(812,940,'Clara Riberolles',1,'Quentin Verriere',941,'Ok, merci !','2016-06-16 19:16:55',1,0),(813,931,'Nick Snopov',1,'Quentin Verriere',932,'Hello)\nI am interested in Wittycircle from several sides.\n- I will be interested to help in the implementation of any interesting projects and is always open to assist.\n- I think for a long time on the organization of a number of start-ups. I have accumulated a lot of ideas, and I\'m always looking for people who are interested in these ideas. At the current time I am thinking and planning)\nTherefore, the portal is interesting to me where I can find support and perhaps strongest teammates.','2016-06-16 21:52:19',1,1),(814,931,'Nick Snopov',1,'Quentin Verriere',932,'I\'m in Russia - it is difficult to create your own start-ups and participation in the coolest projects. If Wittycircle will anything help to overcome this barrier, it will be wonderful.\n\nHowever, for major investments and implementation of MVP (including a passport for startup) need celestial advisor.\nIf Wittycircle may attract such advisors ??- it will be a bomb)','2016-06-16 21:53:36',1,1),(815,931,'Nick Snopov',1,'Quentin Verriere',932,'I turned my attention to one detail. When I create a project you need to select the project category. Now this is one category value. And what if the choice to implement search using tags (labels)?','2016-06-16 22:02:53',1,1),(816,931,'Nick Snopov',1,'Quentin Verriere',932,'If implement the project category via tags (labels)?','2016-06-16 22:05:44',1,1),(817,931,'Nick Snopov',1,'Quentin Verriere',932,'I understand that it is used for filtering. However, almost never seen projects fall exclusively into one category.\nMaybe we should make a separate box in the project settings - tags (tags). And cltkfnm search for tags. This can greatly facilitate the search for projects.','2016-06-16 22:14:07',1,1),(818,931,'Nick Snopov',1,'Quentin Verriere',932,'Hah. I\'m so ashamed for my English. I feel that I would go to the EN classes from tomorrow..','2016-06-16 22:18:43',1,1),(819,1,'Quentin Verriere',931,'Nick Snopov',932,'Haha, i understand you perfectly. Really nice to read you.','2016-06-16 22:39:02',1,1),(820,1,'Quentin Verriere',931,'Nick Snopov',932,'Now about the categories: if we want project to be easily understood and searched/filtered we need to put them into categories.. Queries would be way to hazardous if people could set up their own tags. What we plan to do is set up this system for skills (people will be able to add their own skills) and we will create sub categories for project pages','2016-06-16 22:40:33',1,1),(821,1,'Quentin Verriere',931,'Nick Snopov',932,'99% of the time you can affiliate a project into some sort of categorie, our job is to be sure project holders feel right about it, and there come the subcat. But adding tags to projects as a second option would be doable, why not. i put that in my ideas box Nick :)','2016-06-16 22:42:09',1,1),(822,569,'Harry Kaczka',11,'Serge Didenko',580,'Tell me some details man! I feel like you have a neat idea up your sleeve that\'s even more than the World\'s First Modular Smartwatch. I\'m wearing my fitbit right now and man do I love the timer, but there\'s a ton of other features I could rack my brain and come up with in 5 minutes you know? Anyway, I was just curious and wish you the best of luck. Cheers!','2016-06-17 13:38:19',1,1),(823,569,'Harry Kaczka',151,'Johan Sufjan',720,'Those are some mighty cool interests you have listed there. What type of product design experience do you have if you don\'t mind me asking? I\'m not really sure what kind of answer I\'m looking for so there couldn\'t be less pressure lol.','2016-06-17 13:40:00',0,1),(824,933,'Caroline Bercegeay',1,'Quentin Verriere',934,'Yes, tu as complètement raison, et je suis la première à dire qu\'une idée ne vaut rien.... :) Je vais compléter au max mon profil.','2016-06-20 09:02:30',1,0),(825,1,'Quentin Verriere',972,'James Palmer',973,'Hi James, i recently saw your nice comment on Facebook, glad you like our project.','2016-06-20 09:14:30',0,1),(826,1,'Quentin Verriere',972,'James Palmer',973,'Would you mind sharing your first impressions of the service? Did you understand why we\'re building such a platform? Experienced any bugs? Any improvement suggestions?','2016-06-20 09:15:34',0,1),(827,1,'Quentin Verriere',972,'James Palmer',973,'We\'re still very young but are doing our best to improve the service everyday, and i\'m sure we can do something Huge with it.','2016-06-20 09:16:00',0,1),(828,933,'Caroline Bercegeay',97,'Anne van Rossum',1030,'HelloAnne,\n\nAccording to the 2 start ups you run, you seem to be an amazing serial entrepreneur ;) Well done.\nWhen did you launch your start up in bots ? How do you recruit your  tech profiles especially expert in AI ? \nI am looking for a profile like this in Paris...and I was wondering if your know somebody in your network working in AI and based in France ?\n\nBest, \nCaroline','2016-06-20 09:47:43',1,1),(829,11,'Serge Didenko',435,'Moiz Hussain',446,'well i get some rest on week ends. I\'m trying to find a new project to work. Have some energy to spend ! And you ?','2016-06-20 09:55:08',1,1),(830,1,'Quentin Verriere',569,'Harry Kaczka',570,'Hi Harry, i\'m one of the guys behind this project.','2016-06-20 09:56:52',1,1),(831,1,'Quentin Verriere',569,'Harry Kaczka',570,'Just had a look at your insightful description','2016-06-20 09:57:33',1,1),(832,11,'Serge Didenko',569,'Harry Kaczka',580,'Hi Harry ! That\'s really nice. Actually, MSW is on stand by right now. I have several things to figure out. And you what are you up to ?','2016-06-20 09:57:36',1,1),(833,1,'Quentin Verriere',569,'Harry Kaczka',570,'We \'re doing our best to improve the service and are we\'re working on every single points you mentioned ;)','2016-06-20 09:58:09',1,1),(834,645,'Frida Wang',1045,'Steven Scemama',1690,'If i may: you should put your \"pornhub\" project in private :) Or maybe you really want to revolutionize the porn industry?','2016-06-20 13:15:58',1,1),(835,1045,'Steven Scemama',645,'Frida Wang',1690,'haha thx (and no i was just triying;))','2016-06-20 13:29:44',0,1),(836,1062,'Chris Aram',169,'Marc Backes',1231,'Hi Marc,\n\nTwo of my (undeveloped) side-projects are www.panicalarm.org (a mobile app that seems to be similar to your BlckBox concept - not just for kidknappings, but also for multiple other scenarios) and www.searchteams.com (an app that coordinates search teams in the event of a kidnapping / shooting / earthquake etc). I\'ve put quite a lot of thought into the projects and reckon I could probably add value to what you\'re doing. Give me a shout if you want to chat.\n\nCheers,\n\nChris','2016-06-20 18:43:41',1,1),(837,1,'Quentin Verriere',1062,'Chris Aram',1063,'Hi Chris','2016-06-20 19:45:56',1,1),(838,1,'Quentin Verriere',1062,'Chris Aram',1063,'I did some modifications in your need cards. Hope you don\'t mind','2016-06-20 19:54:47',1,0),(839,1,'Quentin Verriere',1062,'Chris Aram',1063,'But you got to select some skills if you want to be crawled  and then displayed to our users','2016-06-20 19:55:33',1,0),(840,62,'Jonathan Etaix',908,'Antoine Grg',970,'Ok pour le 24 en fin d\'aprem par contre ?','2016-06-21 13:32:18',1,1),(841,57,'Minh nhut Nguyen',241,'Maximilien Lejeune',298,'Hi Maximilien, Thank you for your invitation, it looks interesting but right now I haven\'t got any time for side projects. I guess other guys on Wittycircle should be more available or maybe on entreprise.42.fr (it\'s a dev school). Sorry. Cheers !','2016-06-21 13:42:58',1,1),(842,169,'Marc Backes',1062,'Chris Aram',1231,'Hi Chris!','2016-06-21 21:13:22',1,1),(843,169,'Marc Backes',1062,'Chris Aram',1231,'Sorry, I couldn\'t access the websites you send me. But it seems you have quite the interest and skills in location-based apps.','2016-06-21 21:13:49',1,0),(844,169,'Marc Backes',1062,'Chris Aram',1231,'We should talk about your expertise. If you are interested in joining us, we would be thrilled to have extra developers.','2016-06-21 21:14:50',1,0),(845,169,'Marc Backes',1062,'Chris Aram',1231,'We\'re not funded at the moment, but I\'m sure we can work something out. Where are you located?','2016-06-21 21:15:25',1,0),(846,9,'Olivier Hamelin',241,'Maximilien Lejeune',250,'Hi Maximilien,\nI\'m Olivier, co-founder of Wittycircle. I just wanted to be sure you enjoy the experience. Don\'t hesitate to give me feedback.\nBy the way, I was wondering why you created 2 times a WIZPAY project. Our community might get confused. Don\'t you think ?\nCheers !','2016-06-21 22:25:59',1,1),(847,241,'Maximilien Lejeune',621,'Sonia Garcia (spain)',862,'Salut Sonia, ça va ?','2016-06-21 22:30:23',1,1),(848,241,'Maximilien Lejeune',9,'Olivier Hamelin',250,'Hi Olivier,','2016-06-21 22:34:31',1,1),(849,241,'Maximilien Lejeune',9,'Olivier Hamelin',250,'I just id because I didn\'t see the first project being posted anywhere on the site, therefore I was myself confused to whether my project was on the site at all? I can see some projects coming up on the homepage of the site, but not WIZPAY, so is that an option to have it on the first page this time? Thanks Olivier :)','2016-06-21 22:36:11',1,1),(850,1062,'Chris Aram',169,'Marc Backes',1231,'Hi Marc! I\'m not a developer myself...more of an ideas / strategy / business developer. The sites aren\'t live...I purchased the domains while they were available, with the view to develop them in the future. Following a degree in BSc Product Design, and then 6 years as an Officer in the British Army, I worked in the Security Industry for a while and spent a lot of time thinking about how to react in emergency situations - hence the ideas were born. I spent 6 months in San Francisco last year...investigating','2016-06-21 22:43:26',1,1),(851,1062,'Chris Aram',1,'Quentin Verriere',1063,'Hi Quentin...I\'m having real problems sending messages. Just spent 10 minutes writing a message that disappeared when I pressed send....and a previous message that I had sent isn\'t letting me view all of it. Just so you know','2016-06-21 23:15:57',1,1),(852,1062,'Chris Aram',169,'Marc Backes',1231,'Just wrote out 3 (long) use cases that were deleted when I pressed send...so here goes again!','2016-06-21 23:17:18',1,1),(853,1,'Quentin Verriere',1062,'Chris Aram',1063,'I\'m so sorry Chris.','2016-06-21 23:20:32',1,0),(854,1,'Quentin Verriere',1062,'Chris Aram',1063,'We are aware of those issues. we\'re currently rebuilding the messaging features (quite updated now) and i\'ll let you know as soon as it\'s fully done','2016-06-21 23:21:19',1,0),(855,1,'Quentin Verriere',1062,'Chris Aram',1063,'But yep we know, message is not saved when you quit the popup, some messages don\'t reappear into your message feed etc...','2016-06-21 23:23:05',1,0),(856,1,'Quentin Verriere',1062,'Chris Aram',1063,'We have tons of things to handle and a very small team yet, but i moved this issue to our #1 priority, should be done before the end of the week :)','2016-06-21 23:23:47',1,0),(857,1062,'Chris Aram',169,'Marc Backes',1231,'case 1) a girl walks home from a night out and thinks she\'s being followed. She activates the Panic Alarm (by shaking the phone) and it alerts her friends in the area, local volunteers in the area, and police in the area to respond (the app would coordinate who responds rather than sending everyone). We could integrate with Uber\'s API and with local taxis too, so that if no one is immediately available, we dispatch a driver as an emergency first responder. The app could also call the user (decreasing the ch','2016-06-21 23:24:13',1,1),(858,1062,'Chris Aram',1,'Quentin Verriere',1063,'I\'m sure you do...wasn\'t having a go, but rather just making you aware of it. I think this site\'s great and will become very popular fast! Keep up the good work :)','2016-06-21 23:28:11',1,1),(859,8,'Jay Ho',1062,'Chris Aram',1070,'Hi Chris, we\'re well aware of the issues you just reported to Quentin, just to let you know it will be fully functional in less than 48h. Best','2016-06-21 23:28:37',1,1),(860,1062,'Chris Aram',169,'Marc Backes',1231,'case 2) theres a mass shooting and someone activates their Panic Alarm (perhaps by shaking the phone and saying \'shooting\'). The app concurrently alerts Police and all other users in the vicinity...directing them to move away from the incident. It requests feedback from users (details of shooter / number of shooters / weapons used / locations etc) and starts to build up a picture of the incident that can inform the Police response team. The app could automatically listen for gunshots and triangulate the noi','2016-06-21 23:33:18',1,1),(861,1062,'Chris Aram',169,'Marc Backes',1231,'clearly this messaging function isn\'t working properly as I keep losing messages and it\'s not fully displaying the ones that I\'ve sent!!','2016-06-21 23:35:39',1,1),(862,1062,'Chris Aram',169,'Marc Backes',1231,'If you\'re interested to chat anymore....to hear more use cases and to perhaps investigate any future collaboration, drop me a line at chris@englishperfected.com - it\'s too frustrating having to retype each message several times!!! Cheers','2016-06-21 23:37:23',1,1),(863,908,'Antoine Grg',62,'Jonathan Etaix',970,'Jonathan, malheureusement le 24 est devenu compliqué depuis. es-tu dispo demain ? (jeudi 23) à 18h/18h30 à concorde ? Mon numéro est le 0621684730. Pour rappel,  nous cherch