intéressé pour rejoindre la team et faire avancer le projet en améliorant le site.</p><p><br></p><p>Donc si ça te tente :)</p>','2016-07-01 14:09:51',1,1),(930,621,'Sonia Garcia (spain)',8,'Jay Ho',629,'<p>Jay ~ This weekend is perfect! I have time tomorrow, we will care our dear Witty and make it even better as it must be ^^</p><p><br></p><p>I write in English to make you train yourself haha ^^ but I can write in French ^^ I understand that you are working hard and more if you are in the middle of a new functional searching algorithm and messaging :)</p>','2016-07-03 00:01:14',1,1),(931,1,'Quentin Verriere',1267,'Vincent Cap',1268,'<p>Hello Vincent,</p><p><br></p><p>Dis moi, j\'ai vu que tu avais créé 21 versions de ton projet, j\'aimerai savoir si c\'est un bug de notre côté ou bien juste une erreur de ta part. peux tu m\'en dire plus? :)</p>','2016-07-03 17:40:01',0,1),(932,1,'Quentin Verriere',1270,'Roselyn Opel',1271,'<p>Hi Roselyn, i just came across your project.</p><p>We don\'t allow our project to raise funds at the moment but it\'s a work-in-progress feature.&nbsp;</p><p>I\'m ok you ask our users to fund your project on a third party website but i\'d recomend you provide more informations on your page about what you guys are doing. I\'m sure you have a few pictures of your initiative. It would really help and i\'d be able to give you a little push as soon as yoru page is more complete.</p><p><br></p><p><br></p><p><br></p>','2016-07-03 21:37:51',1,1),(933,1,'Quentin Verriere',1270,'Roselyn Opel',1271,'<p>If you need anything beside, do not hesitate to reach us ;)</p>','2016-07-03 21:38:24',1,1),(934,1270,'Roselyn Opel',1,'Quentin Verriere',1271,'<p>Thanks Quentin for your message. i will review and add a bit more information.</p><p>I appreciate your input</p>','2016-07-04 16:17:01',1,1),(935,1270,'Roselyn Opel',1,'Quentin Verriere',1271,'<p>Quentin, kindly review and advice what more you would like to see on the project page</p>','2016-07-04 17:08:42',1,1),(936,1,'Quentin Verriere',1270,'Roselyn Opel',1271,'<p>Looks way better ;)&nbsp;</p>','2016-07-04 17:58:11',1,0),(937,1270,'Roselyn Opel',1,'Quentin Verriere',1271,'<p>Thanks, &nbsp;what more can i do ?</p>','2016-07-04 18:23:28',1,1),(938,8,'Jay Ho',1292,'3 Curious Monkeys',1300,'<p>Hi, Thank you for posting your project on Wittycircle.&nbsp;</p><p><br></p><p>I noticed that you have a little difficulty to copy the project from Kickstarter. Therefore I modified your project here to look like the same on Kickstarter.&nbsp;</p><p>Please check if there are still errors.</p><p><br></p><p>Best, &nbsp;Jay</p>','2016-07-06 14:09:33',1,1),(939,1292,'3 Curious Monkeys',8,'Jay Ho',1300,'<p>looks great! Thanks</p><p><br></p>','2016-07-06 14:55:06',1,1),(940,1312,'Karthik P',557,'Emma Pittsley',1869,'<p>Great Idea.&nbsp;</p>','2016-07-08 08:49:29',0,1),(941,1313,'Louis Hamaide',565,'Riddhima Ramnani',1878,'<p>Hey Riddhima,<br></p><p>Would you be looking for a job ? I\'m looking for somebody in design for an app. Look up my profile, it has a quick pitch ;)&nbsp;</p><p>We\'re in Paris.</p><p>Best</p>','2016-07-08 13:51:55',0,1),(942,1313,'Louis Hamaide',991,'Eloïse Nhn',2304,'<p>Salut Eloïse, ca t\'intéresserait de rejoindre une start-up? On cherche des experts pour la comm et le marketing pour une marketplace / réseau social étudiante.</p><p>Regardes mon profil, tu y verras un petit pitch dessus ;)&nbsp;</p>','2016-07-08 14:00:08',0,1),(943,1313,'Louis Hamaide',1271,'Dubravka Novak',2584,'<p>Hey Dubravka!</p><p>Are you looking for a start-up to work for? We have a need of creating visual content for the&nbsp;branding of an app we want to launch end of september.</p><p>We\'re two crazy entrepreneurs&nbsp;based in Paris.</p><p>Louis from Swapbook (look up my profile, you\'ll find a quick pitch)</p>','2016-07-08 14:04:27',0,1),(944,1313,'Louis Hamaide',1231,'Hélène de Lépinau',2544,'<p>Hey Hélène!&nbsp;</p><p>Are you looking for a start-up to join? :)&nbsp;</p><p>We\'d love to get to meet! We\'re launching an app in September for students in the Paris region. You can find some info about the concept on my page.</p><p>We\'re two crazy financiers looking to get some graphic designs done for marketing, the app et tutti quanti.</p><p>If you\'re in Paris, we\'re in the Sentier neighborhood at The SchooLab. Come visit us&nbsp;whenever you\'d like!</p>','2016-07-08 14:08:20',1,1),(945,1318,'Bernard Sacy',966,'John Elliott',2284,'<p>Hello John,</p><p>How are you? we are a small start-up based in Paris and starting our entrepreneurship journey.</p><p>we are looking for a skilled industrial engineer who can design,&nbsp;conceive and build a bio plant in order to grow microalgae.</p><p>As we are currently base in France and are looking for people to work with in EU,</p><p>Would you by any chance know someone that could be interested?</p><p>Have a great day</p><p>Sacy</p>','2016-07-11 16:02:56',1,1),(946,1318,'Bernard Sacy',770,'Dominique BLANCHARD',2088,'<p>Hello Dominique,</p><p>We are a small start-up in biotech, we are working on micro algae production.&nbsp;</p><p>We are planing on growing the team and incorporate skilled and enthusiastic people. Are you currently free? What are your motives and your goals?</p><p>Maybe we can chat soon?</p><p>Sacy</p><p><br></p>','2016-07-11 16:06:01',1,1),(947,966,'John Elliott',1318,'Bernard Sacy',2284,'<p>Hi Bernard,</p><p><br></p><p>I&nbsp;can ask around. Are you interested in someone to scale up some existing hatcheries you have nailed down at a small scale?</p><p><br></p><p>John</p>','2016-07-11 17:27:49',1,1),(948,770,'Dominique BLANCHARD',1318,'Bernard Sacy',2088,'<p>Dear Bernard,</p><p>Thank you &nbsp;for your message. &nbsp;Indeed, I\'m currently actively looking &nbsp;to explore new &nbsp;venture. My motivation&nbsp;is &nbsp;to &nbsp;make the best use of the expending scientific knowledge to solve the &nbsp;most important challenges. I would welcome the opportunity to learn more on your activities . We could set up an appointment next week in &nbsp;Paris . You could send me email at &nbsp;dominiquealain.blanchard@gmail.com</p><p>Regards</p><p>Dominique</p>','2016-07-11 20:44:05',1,1),(949,1313,'Louis Hamaide',1321,'Lucas Liabeuf',2634,'<p>Salut Lucas,</p><p>J\'ai vu que tu as regardé mon profil, est-ce que ce projet t\'intéresserait?</p><p>Avec Laure mon associé on adorerais prendre un café et t\'expliquer le concept si ca te dis.&nbsp;</p><p>Bien à toi!</p><p>Louis</p>','2016-07-12 16:31:01',0,1),(950,621,'Sonia Garcia (spain)',8,'Jay Ho',629,'<p>Jay, Are you here?</p>','2016-07-12 22:41:43',1,1),(951,8,'Jay Ho',1328,'Mel Anie',1336,'<p>Bonjours Anie,</p><p><br></p><p>Je reviens vers toi pour le bug que tu as rencontré au niveau de la messagerie, peux tu m\'en dire plus sur le problème ?</p>','2016-07-13 10:25:18',0,1),(952,1318,'Bernard Sacy',966,'John Elliott',2284,'<p>Thanks that would be great,</p><p>We are more looking at someone who can help scaling up&nbsp; a micro algae production facility.</p><p>Bernard</p><p><br></p>','2016-07-13 17:06:59',0,1),(953,55,'Jean Vallette d\'Osia',9,'Olivier Hamelin',64,'<p>Si</p>','2016-07-18 08:45:30',0,1),(954,933,'Caroline Bercegeay',1314,'Antoine Jochyms',2247,'<p>Bonjour Antoine,</p><p><br></p><p>Ton profil m\'intéresse car je recherche actuellement une personne pour travailler sur le community management de ma start up :)</p><p>A quelle hauteur souhaites-tu t\'impliquer dans un projet ?</p><p><br></p><p>Je te laisse consulter notre service: petitequestion.fr et n\'hésite pas à me contacter si tu es intéressé ou juste curieux du projet :)</p><p>(Il n\'y a pas forcément besoin d\'aimer les enfants )</p><p><br></p><p>Caroline</p>','2016-07-20 12:41:55',0,1),(955,933,'Caroline Bercegeay',744,'Thiébaut Kientz',1677,'<p>Bonjour Thiébaut,</p><p><br></p><p>Je viens&nbsp;de voir ton profil. Quel genre d\'opportunité recherches-tu ?</p><p>Je viens de lancer Petitequestion.fr et je recherche un partenaire à plein temps.</p><p><br></p><p>A bientôt !?</p><p>Caroline</p>','2016-07-20 12:51:50',1,1),(956,933,'Caroline Bercegeay',52,'Charlotte Hamelin',985,'<p>Bonjour Vharlotte,</p>\n\n<p>Je viens&nbsp;de voir ton profil. Quel genre d\'opportunité recherches-tu ?</p><p><br>Je viens de lancer Petitequestion.fr et je recherche un partenaire à plein temps.</p>\n\n<p>A bientôt !?<br>Caroline</p>','2016-07-20 12:53:01',0,1),(957,933,'Caroline Bercegeay',1,'Quentin Verriere',934,'<p>Bonjour Quentin, j\'ai 3&nbsp;questions.</p><p>Je viens de voir de beaux profils sur le site.&nbsp;</p><p>1/Comment ces personnes ont-elles connu ton site ?</p><p>2/ comment éviter de revenir sur la page d\'accueil et devoir re-rentrer les critères une fois que j\'ai consulté un profil ?</p><p>3/ Je ne parviens pas à écrire un message à Kassandre Pedro: lorsque je clique sur send, rien ne se passe....</p><p><br></p><p>Merci par avance,</p><p>Caroline</p>','2016-07-20 13:09:11',1,1),(958,933,'Caroline Bercegeay',1009,'Benoit Charpentier',1942,'<p>Bonjour Benoit,</p><p><br></p><p>Votre profil est très intéressant.</p><p>Je viens de lancer Petitequestion.fr</p><p><br></p><p>Quelle type d\'opportunité recherchez-vous ?</p>','2016-07-20 13:26:31',1,1),(959,933,'Caroline Bercegeay',218,'Kassandre Pedro',1151,'<p>Bonjour Kassandre,</p>\n\n<p>Ton&nbsp;profil est très intéressant :)</p><p><br>Je viens de lancer Petitequestion.fr avec l\'aide de la start up Recast (dont les fondateurs ont terminé 42).</p><p><br></p>\n\n<p>Quelle type d\'opportunité recherches-tu?</p>\n\n','2016-07-20 13:27:49',0,1),(960,933,'Caroline Bercegeay',1173,'Augustin de P',2106,'<p>Bonjour Augustin</p>\n\n<p>Ton profil est&nbsp;&nbsp;intéressant !<br>Je viens de lancer Petitequestion.fr</p>\n\n<p>Quelle type d\'opportunité recherches-tu ?</p>','2016-07-20 13:28:50',0,1),(961,933,'Caroline Bercegeay',1347,'Emmanuel Vilsbol',2280,'<p>Bonjour Emmanuel</p>\n\n<p>Ton&nbsp;profil est très intéressant.<br>Je viens de lancer Petitequestion.fr</p>\n\n<p>Quelle type d\'opportunité recherches-tu ?</p>','2016-07-20 13:29:25',1,1),(962,744,'Thiébaut Kientz',933,'Caroline Bercegeay',1677,'<p>Bonjour Caroline,</p><p>Je cherche soit des projets qui me parlent, que je pourrais rejoindre (plutôt industriels), soit plus simplement des projets qui pourraient avoir besoin de mes conseils de temps en temps.</p><p>Petitequestion.fr est un concept intéressant, en revanche ça ne résonne pas vraiment avec mon univers (pas d\'enfants, toujours à gauche à droite etc...). Et même si on peut vendre des voitures sans avoir le permis, c\'est quand même moins bien. En revanche j\'ai peut-être une amie que ça pourrait intéresser, je lui en parlerais. Tu cherches un partenaire pour prendre quoi en charge ?</p><p><br></p><p>Bonne soirée<br> </p>','2016-07-20 18:25:02',1,1),(963,933,'Caroline Bercegeay',744,'Thiébaut Kientz',1677,'<p>Merci de ta réponse Thiébaut.</p><p>Mon message était un peu direct car j\'étais limitée en mots. Mais ta réponse est super complète.</p><p><br></p><p>Pour répondre à ta question, je&nbsp;recherche un partenaire avec un côté business qui compléterait mon profil commercial et marketing. Ensuite le feeling est un point très important. Que ton amie n\'hésite pas à aller consulter le site petitequestion.fr, la page Facebook. Si elle est intéressée ou juste curieuse, elle peut m\'écrire, cela ne l\'engage en rien. Mon adresse mail : carolinebercegeay@gmail.com</p><p><br></p><p>Bonne continuation dans tes recherches!</p><p>Caroline</p><p><br></p>','2016-07-21 07:45:21',1,1),(964,1,'Quentin Verriere',933,'Caroline Bercegeay',934,'<p>Hello Caroline,</p><p><br></p><p>1- Bouche à oreille, un peu de presse, produit très cool ( :) ) et tout cela devrait pas mal s\'accélérer puisqu\'on démménage à San francisco en Septembre</p><p><br></p><p>2-Cela va être mis en place dans les heures à venir suite à de nombreux retours, &nbsp;on l\'avait mis en place au début et ça a du sauter sans raison&nbsp;</p><p><br></p><p>3-Je note ces petits bugs, on travaille déjà dessus cela devrait être réglé d\'ici la semaine pro, l\'équipe est un peu éparpillé en ce moment ! Par ailleurs ton message tu n\'as pas pu l\'envoyer depuis quel device/navigateur ? Si c\'est mobile ca ne m\'étonne pas.</p>','2016-07-21 23:52:55',1,1),(965,1,'Quentin Verriere',933,'Caroline Bercegeay',934,'<p>Si c\'est sur desktop, en écrivant un nouveau message directement depuis le profil de Kassandre, je vais pouvoir le régler encore plus vite</p>','2016-07-21 23:53:36',1,1),(966,1,'Quentin Verriere',933,'Caroline Bercegeay',934,'<p>Un peu de patience nous ne sommes que 3, mais tout va vite prendre un peu d\'ampleur je l\'espère :)</p>','2016-07-21 23:53:52',1,1),(967,933,'Caroline Bercegeay',1,'Quentin Verriere',934,'<p>Merci de la réponse, bravo pour ce déménagement.</p><p><br></p><p>En fait, j\'ai compris que mes messages partaient si je mettais peu de texte. donc j\'ai été à l\'essentiel :)</p><p><br></p><p>En revanche, je vois que tu m\'as écrit il y a 9 heures et je viens seulement de le voir !? Décalage avec les States ? Les personnes à qui j\'ai écris ne m\'ont pas répondu, est-ce parce qu\'elles ne reçoivent pas de notifications ??</p>','2016-07-22 09:05:52',1,1),(968,933,'Caroline Bercegeay',1,'Quentin Verriere',934,'<p>Enfin dernière question ...&nbsp;:) Je recherche un associé(e) à Paris&nbsp;&nbsp;et si jamais&nbsp;&nbsp;tu entends parler d\'un profil tel que celui - là :&nbsp;(je vais le reposter sur mon profil), je ferais de la méga pub de ton site :)))</p><p><br></p><p>Je recherche un(e) futur(e) associé(e) super motivé(e) pour rejoindre un projet à gros potentiel.<br>Profil recherché: personne avec une logique&nbsp;business pour structurer le projet.</p>\n\n<p>Petite Question est un service de réponses par SMS aux parents par des professionnels de la maternité.<br>Ce service innovant permet de recevoir une réponse claire et anonyme en moins de 24 heures.</p>\n\n<p>Le marché adressé est celui de la maternité avec 800 000 naissances/an en France.&nbsp;<br>Ce service est scalable puisque tous les parents du monde se posent les mêmes questions.&nbsp;</p>\n\n<p>Test très prometteur réalisé en mai 2016<br>Lancement prévu en maternité à l\'automne 2016 avant une diffusion plus large dans un réseau de maternités.</p><p>Intéressé ou juste curieux ? Contactez-moi: carolinebercegeay@gmail.com et discutons-en autour d\'un verre.<br></p>','2016-07-22 09:08:57',1,1),(969,933,'Caroline Bercegeay',52,'Charlotte Hamelin',985,'<p>Bonjour Charlotte,</p><p>Je voulais savoir si tu étais à la recherche d\'opportunités pour rejoindre une start up ?&nbsp;</p><p>Je viens de lancer petitequestion.fr et je recherche un partenaire pour accélérer le service.</p><p>Si tu es intéressée ou juste curieuse, n\'hésite pas à me contacter.</p><p>Bonne journée :)</p>','2016-07-22 09:20:03',0,1),(970,1009,'Benoit Charpentier',933,'Caroline Bercegeay',1942,'<p>Bonjour Caroline.&nbsp;</p><p><br></p><p>Merci pour votre message.</p><p><br></p><p>petitequestion.fr est une initiative&nbsp;très intéressante.&nbsp;</p><p>Pour ma part, je suis à la recherche d\'opportunités sur des projets comportant un fort enjeux tech ou produit.</p><p><br></p><p>Si vous avez besoin d\'aide sur petitequestion (financement, &nbsp;business plan, &nbsp;questions diverses...) dites le moi, je serai très heureux de pouvoir vous aider.</p><p><br></p><p>Bonne journée</p>','2016-07-22 09:52:44',1,1),(971,933,'Caroline Bercegeay',1009,'Benoit Charpentier',1942,'<p>Merci Benoît pour votre réponse et de votre proposition spontanée d\'aide.</p><p><br></p><p>Il se trouve que petitequestion a une forte dimension tech puisqu\'elle fait appel à du machine learning; seule l\'automatisation d\'une partie des réponses peut permettre de diminuer les coûts .&nbsp;Donc je recherche une personne qui a un fort intérêt pour&nbsp;l\'intelligence artificielle. Je suis actuellement en production avec Recast.ai &nbsp;, une start up spécialisée dans la sémantique. Ils viennent de lever 1 million d\'Euro et le type de&nbsp;projet comme le mien les intéresse énormément car pour eux l\'analyse du langage a une belle marge de progression.</p><p><br></p><p>Au plaisir d\'échanger davantage si vous êtes curieux ou intéressé.</p>','2016-07-22 10:02:11',1,1),(972,1,'Quentin Verriere',933,'Caroline Bercegeay',934,'<p>Logique business pour structurer le projet, c\'est à dire, tu peux détailler ? Tu t\'occupes de quoi toi ?</p>','2016-07-22 23:13:34',1,1),(973,1,'Quentin Verriere',933,'Caroline Bercegeay',934,'<p>Je suis en plein là dedans d\'ailleurs, mes deux soeurs viennent d\'accoucher !</p>','2016-07-22 23:14:13',1,1),(974,1,'Quentin Verriere',933,'Caroline Bercegeay',934,'<p>Mais oui dans l\'idée je peux t\'aider ou te faire rencontrer des gens, la \"logique \"business\" de witty, c\'est entre autre moi donc j\'ai une petite idée sur la question, à mon très humble niveau&nbsp;</p>','2016-07-22 23:16:47',1,1),(975,241,'Maximilien Lejeune',754,'Pierre Marteil',995,'<p>salut pierre, comment vas tu ?</p><p>merci de me suivre...</p><p>quel type de projet cherche-tu ?</p><p>a +++</p><p>max</p>','2016-07-27 12:45:13',1,1),(976,754,'Pierre Marteil',241,'Maximilien Lejeune',995,'<p>Salut Maximilien,</p><p><br></p><p>Je ne recherche pas vraiment de projet type. J\'ai envie d\'être impliqué dans un projet innovant et je propose mon aide aux projets comme WIZPAY qui me tapent dans l\'oeil !&nbsp;</p><p>Je fonctionne beaucoup au feeling.</p><p><br></p><p>Comme tu m\'as devancé dans la prise de contact, je me permets de te&nbsp;demander si vous avez besoin de matière grise ou de gens motivés pour votre projet ?</p><p>J\'habite sur Bruxelles, je suis ingénieur en logistique. Je n\'ai pas de compétence pour développer une application smartphone ou une interface web mais je connais les langages.</p><p><br></p><p>J\'ai aussi&nbsp;une idée de projet que je suis en train de mettre sur papier. Mais pour l\'instant je n\'ai pas les compétences requises pour la développer (interface web & smartphone) mais j\'aurai besoin d\'aide si je veux la concrétiser !</p><p><br></p><p>J\'attends ton feedback !</p><p><br></p><p>Bonne journée,</p><p>Pierre</p>','2016-07-27 13:34:01',1,1),(977,270,'Solomiya Zahray',1,'Quentin Verriere',271,'<p>hey, I was trying to send someone a message and it\'s somehow not working = is there some limitation or is it just a bug that needs fixing?:)</p>','2016-07-29 07:18:20',0,1),(978,270,'Solomiya Zahray',1214,'Ludovic de Jouvancourt',1484,'<p>Hi Ludovic</p>','2016-07-29 12:52:48',1,1),(979,270,'Solomiya Zahray',1214,'Ludovic de Jouvancourt',1484,'<p>How are you? I am trying out wittycircle. What about you, how do you like it so far?</p>\n\n<p><b><br>I am looking for Marketing/Sales Partners in UK to work with on finding new partners for our Java Software Development Outsourcing company.</b></p><b>\n\n<p>Would you be interested? If not - perhaps you could point me in the direction of someone who would be?</p>\n\n<p><b><br>Generally - would love to get to know bit more about what you do, what you work on ect. and what you\'re looking to find through this platform</b></p><b>\n\n<p><b><br>Best,</b></p><b>\n\n</b></b></b><p><b><b><b>Solomiya/Mika<br></b></b></b></p>','2016-07-29 12:53:22',1,0),(980,1214,'Ludovic de Jouvancourt',270,'Solomiya Zahray',1484,'<p>Hi Solomiya,</p><p><br></p><p>I\'d be interested to talk more about a possible partnership. Can you share&nbsp;more details ?</p><p><br></p><p>Thanks,</p><p>Ludovic.</p>','2016-07-29 13:15:54',1,1),(981,270,'Solomiya Zahray',1214,'Ludovic de Jouvancourt',1484,'<p>sure, where shall I send those? ) my mail is szahray@romexsoft.com , skype: solomija.zahray drop me a line & let\'s go from there</p>','2016-07-29 14:32:35',1,1),(982,270,'Solomiya Zahray',238,'Guy Armitage',508,'<p>Hi Guy,</p><p>I am trying out the wittycircle. What is it that you\'re working on and looking to find via this platform?</p>','2016-08-01 09:44:13',0,1),(983,270,'Solomiya Zahray',1273,'Remi Thomas',1543,'<p>Hi Remi,</p><p><br></p><p>I am trying out the wittycircle. I am currently looking for a business development partner to work with our software outsourcing company. Since you\'re an experienced developer and have been involved in a couple of companies would this be something you might be willing to consider?&nbsp;</p><p><br></p>','2016-08-01 09:48:32',0,1),(984,1375,'Alain Armand',1,'Quentin Verriere',1376,'<p>Hi Quentin,</p><p><br></p><p>I just moved to Paris with my family. I\'m a junior javascript guy generally interested internet. I\'d love to get involved with wittycircle.com in any capacity at all. Do you have room for another guy?</p>','2016-08-12 09:47:41',1,1),(985,1375,'Alain Armand',1,'Quentin Verriere',1376,'<p>wittycircle.com UX feedback. I did a quick screencast to show you.&nbsp;</p><div class=\"video-container\"><iframe width=\"500\" height=\"281\" src=\"//www.youtube.com/embed/x2Nzy0APeAc\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div>','2016-08-12 10:24:01',1,1),(986,1375,'Alain Armand',7,'Maxence Mson',1382,'<p>wittycircle.com UX feedback. I did a quick screencast to show you.&nbsp;</p><div class=\"video-container\"><iframe width=\"500\" height=\"281\" src=\"//www.youtube.com/embed/x2Nzy0APeAc\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div>','2016-08-12 10:24:49',1,1),(987,1,'Quentin Verriere',1375,'Alain Armand',1376,'<p>Hello Armand, merci pour ton précieux retour.</p>','2016-08-13 23:59:28',1,1),(988,1,'Quentin Verriere',1375,'Alain Armand',1376,'<p>On se charge de régler ces petits bugs avant d\'attaquer la rentrée :) Ils avaient déjà été repérés, et les recherches (qui sont en pur single page) auront très bientôt des url custom pour ne pas avoir à re modifier le filtre à chaque fois. Je suis par contre très étonné du bandeau blanc qui descend, je n\'ai jamais vu ça auparavant, tu peux me donner ta config?</p>','2016-08-14 00:01:10',1,1),(989,1,'Quentin Verriere',1375,'Alain Armand',1376,'<p>Et pour ce qui est de ta proposition, je garde ça en tête, mais malheureusement nous déménageons à San Francisco dans un mois et il n\'y aura plus personne de l\'équipe à Paris. Tu es à l\'aise sur quels frameworks js en front?&nbsp;</p>','2016-08-14 00:02:07',1,1),(990,1375,'Alain Armand',1,'Quentin Verriere',1376,'<p>Le bandeau blanc...i\'m pretty sure its a result of the transitioning in the scroll screen. When the transition begins it seems the background for the&nbsp;div with the search function might be disappearing and showing the white background behind it. You likely saw it because I am on a DSL connection&nbsp;which slows down the loading when too many people are on. I&nbsp;am on a Mac, El Capitain.&nbsp;</p><p><br></p><p>The funny thing is that I came to &nbsp;Paris because it seems easier to meet people in tech than in Florida &nbsp;where I was.<br></p><p><br></p><p>I guess I&nbsp;should say congratulations for getting to the SF. It seems all the good french&nbsp;start-ups are doing that. The funny thing is that I came to &nbsp;Paris because it seems easier to meet people in tech than in Florida &nbsp;where I was. &nbsp;I feel like there is a huge opportunity for French start-ups. Let me tell you why.I have been in tech in the US, Haiti and now I\'m in Paris. Bandwidth is still a luxury in France unlike in the South &nbsp;Korea or Romania. Its The truth is that if we assume that high bandwidth wont be deployed quickly across the rest of the world then companies which have services that are built for accessibility in a French bandwidth&nbsp;environment are a lot closer to being ready to serve the majority of the world. You &nbsp;have the talent and you have the environmental knowledge built in.</p><p><br></p><p>I think i just wrote a blog post....let me go post that.&nbsp;</p>','2016-08-14 10:04:12',1,1),(991,8,'Jay Ho',234,'Maxime Lecourtois',242,'<p>Hello</p><p><br></p>','2016-08-17 14:48:44',0,1),(992,8,'Jay Ho',234,'Maxime Lecourtois',242,'https://trello.com/b/jAqKxtVI/launch-v1-5','2016-08-17 14:53:40',0,1),(993,8,'Jay Ho',234,'Maxime Lecourtois',242,'<p><a href=\"https://trello.com/b/jAqKxtVI/launch-v1-5\">https://trello.com/b/jAqKxtVI/...</a></p>','2016-08-17 14:54:07',0,1),(994,8,'Jay Ho',57,'Minh nhut Nguyen',65,'<p>Je;;</p><p>sdfsf</p>','2016-08-17 15:02:30',0,1);
