20,h_240,c_crop/v1456914617/default_cover/photo-1453272784424-c2eb69c14e2d.jpg',0),(293,'Haroon','Khan',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462734998/gjvdsu9qlkqaxkoth9mv.jpg',NULL,NULL,NULL,0,'',0,'','','',NULL,'2016-05-08 19:03:04','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1456914638/default_cover/photo-1435459025078-9857f8933bc9.jpg',1,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462734998/gjvdsu9qlkqaxkoth9mv.jpg','Terence.Jumilus','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_320,h_240,c_crop/v1456914638/default_cover/photo-1435459025078-9857f8933bc9.jpg',0),(294,'Alexia','Chuzeville',NULL,'I have been studying for three years a management and accounting diploma (DCG) before integrating Audencia Business School in France. I am currently studying a Master 2 in Corporate Finance at Audencia and I do an internship in Financial Management Consulting for 6 months from January 2016 in KPMG. \n\nThe last three internships I did in France and abroad revealed my particular interest in Finance. I had two experiences in cost controlling (in the French Bank BNP-Paribas in London and in a subsidiary of Yves Rocher Group in Paris) and I worked as a junior auditor in KPMG France. I had the opportunity to work in different areas like Insurance and Industry.\nThanks to these internships, I improved my technical skills in accounting, cost-controlling, financial analysis and in project management. \n\nMoreover, I appreciated working for both start-ups and multinational companies that gave me the opportunity to evoluate in dynamic, thrilling and international environments. \n\nBallet is my hobby: I have practicing this sport for 17 years both in Conservatories and in Private Schools. I participated in many events (musicals, dancing ballets, movies), and sometimes with dancers of The Opera of Paris. I still live this passion through my School of Management.\nThen, I commited myself as a volunteer