IE0HC_GVM/photo.jpgsz=200','join projects','Male','1994-01-07T18:30:00.000Z',0,'',0,'','113269431031381410916','ya29.CjHjAnTB95LJ0eaj1MUWNi5y2LVh96vSeTsyWn1db0gKleO4AMfuo7VUpEzqsJGRE9W0','Maharashtra','2016-05-15 08:36:50','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1456914635/default_cover/photo-1428976365951-b70e0fa5c551.jpg',0,'https://lh5.googleusercontent.com/-m42In7HQ8pU/AAAAAAAAAAI/AAAAAAAAATU/XGIE0HC_GVM/photo.jpgsz=200','Rahul.Jain','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_320,h_240,c_crop/v1456914635/default_cover/photo-1428976365951-b70e0fa5c551.jpg',0),(463,'Sankalp','Dhavale',NULL,'<p>I grew up in Dubai during the late 70\'s and Kuwait during the mid 80\'s till the late 90\'s. I have lived in Cyprus and the UK during my bachelor and master degree level education. In hindsight, both those degrees were a superb waste of time and money. Why? I still haven\'t managed to earn back what I had to pay for them! But, I got to live and work in exciting countries like the UK, UAE, Kuwait, India, Thailand and more recently in Slovenia.</p><p><br></p>\n\n<p>I would like to think that I am a senior sales, marketing and operations professional, but that\'s just jargon. Instead, I will go with this, I have a good 13 years of varied work experience across geographies (jargon!) like the UAE, Thailand, Europe, the UK and India. I currently live and have been for some time now, in the EU, in Slovenia, its very nice here and its a fantastic place to raise a family. </p>\n\n\n\n<p><br> </p><p>Now, this is some of the professional stuff I did in the past, I have held sales and operations positions in the IT & Telecom (Carrier and Enterprise grade, Tier 1 channel sales), FMCG (food, beverage and liquor) and Food Service (I created and ran my own restaurant). If anyone is reading this, reach out to me and let me know, is this the kind of stuff that recruiters and employers really want to hear and enjoy?</p>\n\n\n\n<p><br> </p><p>So, while every job applicati