 meet nice people!\n\nSince the concept is a success and there are so many development I would like to start, I will be looking for competent people here in Germany!\n\nSo...\"Beuvez toujours! Ne meurrez jamais\" as Rabelais used to say!\nLoic Carlier','Frankfurt','Germany',NULL,NULL,NULL,NULL,NULL,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464858891/dkytdvw2jymxulywxt33.jpg','find teammates','Male','1979-03-17T12:00:00.000Z',10157142251650128,'EAAG7LqtfGXYBAFhTcetgXEzXhr7GEuoVrW7lkiVcMMOOwqZBfpzXiodW30v97k67StufF9ZA1m6J4TCPhGWmGZAPsWR4GVXmymCydaZA6bS1FaKSldOlbqumFtXNZCJq2bTq333SlyukqISZBcgZA5rZBFeUV5HZCFMkZD',0,'','','','','2016-06-02 09:14:31','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1456914643/default_cover/photo-1415889455891-23bbf19ee5c7.jpg',41,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464858891/dkytdvw2jymxulywxt33.jpg','Loic.CARLIER','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_320,h_240,c_crop/v1456914643/default_cover/photo-1415889455891-23bbf19ee5c7.jpg',0),(810,'Bruno','Correia',NULL,NULL,'Paris','France',NULL,NULL,NULL,NULL,NULL,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464858999/arrklqvcergbtmemgsbt.jpg','discover new things','Male','1990-07-25T22:00:00.000Z',10154209047917603,'EAAG7LqtfGXYBAK2zytQkCMFsotvMsrSPShbZBJCLtB5uWV2yCHzoZAUJLhT8T7zyPRHU4p2XsoUUDyZC2qZCtOHFhgZBnLugtsDVQrLn5rZCdXGJLvFO1DlyF3mBbVewddJNrxNAKa0E2KTzM3ed5dA0c3J1GiTNAZD',0,'','','','','2016-06-02 09:16:43','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1456914608/default_cover/6108b580.jpg',6,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464858999/arrklqvcergbtmemgsbt.jpg','Maxime.Schmitt','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_320,h_240,c_crop/v1456914608/default_cover/6108b580.jpg',0),(811,'Sina','Movaghar',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464859507/lhdols7smh3hptekvvna.jpg',NULL,NULL,NULL,0,'',0,'','111808666704215150475','ya29.Ci_1AhbucPy_