ills.\n- Proven experience leading the design and implementation of UX/UI for consumer and enterprise    applications across a variety of platforms.\n- Understanding usability patterns, guidelines, use cases etc.','Saint petersburg','Russia',NULL,NULL,NULL,NULL,NULL,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465936711/ma0kgucvfduwb0u6wegt.jpg','join projects','Male','1989-03-04T21:00:00.000Z',10208970347843366,'EAAG7LqtfGXYBAACVORh2gfGpJR3b39ZBfCmKQtP1aamZCEZA0gxRCTnvmUj7eMnnCZBTRsAx7ZChrgEur1aLUe1QbVpY0EsktnSYVqGUMHsUUgae75DhPQw039ZBtzk5vJEiIPeRDYZCRaohrvuCBAsEUdY5ZAHaLKYZD',0,'','','','','2016-06-14 20:38:46','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465937788/klsykgc8ndfykavvdqge.jpg',48,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465936711/ma0kgucvfduwb0u6wegt.jpg','Nick.Snopov','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465937788/mzodjjsfdrg43kaxmmab.jpg',0),(951,'Caco','Portela',NULL,'I make design for User Interfaces and User Experiences (UI & UX) for mobile, apps, software and websites and that I can offer for your startup, product or business.I believe in excellent user experiences, beautiful interfaces and project management with a dash of personality. \n\nThese days I focus on my UI and UX design work, creating beautiful looking visuals for all types of interactive products, ranging from games to apps, websites to software.I work with US and International clients, ranging from large established businesses to hot new start-ups, so if you like what you see then I’m happy to discuss your project with you.','São paulo - state of são paulo','Brazil',NULL,NULL,NULL,NULL,NULL,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465962188/ppapr0pdnh9napzxc4ce.jpg','discover new things','Male','1973-10-30T03:00:00.000Z',0,'',0,'','108102071414014973351','ya29.Ci8CAxNKMmYRp85vrlKyUrqTHErv_RiqsVHkujCCfWnvME1VsrVIrobAr1OqyDdfCw','','2016-06-15 03:28:51','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465962224/x5r2p8e9vzcq