645841/default_profile/shutterstock_162773993_zbj4my.jpg','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_320,h_240,c_crop/v1456914600/default_cover/2015-12-29-Roman-Drits-001.jpg',0),(965,'Roman','Latkovic',NULL,'What does digging through Wikipedia logs reveal about Roman?\n\nIt reveals Lorenzo Bladuzzi, a writer from Palermo (Sicily), to be the author of Roman’s Wiki page. Delve into Lorenzo’s IP address (recorded as he was writing) and you’ll find out that Lorenzo penned his entries mostly in June of 2009, from Heroica Ciudad de Tlaxiaco, a quaint little city in the state of Oaxaca in México. We know Lila Downs is Tlaxiaqueña, but a more peculiar fact is that the city of Tlaxiaco lies at latitude 17° North, which stretches parallel all the way east to the municipality of Santa Lucia in the province of Ilocos Sur, Philippines.\n\nNow here is where it gets really interesting. Lorenzo Bladuzzi is not a real person, but rather an avatar of a mysterious Mexican-American hacker named León Eugene del Norte. While he was developing a Python wrapper around the Twitter API, del Norte lived in both Tlaxiaco and in Santa Lucia during 2009.\n\nMore @ http://displaced.me/home/roman-latkovic/','Santa monica','United States',NULL,NULL,NULL,NULL,NULL,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466095198/ypyos5s49rny4hwikx9z.jpg','find teammates','Male','1960-04-09T22:00:00.000Z',1749680548633782,'EAAG7LqtfGXYBAOYjHOtaiUCfdjkJbrhBwWmpKR1p3Gi9dG5cZBnAADYECiEIZBZAETzStRriHn0NZCYxNPJfe4xhiiECD8dYS89uqi4AA0e22hDEiZAHDNMzqOi58pKhvdkVdCERrKvUjQDqpWAfQQf1MAp8Y8iXM7nASYS7cfAZDZD',0,'','','','CA','2016-06-16 16:40:14','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1456914625/default_cover/photo-1421940975339-33bdde74a873.jpg',0,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466095198/ypyos5s49rny4hwikx9z.jpg','Roman.Latkovic','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_320,h_240,c_crop/v1456914625/default_cover/photo-1421940975339-33bdde74a873.jpg',0),(