 & groupe Reflect Web Agency (1996 now Emakina).</p><p><br></p>\n\n<p>As a entrepreneur with over 19 years of experience in strategic management, Carlos has amassed a successful track record of innovative startup growth. At 23, Carlos co-founded Reflect Digital Agency in Paris. After Reflect was acquired by the Emakina group, he went on to form blueKiwi, which became a European leader in Social Enterprise Software and has been sold to ATOS in 2012. From 2011 to December 2015, Carlos focused on building Kwarter, a San Francisco based company determined to revolutionize how people interact with Live TV programs.&nbsp;</p>\n\n<p><br></p><p>After many years spent in Silicon Valley, Carlos decided to help foreign founders succeed here because he strongly believes they can see things from a different perspective and create amazing global startups no matter where they come from. Carlos is now managing The Refiners, a Cross Border accelerator that helps foreign startups thrive in Silicon Valley.</p><p><br></p>\n\n<p>In September 2012, Carlos founded a group calling themselves “Les Pigeons” who quickly shot to 75,000 members, set up as a protest against Hollande’s planned doubling of capital gains tax to 60 percent.&nbsp;</p>\n\n<p>Born in 1973, the guitar player and rock’n roll lives now in San Francisco since 2010.</p>','San francisco','United States',NULL,NULL,NULL,NULL,NULL,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467332341/e5ekkscrnt3xteigdp1w.jpg','discover new things','Male','1973-05-21T07:00:00.000Z',10153909515456339,'EAAG7LqtfGXYBAExiTMOWFgKLT3clhZBvhqF4t9NOEu7oeTZB59Y0HZBWPlnsvbCwvNEQlL5Cm905qfb8B2g0Dy9p4QukcWUuXVHGxaZCUZAbVsgjwLZAgoF6t0336gN08lgAeC3zJ4VGJ7Uo1IgxfP6yr3MAny6jKKNpV0zSNHtAZDZD',0,'','','','CA','2016-07-01 00:19:31','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1456914638/default_cover/photo-1435459025078-9857f8933bc9.jpg',24,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467332341/e5ekkscrnt3xteigdp1w.jpg','Carlos.Diaz','https