ickly to new environments and being independent in resolution.</p>','Paris','France',NULL,NULL,NULL,NULL,NULL,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467574968/wkjcaoop0or3uushywdr.jpg','join projects','Female','1976-03-21T23:00:00.000Z',0,'',0,'','112384799080871879175','ya29.Ci8UAzPrmT6rWMrEwGUSvtf9gTS6wNAA4xhLl1_eI0Hq7dJhrZgOGcrv7DJjHi34eQ','','2016-07-03 19:41:51','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467577159/fj293qziv1kklvbic3u4.jpg',11,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467574968/wkjcaoop0or3uushywdr.jpg','Jacques.Rimey-maurivard','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467577159/hwkpapmmrn0sq2t4qisr.jpg',0),(1292,'Pashu','Christensen',NULL,'<p>TEST</p>','Oakland','United States',NULL,NULL,NULL,NULL,NULL,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467610079/d355ol1gdznz9lrxijpe.jpg','find teammates','Female','1981-09-23T12:00:00.000Z',0,'',0,'','','','CA','2016-07-04 05:27:53','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1456914638/default_cover/photo-1435459025078-9857f8933bc9.jpg',0,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467610079/d355ol1gdznz9lrxijpe.jpg','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_320,h_240,c_crop/v1456914638/default_cover/photo-1435459025078-9857f8933bc9.jpg',0),(1293,'Remi','Thomas',NULL,'<p>Serial entrepreneur I was involve in 3 company.</p><p>Developer since I\'m ten I like technological challenges.</p><p>1 hour of technological watch every day.</p>','Villeneuve-d\'ascq','France',NULL,NULL,NULL,NULL,NULL,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467614092/czuzjqu9wml3rbnmkedh.jpg','find teammates','Male','1969-01-03T23:00:00.000Z',0,'',0,'','','','','2016-07-04 06:34:36','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1456914588/default_cover/photo-1452596954042-4ccc4dfa672c.jpg',30,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467614092/czuzjqu9wml3rbnmkedh.jpg','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_320,h_240,c_crop/v1456914588/default_cover/photo-1452596954042-4ccc4dfa672c.jpg',0),(1294,'Jacques','Teyssier',NULL,'<p>Jacques E A TEYSSIER is Director /Associate at TEYSSIER Industries Pte Ltd based in Singapore. He has 20 years of extensive managerial experience in the heavy equipment ,truck industry&nbsp; and composites engineering ,in Asia Pacific, Maghreb and Europe. As a strategy consultant Jacques has assisted International, Regional and Local companies with advise, focusing in particular on growth strategy, market entry, industrial settlement, and licensing/M&A assignments in emerging markets.</p>\n\n\n\n<p>Prior to incorporating TEYSSIER Industries , Jacques has been Managing Director and co- founder with the CTVDOLL Group public company of CTV THERMOTECH Thailand Ltd, Jacques worked also as General Manager at LAMBERET VIETNAM, overseeing the Financial,industrial and commercial development of the Asian branch&nbsp; within a Worldwide refer-truck manufacturing group . He has extensive launch management experience and has been instrumental in the launch of several industrial projects in Asia </p>\n\n\n\n\n\n<p>&nbsp;As Chief Representative in Vietnam, in the late 90’s, he was responsible for the corporate&nbsp; and strategic development of the LAMBERET Group in&nbsp; Asia.&nbsp;</p>\n\n<p>Earlier in his career Jacques was General/Country Manager for SIDEXO in Vietnam/Indochina, leading the organizations in a high growth emerging market environment. </p>\n\n\n\n\n\n<p>During his career Jacques engaged in multiple extracurricular activities and was among others Member of the Board of Governors at the Eurpean Chamber of Commerce In Vietnam,and President of the Vietnam Cold Chain Goup. Throughout his career in Europe, Asia and Mediteranean surroundings, he has gained significant expertise in emerging industrial market dynamics.</p>\n\n\n\n<p>Jacques holds a Master of Business & Administration from Chambery Business School , France, and is Bachelor of&nbsp;