INSERT INTO `project_asks` VALUES (2,1,'What type of brands will you guys feature ?','Will we find mainstream brands (ie: Nike, Adidas, NB etc) or are you more into word to mouth designers?',1,'https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAI29AtFkf4G8wu2iO5fe9OzF5vI5hyeeCe6VZAxHJIedInKBlzR06uDBKI7aocWsDZCMmPZCRc5QqgHgyyPoQ4LvQuE3LrwbpZBpUxDe8ZBny86mVrzLA5SROIBvmpwFOaEIbFS6Hi0bAusZAEfHEDoieoq2Yb1emovvHsUZAgbLnQc9eXebUAZD','Quentin','Verriere','2016-04-28 13:29:50',34474),(3,4,'Does it take the form of a mobile app?','',56,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649179/tp4f4nre7dci6xlsvz2l.jpg','Jeanne','Coleman','2016-04-28 13:49:13',59887),(4,14,'Any more pictures you can share ? :)','',125,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','Max','Tolkin','2016-04-28 17:16:39',25450),(5,5,'Can you please add some pictures and / or a video showing the bike details ?','',55,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649484/hlr71vj7alebi8xgrnso.jpg','Igor','Gourevitch','2016-04-29 09:59:37',54246),(6,14,'Do you plan to develop other type of bikes / frames ?','I would LOVE a race bike or a commuter bike like the WoodRover',55,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','Max','Tolkin','2016-04-29 10:01:57',54246),(7,264,'Where do i can buy one ?','I really like your product and i wanted to know where i can buy your glasses.',59,'https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAAgGDSbux9EtB1aEZCCX0DyiVaaH2xu8dcdgZCbKLy35HpSFVQbSmnA1FkTiouQC2EuQvTY7BC4PPUnrJj8sHFJF6v6kMwGLeRhO5j1zs3vShNY0ZChtVqzZANH7uFrgP3xNy8jT7rFkxZCV7YOEZD','Cédrick','Le Guen','2016-05-04 21:12:57',61750),(8,1,'LOVE it !','',136,'https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAI29AtFkf4G8wu2iO5fe9OzF5vI5hyeeCe6VZAxHJIedInKBlzR06uDBKI7aocWsDZCMmPZCRc5QqgHgyyPoQ4LvQuE3LrwbpZBpUxDe8ZBny86mVrzLA5SROIBvmpwFOaEIbFS6Hi0bAusZAEfHEDoieoq2Yb1emovvHsUZAgbLnQc9eXebUAZD','Quentin','Verriere','2016-05-05 09:46:13',95002),(9,432,'I can help you','I\'m a VFX artist, maybe I can help you with some visual ir graphic stuff. Facebook.com/postproducciondurodepixelar',4,'https://lh6.googleusercontent.com/--CzrjPxtLwA/AAAAAAAAAAI/AAAAAAAAECQ/rCizjzkEICM/photo.jpgsz=200','Sebastian A.','Nolte','2016-05-15 04:58:18',46397),(10,489,'Cool idea!','I\'m really a procrastinator and get distracted often as I\'m surfing on this website ;)\nRemembers me of the app which builds a forest if you leave your phone, but think can be cool if you can choose different apps which are allowed or websites if you start with a chrome extension.\nWill be hard to track which app a person is using on his phone right ?',56,'https://lh3.googleusercontent.com/-3O-O7lF3olI/AAAAAAAAAAI/AAAAAAAAABA/De3yQQcFrDo/photo.jpgsz=200','Kai','Schmid','2016-05-15 19:39:10',59887),(11,46,'Are you considering launching the product in a short-to-mid term horizon?','Do you already have like a real prototype  and potential manufacturer? Or is it more like an idea for the moment?\n\nAnyway very good project! As a music lover, I would really like to get such a sound system.\n\nG',13,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1454443056/2-abstract-retro-geometric-pattern-atthamee-ni_msjoab.jpg','Guillaume','Sarrazin','2016-05-17 12:15:15',84083),(17,636,'Hi, could you please detail you project here?','I saw your pitch deck on google drive, maybe it would be easier to post infos here? What programming language are you using?',208,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464187222/skryyg0spfflxmuxthqm.jpg','Sam','Linston','2016-05-26 13:04:47',62015),(18,636,'Any more infos you can share?','',132,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464187222/skryyg0spfflxmuxthqm.jpg','Sam','Linston','2016-05-26 18:44:42',38714),(19,14,'Same question here.','What platforms do you build your bots for?',132,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','Max','Tolkin','2016-05-30 21:56:15',38714),(20,569,'What is the range of jobs you intend to \"offer/host\" on the site?','We talking strictly design and programming or some nitty gritty stuff like EA\'s and god I don\'t know, paralegals? (Just heard they have it rought)',184,'https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAAmnbZBTw9qd33yscylur2rYVKj5skp5Huj9MjwJnnc1f1UiUpGTHYMCBx3uZA44BD9d27qVBAIDt5t5mEuKKdGHgFjcSteWnZBfF3Q7jO7Kkx00NZBUysAQpX2G9BOlFZBVeGuQh0AGc9jgbPJA4Wrbn7sqFxwZDZD','Harry','Kaczka','2016-06-17 13:35:24',78445),(21,22,'Brexit','If the yes wins tomorrow, do you think there will be consequences in the other countries of the EU. Will english still be the \'official langage\' ?',258,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457696920/bqmrx96mrlddmgy79svo.jpg','Florent','Gautin','2016-06-21 10:12:22',66908),(22,11,'How is going the launch of the first version ?','',242,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461590386/q9xcss02hletnvimewta.jpg','Serge','Didenko','2016-06-24 07:48:02',73650),(23,22,'I\'m not in LA so I won\'t be able to help you but could you tell me a bit more about the project ? (i love the idea)','',205,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457696920/bqmrx96mrlddmgy79svo.jpg','Florent','Gautin','2016-06-24 07:50:55',45713),(24,22,'Quel genre d\'innovation ?','',249,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457696920/bqmrx96mrlddmgy79svo.jpg','Florent','Gautin','2016-06-24 07:53:34',65269),(25,22,'T\'as un peu plus d\'infos a donner ?','Quel genre de réseau ? Quel profil de dev recherches tu ?',137,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457696920/bqmrx96mrlddmgy79svo.jpg','Florent','Gautin','2016-06-24 09:59:35',48587),(26,1257,'Is there a social network component in your project?','So I can follow individual scientists and connect with them?',266,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467332341/e5ekkscrnt3xteigdp1w.jpg','Carlos','Diaz','2016-07-01 00:30:10',18622),(27,1088,'Simply awesome.','Any more visuals you can share?',238,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466548349/oe8fwdyrvi6yvzgdwfoe.jpg','Abigail','Preston','2016-07-05 23:02:48',49996);
