INSERT INTO `project_feedbacks` VALUES (1,3,4,NULL,'Anyone with contact in Shenzen, China ?','',40502,'2016-03-10 22:32:36','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649179/tp4f4nre7dci6xlsvz2l.jpg','creator','Jeanne','Coleman'),(2,9,14,NULL,'Is there anyone willing to join the team as product manager?','PM me for more details.',11285,'2016-03-11 10:50:12','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','creator','Max','Tolkin'),(15,57,133,NULL,'Bringing a small tech-toy to mass market?','Does anyone have experience with bringing a small tech gadget to large retailers? I\'ve brought two projects to niche markets, and I would love to discuss bringing a design to a general audience.',69437,'2016-03-23 04:40:09','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458705999/t75lmmi4lg40xsclhnrd.jpg','creator','Jarek','Lupinski'),(27,128,186,NULL,'Which state in the US has the most progressist politicians willing to invest in participatory democracy?','Which state in the US has the most progressist politicians willing to invest in participatory democracy?',95540,'2016-04-29 08:24:06','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461917477/zchgzb7k9pc0ctvyyq8r.jpg','creator','Manu','Musa'),(29,133,241,NULL,'How can i find an associate in programming on witty circle.com ?','Any help please. Thanks',90010,'2016-05-03 11:25:21','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBABFZAYOiScZAX62SCTZABKNzT2bDrr5XXNusZCc1aiZBra9RZADTocgpVZCTFLR6LnRUu8zXX6p6ZCnlHHZAzx3FZBovw8P90NtC5OUNtGuEIjZCn2jKZC0YbCUbx28ZASRmJOqIzJaXTOZBe2ZBgwPiCpfBFQZD','creator','Maximilien','Lejeune'),(32,138,258,NULL,'Feedback on language learning stories','Hi guys, we\'d love it if you could give any feedback (ideally from children) for our stories that start in English and end in a different language - http://onethirdstories.com/audiobooks/',31647,'2016-05-04 21:50:36','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAJoaormGWRZCm3h1Djvl7ZAhxe14fQHqHVONuwZAwf0rEZBEq6UZBkZANZAZCAvg2W6Tha54XZAywGbDSlsp2QTbZC5bZCBppgZBpNCJqZBopkZCQe00slPKZBwZAZCJZCsYZALKUZC8XixBKej70dZCfU9RtXqUYBGsZD','creator','Alex','Somervell'),(33,138,258,NULL,'Does anyone know any parent bloggers?','Hey! We\'re mainly looking to reach our audience through blogger outreach so we\'re looking to get some reviews of our stories from bloggers. Do you know any who might be interested? Gracias! Alex',31647,'2016-05-04 21:51:32','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAJoaormGWRZCm3h1Djvl7ZAhxe14fQHqHVONuwZAwf0rEZBEq6UZBkZANZAZCAvg2W6Tha54XZAywGbDSlsp2QTbZC5bZCBppgZBpNCJqZBopkZCQe00slPKZBwZAZCJZCsYZALKUZC8XixBKej70dZCfU9RtXqUYBGsZD','creator','Alex','Somervell'),(34,163,358,NULL,'What\'s the best way to build and run a community?',NULL,74752,'2016-05-14 14:38:46','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463235243/gxww0rtohj2jhnez70zg.jpg','creator','Amrith','Shanbhag'),(35,163,358,NULL,'How can a social venture sustain itself efficiently?',NULL,74752,'2016-05-14 14:39:06','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463235243/gxww0rtohj2jhnez70zg.jpg','creator','Amrith','Shanbhag'),(36,167,391,NULL,'What are your thoughts, concerns about Loombrand?',NULL,71119,'2016-05-14 23:12:01','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAAB2Pl0kLDhJt3sDGlSYO2Mh396Jxm0FfwkCM8gsLlcdL8NIGutu2NirQKLinsUKDxO5foxHtn1t9LVcm9u2VVEBobUk4Stu9FV1mqfMZCvbPRSIZCaalHuIjycgfkZC8j7X8bMYWROltFvJ1sZD','creator','Dimitry','Apollonsky'),(38,168,417,NULL,'Thoughts? Suggestions? Questions? Comments?','We love and appreciate feedback that helps us better our product and ourselves. Our feelings will not be hurt. :P',48644,'2016-05-15 03:07:57','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463277114/ytoo2hywnez1wi8ls3hq.jpg','creator','Matthew','Martindale'),(39,179,501,NULL,'How to get training data on dishes and ingredients?',NULL,11471,'2016-05-16 03:34:51','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463365579/xv9oeix4hcgyzjfcrqbr.jpg','creator','Sunny','Patneedi'),(40,177,489,NULL,'Open to any feedback, thoughts improvements ?',NULL,66887,'2016-05-16 10:44:06','https://lh3.googleusercontent.com/-3O-O7lF3olI/AAAAAAAAAAI/AAAAAAAAABA/De3yQQcFrDo/photo.jpgsz=200','creator','Kai','Schmid'),(41,184,539,NULL,'UI/UX Feedback','If you had to change something on the website, regarding the UI/UX, what would it be?',78445,'2016-05-16 16:48:06','https://lh4.googleusercontent.com/-QbTQcj4Nc_w/AAAAAAAAAAI/AAAAAAAAHTc/QdqZfSVIZDM/photo.jpgsz=200','creator','Kevin','Bosc'),(44,159,343,NULL,'Would you accept to pay a small commission when you set up rides with your friends?','This commission is to pay servers, external APIs and integrated payment feature.',26111,'2016-05-17 13:30:13','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463152167/gycyzu9rfjlltrd3lp1j.jpg','creator','Alexandre','Hanot'),(45,202,628,NULL,'YouShould need feedback :)','We have launched YouShould in London one month ago.\nWe now need our first feedback to know what to improve, delete or add !\n\nHttp://www.youshould.co.uk',59167,'2016-05-23 10:55:10','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464000280/ohpdymtnmdf04k8fsxzo.jpg','creator','Paul','Sunspikies'),(46,218,752,NULL,'A good idea for a marketplace','Hi there, \n\nI\'m gathering some infos about marketplaces for B2B.  Would you like to help a little bit ?',82194,'2016-06-02 07:19:02','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464849471/nc3zg9qhbg19ivksxgle.jpg','creator','Jeremie','Ensino'),(47,230,1,NULL,'Test question','Allo',50295,'2016-06-02 19:24:51','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAI29AtFkf4G8wu2iO5fe9OzF5vI5hyeeCe6VZAxHJIedInKBlzR06uDBKI7aocWsDZCMmPZCRc5QqgHgyyPoQ4LvQuE3LrwbpZBpUxDe8ZBny86mVrzLA5SROIBvmpwFOaEIbFS6Hi0bAusZAEfHEDoieoq2Yb1emovvHsUZAgbLnQc9eXebUAZD','creator','Quentin','Verriere'),(48,242,915,NULL,'What do you think of our app?','The app is available on iPhone and Android, it\'s our first version ;)\niPhone: https://itunes.apple.com/us/app/soundgrabber-music-is-everywhere/id1036171282?l=fr&ls=1&mt=8\nAndroid: https://play.google.com/store/apps/details?id=fr.soundgrabber\n\nFeedbacks help to improve!',73650,'2016-06-13 14:21:24','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465826848/y3dzxxu8abjpqslrebhz.jpg','creator','Kim','Giaoui'),(49,248,933,NULL,'I want to challenge my business with other people','If you are passionate with Artificial Intelligence and Machine Learning, i would love to discuss on the topic.\nSee more : petitequestion.fr',55855,'2016-06-15 09:09:20','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465979936/vqjmyhhd4qcdrq5lx7jv.jpg','creator','Caroline','Bercegeay'),(50,258,1062,NULL,'CTO Co-founder','Seeking an exceptional full stack Software Engineer with 3+ years experience and a demonstrable history of building successful, scalable web platforms. JavaScript & API integrations exp preferred',66908,'2016-06-20 19:13:02','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466447758/sqz1esjzlnls4pqxnmvg.jpg','creator','Chris','Aram'),(51,261,241,NULL,'Looking for Associates/Business Partners : CTO & CMO','Looking for a Chief Technical Officer, specialized into web and mobile dev\n\nLooking for a Chief Marketing Officer, specialized in digital online marketing.',23075,'2016-06-21 12:41:05','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBABFZAYOiScZAX62SCTZABKNzT2bDrr5XXNusZCc1aiZBra9RZADTocgpVZCTFLR6LnRUu8zXX6p6ZCnlHHZAzx3FZBovw8P90NtC5OUNtGuEIjZCn2jKZC0YbCUbx28ZASRmJOqIzJaXTOZBe2ZBgwPiCpfBFQZD','creator','Maximilien','Lejeune'),(52,255,977,NULL,'When would you use a left-luggage service, for how long?',NULL,93330,'2016-06-21 20:33:53','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466273281/gwrkrzu4zn3xtvmwnado.jpg','creator','Anthony','Collias'),(53,255,977,NULL,'Would you pay for a service which transported stored bags to another location (home or another stashpoint)?',NULL,93330,'2016-06-21 20:34:13','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466273281/gwrkrzu4zn3xtvmwnado.jpg','creator','Anthony','Collias'),(54,266,567,NULL,'What scientific topics would you like to follow? (Completely free service)',NULL,18622,'2016-06-24 16:09:30','https://lh4.googleusercontent.com/-2b8l8dBGgWg/AAAAAAAAAAI/AAAAAAAAGGM/I9wxXC2eLQU/photo.jpgsz=200','creator','Sybil','Wong'),(55,266,567,NULL,'Which scientific experts specifically would you like to follow? (Completely free service)','Let us know their full name and affiliation',18622,'2016-06-24 16:10:17','https://lh4.googleusercontent.com/-2b8l8dBGgWg/AAAAAAAAAAI/AAAAAAAAGGM/I9wxXC2eLQU/photo.jpgsz=200','creator','Sybil','Wong'),(56,278,1266,NULL,'Buzz for Skewee','Any tip or advice is welcome (how to get buzz with facebook, linkedin, witty...?).',40744,'2016-07-02 22:57:15','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467481988/am41ox2qg2kwobwcab65.jpg','creator','Aziz','Khlat'),(57,300,1268,NULL,'Which startup would you like to clone?','Since we learn to code by cloning real-life startup, our students may choose which startup they want to clone in the next course.',92892,'2016-07-03 15:19:06','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458645841/default_profile/shutterstock_226003381_yi1zkm.jpg','creator','Lucas','Willemot'),(58,305,1292,NULL,'Would you like to join our movement? Do you want to help define the image of Indian\'s in the mainstream media? We would love to hear from you.',NULL,90302,'2016-07-05 18:44:12','https://lh6.googleusercontent.com/-SEqhQDYDNaI/AAAAAAAAAAI/AAAAAAAAAPM/jgcWdXZUtCI/photo.jpgsz=200','creator','3 Curious','Monkeys'),(59,309,966,NULL,'Would a video be helpful?',NULL,17719,'2016-07-11 17:41:27','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466175176/eni5xnmbx7e0pmkstpkn.jpg','creator','John','Elliott'),(60,309,966,NULL,'Have you tried something like this before?',NULL,17719,'2016-07-11 17:41:43','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466175176/eni5xnmbx7e0pmkstpkn.jpg','creator','John','Elliott'),(61,309,966,NULL,'Does HTTPS work for you? On your phone?','Do you see the green lock at https://waybot.primitivemachine.com/ ? Trying to test on more devices than I own.',17719,'2016-07-11 17:42:51','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466175176/eni5xnmbx7e0pmkstpkn.jpg','creator','John','Elliott'),(62,319,1364,NULL,'Who has tried to commission artwork online from instagram or etsy?','Have you ever tried to commission work from people from the internet? If so, what was your experience?',48124,'2016-07-30 03:30:24','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458645840/default_profile/shutterstock_136128440_wwycb2.jpg','creator','Nika','Koda'),(63,321,1384,NULL,'How would you make the website more user-friendly?',NULL,32716,'2016-08-19 14:35:40','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1471616796/vdnrrqjbpapboadkc6qn.jpg','creator','raphael','toper');
