,(141,313,'Mentor','Product Design','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1456744591/no-bg_k0b9ob.jpg','2016-07-12 23:34:19','0'),(142,313,'Mentor','Graphic Design','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1456744591/no-bg_k0b9ob.jpg','2016-07-12 23:34:31','0'),(143,313,'Teammate','Product Design','','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1456744591/no-bg_k0b9ob.jpg','2016-07-12 23:34:40','0'),(146,319,'Any help','Advertising','We are looking into marketing help. Even though we are a early stage we would love advise and help from anyone!','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1456744591/no-bg_k0b9ob.jpg','2016-07-30 03:29:05','0'),(147,321,'Tips','Product Design','Any ideas for UI/UX or additional features would be welcome :)','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1471617070/edumebz6t7ewsaakcpar.jpg','2016-08-19 14:34:27','0'),(148,321,'Teammate','English','Anyone who wants to collaborate to the maps and safety texts','https://res.cloudinary.com/dqpkpmrgk/image/upload/w_200,h_200,c_fill/v1471617070/edumebz6t7ewsaakcpar.jpg','2016-08-19 14:34:59','0');
