INSERT INTO `projects` VALUES (1,2,16,'Sneakerdot','Shop and collect sneakers from a number of stores','New York','','NY','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457647970/khzrojhuriq03qe71tk3.jpg','<h1></h1>\n\n<h1>Coming Spring 2016</h1>\n\n\n\n<hr>\n\n\n\n<p><strong>Sneakerdot</strong> is a marketplace where users can shop and collect sneakers from numerous stores including Mr Porter, Matchesfashion and End Clothing, while also having the latest news and sneaker release dates.</p>\n\n<hr>\n\n<p><br></p>\n\n<p><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457648173/rq4wh8evex5ijdfkkwsj.jpg\" data-image=\"\" style=\"text-align: center; font-family: Arial, \'Helvetica Neue\', Helvetica, Tahoma, sans-serif; font-size: 15px; line-height: 24px;\"></p>','Beta project',NULL,191,34474,'Sara Peterson','','Technology','0px -302px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457647970/ke4znwli5yz2gz5v721p.jpg',1,NULL,'2016-05-24 16:56:40',11,0),(3,4,4,'Delepaule Bags','Delepaule is the urban bag which allow you to not choose.','Berlin','','Germany','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649267/zb6t1hh9thpkphslp8xi.jpg','<p><u><strong>DELEPAULE</strong></u><br>&nbsp;<br><strong>Delepaule</strong>&nbsp;is a whole range summed up in a single product! Get it and choose later how you are gonna use it, according to your mood, your schedule, your lifestyle. This is an ambitious project, based on local economy and short cycle, but with a global scale. If a country distributes&nbsp;<strong>Delepaule,</strong>&nbsp;it means that the bag is manufactured in the country. The identity of&nbsp;<strong>Delepaule</strong>&nbsp;will be built on the divergence of techniques and cultures. It is based on the valorization of these cultures through details and finishes made, always with the single watchword: quality at any trial for a bag that can follow you anywhere!<br>&nbsp;<br>&nbsp;</p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653424/fiqfg3mteogsieunwagl.jpg\" data-image=\"\"></figure>\n\n<p><em><br>&nbsp;<br>It all started with the frustration of having to choose.<br>&nbsp;<br>The brand philosophy, the identity, the policy made a brand unique. It is easy to federate to an idea, but much more complicated to seize it. Indeed, each brand offers a whole range of products in which the consumer has to choose.<br>&nbsp;<br><strong>Delepaule</strong>&nbsp;is based on : An idea, a philosophy, a product.<em><br>&nbsp;<br>&nbsp;<br>Delepaule is not just a bag, is also a new idea of business model. Based on the short distribution channel values (local, social, well-made,&nbsp;environmentally responsible) and the global distribution of standard channel, Delepaule wants to create a huge stylist network who will create and&nbsp;distribute the bag on their own country. Each product&nbsp;will be slightly different, and it will be for the best ;D<br>&nbsp;<br>&nbsp;<br><em></em></em></em></p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653443/jdnnmbem5uuj3qbvnplj.jpg\" data-image=\"\"></figure>\n\n<p><em><em><em><br>&nbsp;<strong>Delepaule</strong>&nbsp;offers you the right not to choose. You like the idea? Agree with it by adopting the product, and choose later how you will like to wear it.<strong>Delepaule</strong>&nbsp;gives you the possibilities of a whole range in a single product. Assemble & disassemble it as ease as a construction game!<em><br>&nbsp;<br>The&nbsp;<strong>Delepaule</strong>&nbsp;is composed of three parts : The main bag, which as two large pockets (vertical & horizontal) able to welcome a 15\" laptop. The small bag, which is able to carry a 10\" tablet. And two straps that you can assemble as you want, to create the most suitable bag for you and your needs : backpack (2 or 3 pockets), messenger, shoulder bag or tablet bag.<br>&nbsp;<br>The idea came up in Barthélémy Delespaul street, in Lille. M. Delespaul was a industrial specialized in linen spinning (start of 19th century). The name :<strong>Delepaule</strong>&nbsp;is a tribute to the history & the culture of my region, mixed up with a bit of humor : le sac de l\'épaule (the bag on a shoulder).<br>&nbsp;<br><em></em></em></em></em></em></p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653457/xeyoulve0dpws2uonhhj.jpg\" data-image=\"\"></figure>\n\n<p><em><em><em><em><em><br>&nbsp;<br>&nbsp;The fabrication of the bag respect a strict policy : the highlight of the different actors of the project. The bag is made by a stylist using fabrics from Europe. The distribution is in the same country that the manufacture. In that way, materials and technics used can be different from one country to another, adding value to the bag thanks to a local knowhow.&nbsp;<br>&nbsp;</em></em></em></em></em></p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653548/bs3axauo6kdwixsa9er6.jpg\" data-image=\"\"></figure>\n\n<p><em><em><em><em><em><br><em>The bag is unique but declinations are multiples. Before using it as you wish, you will be able to find it in several versions, giving you a feeling of uniqueness.<br></em></em></em></em></em></em></p>\n\n<ul><li><em><em><em><em><em><em><em><em><em>&nbsp;version available in 3 color combinaisons. (night, brick, mustard)</em></em></em></em></em></em></em></em></em></li><li><em><em><em><em><em><em></em></em></em></em></em></em><em><em><em><em><em><em>version created by the stylist every seasons.</em></em></em></em></em></em></li><li><em><em><em><em><em><em></em></em></em></em></em></em><em><em><em><em><em><em>limited edition in collaboration with artists, the bag becomes a expression area.</em></em></em></em></em></em></li></ul>\n\n','Beta project',NULL,148,40502,'Jeanne Coleman','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649179/tp4f4nre7dci6xlsvz2l.jpg','Fashion','0px -335px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649267/ygtny2dvmdvqtrsixkyr.jpg',1,NULL,'2016-05-24 16:56:40',6,0),(4,5,16,'Pine64','PINE A64 is the world\'s first 64-bit expandable Quad Core 1.2Ghz supercomputer, starting at just $15','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649671/kizncswdexdoqkryxfc6.jpg','<div class=\"video-container\"><iframe width=\"500\" height=\"281\" src=\"//www.youtube.com/embed/3CKO9kWLxS4\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div>\n\n<p><br></p>\n\n\n\n<p>PINE A64 is not only a computer, it is a super affordable 64-bit high performance expandable single board computer (SBC). &nbsp;Whether you are an IT professional, electronics hobbyist, student, teacher, hacker, inventor, or just someone who wants to have more flexibility to increase their productivity at work, the PINE A64 is a computer board made for everyone. &nbsp;Enjoy more fun and entertainment at home with endless possibilities.<br></p>\n\n<h1></h1>\n\n<h1>PINE A64 is Small</h1>\n\n<p>The PINE64 CPU is a quad-core ARM A53 64-bit processor that runs at 1.2GHz.&nbsp;</p>\n\n\n\n<p>The GPU on the PINE A64 is a dual-core MALI-400 MP2 and runs at 500MHz, capable of 1.1 Gpixel/s throughput. This means the graphics capabilities are slightly higher than the original X-Box\'s level of performance. &nbsp;</p>\n\n\n\n<p>PINE A64 board is powered by the latest 64-bit quad core ARM A53 CPU and delivers up to 20-30% better performance than other 32 bit open source counterparts.</p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653903/s5jmcwgfadglhzshunps.jpg\" data-image=\"\"></figure>\n\n<h1></h1>\n\n<h1>PINE64 is Expandable</h1>\n\n<p>Add different hardware interfaces to your PINE A64 as you see fit. Depending on whether you pick the PINE A64 or PINE A64+, the PINE A64 ships defaults with two USB ports, HDMI output, 3.5mm Audio/Mic Output, ethernet port, and two I/O expansion buses. On the more advanced PINE A64+ model, you will receive three additional ports to add optional accessories such as: camera module, touch panel module, and the LCD Panel port.</p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458653975/t4v4ihrcvx6p9qmslhcf.jpg\" data-image=\"\"></figure>\n\n<p><br></p>\n\n<p>PINE A64 is Versatile<br></p>\n\n<p>Add a keyboard and mice and turn PINE A64 into a full Android 5.1 computer to run Chrome Browser, Microsoft Word, Excel, Powerpoint, or even watch your favorite shows on YouTube.<br></p>\n\n<p>Load special versions of Android 5.1 and launch media players to turn this into an advanced Apple TV-like Android product. &nbsp;<em>PINE A64 supports miracast.</em><br></p>\n\n<p>Install a touchscreen module and choose from hundreds of thousands of games from the Android store to build your own arcade.&nbsp;<br>Play your favorite games on the big screen!</p>\n\n<p>Build a custom enclosure to use the PINE64 in your next innovative project.</p>\n\n<p>Because PINE A64 is an open source platform, you can load anything you want but we suggest to pair PINE A64 with Ubuntu, Android or openHAB IoT. By aligning the PINE A64 to be compatible with these operating systems, you basically get access to over 1.7 Million apps* on the market today, from utilities, games, and media apps.&nbsp;<br></p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458654106/lafheonrevmp0fgmihhz.jpg\" data-image=\"\"></figure><p><br></p>\n\n<p><br></p>','Beta project',NULL,256,46397,'Igor Gourevitch','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649484/hlr71vj7alebi8xgrnso.jpg','Technology','0px -231px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457649671/icpk2iq7b164kywr7x2z.jpg',1,NULL,'2016-05-24 16:56:40',11,0),(7,12,2,'Brace Leather','Beautiful leather accessories for life on the go','Chicago','','IL','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692081/ujuqfw65cec0k8odp6ty.jpg','<h1>Brace makes your life easier.&nbsp;</h1>\n\n<p><strong>Brace Leather</strong>&nbsp;is dedicated to design that is minimal, simple, and beautiful. Our goods are designed and crafted by experienced artisans with long-lasting and beautiful materials. Man Overboard is our first collection, a set of essential leather accessories for cafe life or work on the go.&nbsp;Our beautifully designed leather accessories are the essentials you need for life’s everyday adventures.&nbsp;</p>\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692324/ywpvi9xu4zp5y6l9hwag.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<h1>We need your help</h1>\n\n\n\n\n\n<p>We are very excited to introduce to you the Man Overboard kit: the essentials for life on the go. Our goal was simple: to use the inherent beauty of leather to create a beautiful set that will be functional, simple and last a lifetime. We are making the whole kit available on Kickstarter for purchase, along with each piece sold separately.</p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692271/k1w5xcftw0qd8fejkuoy.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n<h1>Our Leather</h1>\n\n\n\n\n\n<p>We only work with full grain leather which is the highest quality leather available on the market. Full-grain leather refers to hides that have not been sanded, buffed, or snuffed to remove imperfections or natural marks on the surface of the hide. This means each of our pieces will be naturally unique. Rather than wearing out, it will develop a patina over time. Our leather will wear beautifully and it will actually look better as it ages!</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692296/emegpfalbancuutw6pp1.jpg\" data-image=\"\"></p>\n\n\n\n\n\n<p>This beauty will take your laptop and your favourite magazine/ipad/notebook out on an adventure.<br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458655151/lyxpz6o8ktoxxvz3wqxd.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p><br></p>','Idea','',377,28914,'Sebastian Moresta','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457691617/vefkdhglnraxr2owpfji.jpg','Craft','0px -247px','h4dj0hxldvj2mjrm6yyk','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692087/sdmxm6vfsz8cj5rpo5mi.jpg',1,NULL,'2016-05-24 16:56:40',9,0),(9,14,7,'Secret Hitler','A social deduction game for 5-10 players about finding and stopping the Secret Hitler.','Montreal','','QC','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457693488/lomxex9ss2yzjw1dsxbu.jpg','<h2><a href=\"http://www.dailymotion.com/video/x49wjaj_cannes-2016-le-baiser-de-catherine-deneuve-et-laurent-lafitte-canal_shortfilms\">http://www.dailymotion.com/vid...</a></h2>\n\n<h2>What is Secret Hitler ?</h2>\n\n<hr>\n\n\n\n\n\n\n\n\n\n<p>Secret Hitler is a dramatic game of political intrigue and betrayal set in 1930\'s Germany. Players are secretly divided into two teams - liberals and fascists. Known only to each other, the fascists coordinate to sow distrust and install their cold-blooded leader. The liberals must find and stop the Secret Hitler before it’s too late.<br></p>\n\n\n\n\n\n\n\n\n\n<p>Each round, players elect a President and a Chancellor who will work together to enact a law from a random deck. If the government passes a fascist law, players must try to figure out if they were betrayed or simply unlucky. Secret Hitler also features government powers that come into play as fascism advances. The fascists will use those powers to create chaos unless liberals can pull the nation back from the brink of war.</p>\n\n\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457693688/el7ny7wm7unmzlgtgo8y.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<h1>How do you play ?</h1>\n\n\n\n\n\n<p>In Secret Hitler, each player is randomly assigned to be a liberal or a fascist, and one player is Secret Hitler. The fascists know in advance who Hitler is, but Hitler doesn\'t know who his fellow fascists are, and the liberals don\'t know who anyone is. Since the liberal team always has a majority, the fascists must play like moles, gaining the trust of the liberals to sabotage their plans and make them suspicious of each other.</p>\n\n\n\n\n\n\n\n<p>The objective of the liberal team is to pass 5 liberal policies or assassinate Secret Hitler. The objective of the fascist team is to pass 6 fascist policies or elect Secret Hitler chancellor after 3 fascist policies have passed.</p>\n\n\n\n\n\n\n\n<p>Each round, the President selects a Chancellor. The whole table votes \"Ja!\" or \"Nein!\" on their ticket; if a majority of players vote “Ja!,” the elected President and Chancellor take the following actions to pass a new policy:</p>\n\n\n\n\n\n\n\n<p>The President draws 3 policies from a random deck.<br>The President discards 1 policy and passes 2 to the Chancellor.<br>The Chancellor discards 1 policy and enacts the final one as law.<br>If a fascist policy passes, the President gains a new power that she must use immediately.&nbsp;</p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458655577/qklmfj1k4mklzmoct8x9.jpg\" data-image=\"\"></figure>\n\n\n\n<h1>What is so special ?</h1>\n\n\n\n<p>Secret Hitler is a love letter to hidden identity games like Werewolf/Mafia, The Resistance, and Avalon, but it\'s also a new design that fixes some of our biggest problems with those games.</p>\n\n\n\n\n\n<p>No moderator: Secret Hitler doesn\'t require a moderator - everyone can join in the game.<br>No early player elimination: We love the suspense of player elimination, but Secret Hitler saves that drama for the very end&mdash;assassinated players will rarely have to wait more than ten minutes before the game ends.</p>\n\n\n\n<p>In games like Werewolf, you can only act on your gut feeling. Secret Hitler creates a much more heady experience - there\'s almost enough information that you can solve the game like a puzzle, but not quite enough. Players always have enough information to make meaningful choices, but we\'ve simplified the decisions to avoid analysis paralysis; each round the President nominates a Chancellor, and the table votes yes or no to that ticket.</p>\n\n\n\n<p><strong>Why is Secret Hitler set in 1933 Germany?</strong>&nbsp;</p>\n\n\n\n<p>We believe that the theme and setting of a game work best when they help explain the story and mechanics.<br></p>\n\n\n\n<p>Hitler’s takeover was, for a dictator, surprisingly political: he wasn’t a general who subverted a popular revolution, he wasn’t backed by foreign interests, there wasn’t a total collapse of government he took advantage of. He used the rickety systems of the Weimar Republic to gain power mostly legally; he was handed the Chancellorship by men who thought they could \"control\" him.</p>\n\n\n\n\n\n<p>Hitler and his allies spent years manipulating the levers of democracy, accumulating power in a snowball effect. He divided and intimidated his rivals. He used national crises to strengthen his own position. His followers were organized and brutal, and his rise was equally engineered and opportunistic. There were good men who didn\'t understand how dangerous he was until it was too late, and there were bad men who wanted power for themselves but were outmaneuvered.</p>\n\n\n\n\n\n<p>Social Deduction games are about a well-coordinated minority trying to convince a confused majority to vote against its interests. It\'s an inherently political genre.</p>\n\n\n\n\n\n<p>We set out to make a game to help us reflect on the ways that others - good, bad, indifferent - were complicit in Hitler\'s rise to power. Our game doesn\'t model the specifics of German parliamentary politics. Instead, we try to model the paranoia and distrust he exploited, the opportunism that his rivals failed to account for, and the disastrous temptation to solve systemic problems by giving more power to the \"right people.\"</p>','Idea',NULL,44,11285,'Max Tolkin','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457692902/jv6x5gtfnq7fkd45sv5w.jpg','Games','0px -163px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457693488/kdlzyuywfdkombfkg7uo.jpg',0,NULL,'2016-05-24 16:56:40',0,0),(10,15,14,'Pixelio 3D','First Portable All-in-One & Easy-to-Use 3D Scanner','Shanghai','','China','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457694415/dbqd6scilxpna4r26144.jpg','<h1>What is Pixelio 3D ?</h1><p>Using the latest 3D technology Smart 3D Ltd has created Pixelio. Pixelio is an innovative, modern and easy to use 3D scanner that can be used by everyone!</p><p>Until now, the market has lacked a good and low cost device for 3D printer users that allowsto copy objects, make spare parts, or archive collections in the form of 3D files.</p><p>Smart 3D Ltd team createsa device that fill this gap. The company also wanted to add some simpleand clever features to theirsmall devices. That is why&nbsp;Pixelio&nbsp;– the first baby of Smart 3D became also a device that helps to improve your photos or even movies. &nbsp;</p><p>Pixelio will introduce you to a new dimension in 3D photography.<br>With Pixelio scanner you can enjoy high-tech features for a reasonable price. All you need is a smartphone or gopro camera.</p><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457694556/w5aydr3esev57ast5kss.png\" data-image=\"\"></figure><p><br></p><h1>Who is Pixelio 3D for ?</h1><p>Everyone will find Pixelio useful!</p>\n\n<p>Affordable and user-friendly it should satisfy the most demanding photographers and 3D printer users. Pixelio does not have its own optics as for that purpose, it uses your smartphone camera and a free app (eg. 123D Catch). That makes it even more accessible.</p>\n\n<p>Featuring a wide range of functionality Pixelio will be perfect for:</p><ol><li>sellers on eBay, &nbsp;other auction sites</li><li>bloggers and vloggers</li><li>graphics</li><li><span></span>real estate developers</li><li><span></span>architects, engineers etc.&nbsp;</li><li><span></span>or even tourists who want to take the best panoramic pictures.</li></ol><p>Pixelio is a simple and fast way to create amazing 360 degree photos! This option will particularly appeal to you if you sell on the Internet, write a blog or deal with professional product photography. The process of creating pictures is automatic. 360 degree photos can be saved to MP4 or GIF format.</p>','Beta project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1457694539/wgi7ix2t2zhwedhaxvxh.mp4',220,30536,'Hu Tang','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457694177/nsei9eggjayb8ifodvdq.jpg','Science','0px -207px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457694415/tyvw4l3ieuahlye7enjb.jpg',1,NULL,'2016-05-24 16:56:40',5,0),(13,22,11,'Kien','the first flexible sound system. High quality sound for everyone','San Francisco','','CA','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457697576/ci2e5te5vsusdnmfofj6.jpg','<p>Hey everyone! You guys are going to love this: our creative director is showing the feature of cycling a sat between grouped and individual mode!</p>\n\n<p><br></p>\n\n<p>Audio is important in our lives. At kien we are determined to bring you a new breed of sound system that allows you to share audio with your friends anywhere and in any imaginable way you want: Dolby® surround sound, Hi-Fi stereo, multiroom, all made portable. Kien covers it all. Set your speakers up wherever you want: in your house or even outside. Start enjoying audio the way you want it.<br></p>\n\n<p><br></p>\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457698029/cxqzscmnsnoosfve5zip.gif\" data-image=\"\"></figure>\n\n\n\n<p>Enjoy stereo sound from our wonderful sound system by bluetooth.</p>\n\n<p><br></p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457698294/euugyqw46zii5okdsk8v.gif\" data-image=\"\"></figure>\n\n\n\n<p><br></p>','Drafted project',NULL,127,84083,'Florent Gautin','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457696920/bqmrx96mrlddmgy79svo.jpg','Music','0px -367px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457697576/wfc9mihrvnoi185nlvrh.jpg',1,NULL,'2016-05-24 16:56:40',4,0),(17,42,6,'food','','Paris',NULL,'France','','','Idea',NULL,19,93642,'Clotilde Moreau','','Food','','','',1,NULL,'2016-05-24 16:56:40',0,0),(28,52,16,'Connexion','','Paris',NULL,'France','','','Live project',NULL,12,41058,'Charlotte Hamelin','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(29,77,16,'Whire.me','','Paris',NULL,'France','','','Beta project',NULL,23,29239,'Hugo Côté','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(53,3,14,'Robotic Extrusion','A printing head led by KUKA R900 produced self-supporting structure(ABS)','Cambridge','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458579845/dcxxo738epemfwb0mmcq.jpg','<h1>ROBOTIC EXTRUSION</h1><hr><p><br></p><p><em>Research of Digital Craftsmanship & Autonomous Fabrication</em></p><p>&nbsp;<br>The project, Robotic 6-Axis 3D Printing, is a highly-integrated installation combining robotics, 3D printing technique and interactive interface. It aims to provide the designer a digital method to eliminate the line between \"Designing\" and \"Fabricating\". In this case, architects provides more than just drawings and construction notes, however, they are capable of fabricating their work quickly and precisely by themselves.<br>&nbsp;<br>Most of today\'s researches and applications of robotic fabrication are limited to replicating human labor and raising efficiency of manufacturing. However,&nbsp; in the project of Robotic 6-Axis 3D Printing, we developed a fabrication strategy learning and emulating the law of nature (referring to Chinese philosophy \"师法自然 \"). By studying the material and structure performance of 3D form in nature, we figured out a way to incorporate biomimetic fabrication strategy into 3D printing process. And by designing the special robotic-end effector (Tooling) and utilizing the great flexibility and accuracy of KUKA robotics, the biomimetic fabricating process has been fully realized.<br>&nbsp;<br>The whole process embodied the concept of \"Digital Crafsmanship\", which emphasis the personality of designer and allows them to closely intergrated \"Designing\" and \"Fabricating\".<br>........................................................................................................................................................................................................</p>\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/5c8b1722536831.5631453917ac1.jpg\"></p>\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/39743222536831.5631453192288.jpg\"></p>\n\n\n\n\n\n<p>Whole Printing Process / Freeze Frames of the Movie</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n<em class=\"redactor-inline-converted\">\n\n\n\n<p>........................................................................................................................................................................................................<br>PHASE 01: BIOMIMETIC CONCEPT & SIMULATION<br>&nbsp;<br>3D printing technology has great potential in future fabrication field, however, it is unconvincing to address it with the name of future craftsmanship. This manufacturing process has limitations in spatial flexibility and fails to perform a fabrication structural strategy. It is because the current 3D printing technology mostly relies on the superimposition of thermoplastic ABS/PLA material along direction of gravity.<br>&nbsp;<br>Robotic 6-Axis 3D Printing project uses the same material (ABS) but has make a breakthrough in the way it prints. By mimicking the micro-structure of spider silk thread, a specific fabrication strategy has been added into this process. This change makes it possible to print simple self-supporting forms and is capable to show how the form grow from the ground. In this way, the material develops its full potential to expanded the materiality through the biomimetic printing progress.<br>........................................................................................................................................................................................................</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/4bb7c522536831.563145124af3f.jpg\"></p>\n\n\n\n\n\n<p>Structural Inspiration from Spider Thread</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/59f29e22536831.56314516a11bc.jpg\"></p>\n\n\n\n\n\n<p>Reinforcement of Linear Structure of ABS Material</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/6713c122536831.5631450ed6869.jpg\"></p>\n\n\n\n\n\n<p>Structure&nbsp;Simulation Before Fabrication (Software Simulation & Physical Model Simulation)</p>\n\n\n\n\n\n\n\n<p>........................................................................................................................................................................................................<br>PHASE 02: DESIGN OF THE PRINTING HEAD(ROBOTIC END-EFFECTOR)<br>&nbsp;<br>In 6-Aixs 3D Printing project, the idea of biomimetic structure is realized by a delicate robotic-end effector. The core component is a petaloid turn-plate, which has 3 movable printing head attached alongside and 1 fixed printing head in the center. When the whole system is powered by a servo and start functioning, the rotation of turn-plate leads to the oscillating motion of 3 movable printing head, which in turn produce the spindle-knot-like motion trail.<br>&nbsp;<br>The printing module is standardized 3D printing module based on thermo-plasticity of ABS material. The temperatures sensor and heater inside the module take precise control of the printing process. As a result, the 3D printing system, combined with the mechanical system, is capable of printing the biomimetic structure.<br>........................................................................................................................................................................................................</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/16b07b22536831.56314572339fc.jpg\"></p>\n\n\n\n\n\n<p>Functioning Tool Head (2 Printing Status)</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/3e1eed22536831.5631452975b5d.jpg\"></p>\n\n\n\n\n\n<p>Axon Illustration of the Printing Head(Robotic End-effector)</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/d938bd22536831.5631457c339c6.jpg\"></p>\n\n\n\n\n\n<p>Exploded Axon Illustration of the Printing Head (Robotic End-effector)</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/e78dac22536831.563144e39a679.jpg\"></p>\n\n\n\n\n\n<p>Close-up of Explode illustration - Core components of the system</p>\n\n\n\n\n\n\n\n<p>........................................................................................................................................................................................................<br>PHASE 03: DESIGN OF EXTERNAL DIGITAL CONTROL SYSTEM&nbsp;<br>&nbsp;<br>The programming of the robotic-end effectors is based on Arduino. Each printing head has a heater inside which is uniquely programmed and can precisely maintain the temperature in appropriate range. Also there are tubes sending compressed air to the front of printing head to cool and finalize the material. Four material(ABS) deliver system driven by 4 individual servos works like normal 3D printing devices. Besides, one motor is responsible for the rotating motion of the central turn-plate. Both the speed of delivering and rotating can be changed via the switches on the center stack. In this case, the shape of the structure can be adjusted following the designer\'s idea.<br>........................................................................................................................................................................................................</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/f6b87022536831.5631456e6d3aa.JPG\"></p>\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/f9037622536831.5631456e5d9c4.jpg\"></p>\n\n\n\n\n\n<p>Components of External Digital Control System</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/6ce45522536831.5631456fde1be.jpg\"></p>\n\n\n\n\n\n<p>Work-flow Diagram of the Circuit System</p>\n\n\n\n\n\n\n\n<p><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/278f3322536831.5631456e6623b.JPG\"></p>\n\n\n\n\n\n<p>Close-up view of the Circuit System</p>\n\n\n\n\n\n\n\n<p>........................................................................................................................................................................................................<br>FABRICATION PHOTOS (PROGRESS/PRODUCTION/EXHIBITION)<br>........................................................................................................................................................................................................</p>\n\n\n\n\n\n\n\n<p><em class=\"redactor-inline-converted\"><img src=\"https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/1fe83b22536831.56314899358da.JPG\"><br></em></p>\n\n</em>','Beta project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1461944679/b8cszlvdfjkyr8wrno51.mp4',941,77941,'Henry Wei','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457648516/tgaugxgkwjzj0ik5bhcu.jpg','Science','0px -43.075px','b8cszlvdfjkyr8wrno51','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458579845/l1pg7drtydg116axywbi.jpg',1,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461944763/ado0f0vjgfix4xlrxspj.jpg','2016-05-24 16:56:40',14,0),(54,97,16,'Crownstone','','Rotterdam',NULL,'Netherlands','','','Live project',NULL,19,19080,'Anne van Rossum','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(55,101,15,'WoodRover','Luxury Wooden Bicycles','Kiev','','Kyiv city','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458586835/i85k7hlipk0wq373ptv2.jpg','<p>WOODROVERS are produced in limited number and only for elected people , <br>and then these ones select the texture of wood, colour and finishing <br>strokes. Your WOODROVER will be out-and-outer bike that rides better <br>than any other you have ever owned.</p><br><p>Wooden frame absorbs impacts, kicks and vibration; has an improved durability and strength.</p>','Live project',NULL,335,54246,'Valeriy Gorbatov','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAL2tuYOcdcOIKSNcwFOzY1ZAqyJqqDEZBw3ofkSNEU1','Sport','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458586833/qk6umrauzyglbeohqxe5.jpg',1,NULL,'2016-05-24 16:56:40',13,0),(56,126,16,'Build Focus','Train yourself to concentrate, beat distraction, and get more done.','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458647973/z5iv8etb5ngy6ripuin3.jpg','<hr><p><br></p><p><strong><a href=\"http://www.buildfocus.io\">Build Focus</a></strong> is a productivity tool that trains your mind, to wean you off checking Facebook every five minutes and onto focused concentration, so you can beat distraction and get things done.</p>\n\n<p>Inspired by addictive games like World of Warcraft and Farmville, it puts gamification to use for good in your own head, and creates a powerful instant feedback loop that drives you towards concentration and focus, and out of distraction.</p><p><br></p>\n\n\n\n\n\n\n\n<p>Quit automatically opening Twitter when the going gets tough, and stop losing time to the internet; teach your brain better habits, kill distraction, and reach your goals.</p>','Beta project',NULL,440,59887,'Tim Perry','https://lh6.googleusercontent.com/-tmYaon1pd1E/AAAAAAAAAAI/AAAAAAAAXtQ/13GqxkStsMM/photo.jpgsz=200','Technology','0px -302px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458647973/u0pi6u3ictilp3njrdgu.jpg',1,NULL,'2016-05-24 16:56:40',18,0),(57,133,16,'MySeer','A simple gadget that helps you decide whether or not to bring an umbrella on your way out the door.','New York','NY','United States','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463674536/gsshpmk1dhalswe7lqrh.jpg','<p>\"3....2....8....1....5....8....\" I muttered, as I was entering the&nbsp;numbers into the portal\'s computer. I\'m not sure where the numbers came from, my fingers were just idly dancing over the number pad. Sometimes I like to think to myself that fate is gently pushing my fingers around, like some invisible Ouiji board. After a few trans-dimensional adventures, most people quickly abandon their belief&nbsp;in&nbsp;fate and purpose. Contrarily, I feel a surge of destiny as I hit the Open button. The enormous machine spins to life, and after double-checking the viability of the atmosphere of the other side, I grab my backpack and step through the portal.</p>\n\n<p><br></p>\n\n<p>Standing in the middle of what would pass as an ordinary field back home, I get to work. The boring stuff has become almost routine: take a sample of the atmosphere and toss it back through the portal for analysis back home. The higher-than-earth levels of oxygen explain the leviathan trees, but the imbalance of air means I\'ll have to breathe from my air tank until I get used to the new air. After taking a few pictures and sampling&nbsp;background radiation levels, I toss them back through too. Now for the fun part.</p>\n\n<p><br></p>\n\n\n\n<p>I take out my home-built \"civilization scanner\" and set its sensitivity to full. After a few seconds, it reports that the world I\'m currently standing on has traces of biological activity, but no levels of nuclear fallout or orbiting satellites. They either haven\'t developed nuclear weapons yet, or have no need for them. I set off in the direction of the nearest settlement according to the scanner, and hope for the latter.</p>\n\n<p><br></p>\n\n\n\n<p>A few days later I arrive at a hill overlooking a small village. At first glance it appears to be a modern society that somehow hadn\'t quite figured out steel: all the buildings were squat and built from wood or stone materials, but they had an abundance of electric lights strung across, in between, over, and possibly under the buildings, judging by how many of the wires abruptly ended in the ground. It was at this point I realized that their sun was dramatically dimmer than our own (I don\'t spend much time staring at the sun). The people walking through the village were humanoid, with longer arms and shorter legs than the average person, giving them an almost humorous gait. Their actions seemed intelligent and purposeful though, with no obvious signs of violence anywhere, so I grabbed my picture dictionary and headed down into the village.</p>\n\n<p><br></p>\n\n\n\n<p>I\'m used to the strange stares of other-dimension&nbsp;personoids by now, and almost as&nbsp;if&nbsp;on cue&nbsp;I\'m&nbsp;&nbsp;whisked away by what appear to be security forces, to see someone I assume is high ranking in this society. The first few hours of communicating using the picture dictionary brought us to&nbsp;common ground, and with a basic understanding of their language, I come to learn&nbsp;that this personoid was the leader of the local militia, and despite a peace lasting hundreds of years, this planet\'s society&nbsp;is largely dominated by a smattering of fiefdoms peacefully separated by impassable natural features. I ask for copies of some basic textbooks and a map, and head back into the village after telling them my story and assuring them that I\'m just passing through. Everyone loves a tourist.</p>\n\n<p><br></p>\n\n\n\n<p>On my way out, I ask one of the guards about all the lights. They point to their eyes (I don\'t get&nbsp;how genders work on this planet yet), and I look closely into their strange star-shaped pupils: they seem to be much more inflexible to changes in brightness than ours. Opening the biology textbook, I notice many of this planet\'s animals share this similar trait. Perhaps the sun used to be much brighter, I ask, but the guard doesn\'t seem to know.</p>\n\n<p><br></p>\n\n\n\n<p>After stopping in to a store to sample the local bread (tougher than ours) and water (normal), I start heading for the point on the map the militia leader marked as the center of this country\'s scientific community: a museum in the largest city on this half of the world. As the personoids\' lifespans are incredibly long, quick transportation seems to be a low priority for this world, and walking hundreds of miles is a common activity seen as a leisure. Thankfully, I manage to trade some of the souveniers I always bring with me from our dimension, for something resembling an over-sized tricycle.&nbsp;&nbsp;I then&nbsp;repurpose&nbsp;one of the generators&nbsp;to give the trike a decent 25mph clip over normal terrain. My sponsor hands&nbsp;me a small white plastic box, which they assured me would keep me safe from the rapidly changing weather patterns of this planet. Not seeing any obvious buttons or dials on the device, I thank them and tuck it into my bag, unsure of what to do with it.</p>\n\n<p><br></p>\n\n\n\n<p>The personoids have mastered electricity storage and generation, so it wasn\'t very long until&nbsp;I speed off on my 3-wheeled electric go-kart with half the town curiously watching. A&nbsp;few hours later, I\'m caught in a storm which seems to want nothing more than to drown my hopes of making it to the city, and I barely make it&nbsp;all the way&nbsp;back to the portal alive. If only I used the box...</p>','Beta project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1463674718/tacbetwthmcooi3qmmjq.mp4',177,69437,'Jarek Lupinski','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458705999/t75lmmi4lg40xsclhnrd.jpg','Technology','0px -2px','tacbetwthmcooi3qmmjq','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463674536/ofkcdradvjc2zvllkqcl.jpg',1,NULL,'2016-05-24 16:56:40',9,0),(59,139,3,'Shelter','The Shelter sunglasses are the fruit of an offbeat vision of the eyewear world','Annecy','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458838787/ahudgcyrlyaboomjokzi.jpg','<p><strong>Shelter Woodsunglasses made in Annecy - A Thorough french manufacturing</strong></p>\n\n<p>Rooted in time, the Shelter brand was created in July 2013 following the resounding success won on the crowdfunding platform KissKissBanBank. In 45 days, we&nbsp;raised more than 18000 euros&nbsp;and 150 pre-orders for the manufacturing of pairs of sunglasses to be delivered in two months.&nbsp;Challenge taken up !</p>\n\n\n\n<p>Shelter has been a curious endeavor from the beginning. From our&nbsp;wood&nbsp;<em>workshop, based in the city of Annecy, they manufactured their sleek and timeless first collection. Each frame is unisex and made with a multilayer wooden structure the maximize the linkage between robustness, flexibility, lightness and comfort.</em></p>\n\n<p><br></p><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462267456/u6cze2hufu2s9pznfd1f.jpg\" data-image=\"\"></figure><p><br></p><p>An endeavor to create a product that encompasses the individuality and uniqueness that can only be found in natural surroundings. A desire to experiment with design, materials and aesthetics in the search for something that works. Free from passing trends, the brand’s focus remains that of its roots, innovation and creation. Long live creativity.</p><p><br></p><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462268340/wkfcrr7wk1ce7ihqovwd.jpg\" data-image=\"\"></figure><p><br></p><p><br></p>\n\n<p>The Shelter sunglasses are the fruit of an offbeat vision of the eyewear world and are designed to arouse the curiosity of a community in search of authenticity and tradition.<br>Each frame is unique and has its own characteristic associated.</p><p><br></p><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462266122/cdkcxhm3oezfhseoroha.jpg\" data-image=\"\"></figure><p><br></p>','Live project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1458917093/tf5br8h1fejjfo2zagha.mp4',1242,61750,'Emeline Barat','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAK3ejroQCGdlCvsOo9FeLIwrEJkUsCipuYNahMREK5R','Design','50% 50%','tf5br8h1fejjfo2zagha','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458838788/rawnvuyxehimfxqap42q.jpg',1,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462264482/ma6xayussknr5pj2w7ma.jpg','2016-05-24 16:56:40',29,0),(60,143,5,'hoop','Shoot a video and see what shoots back.','Tel Aviv Region','','Israel','','','Live project',NULL,1,61243,'Danielle Meyers','https://graph.facebook.com/me/picture?width=200&height=200&access_token=CAAG7LqtfGXYBAGtxDH1b9zB46ncDsD5HNe3qv97uqduVbUaluzNWUOG','Film & Video','','','',0,NULL,'2016-05-24 16:56:40',0,0),(61,145,11,'Cizoo','Cizoo app allows you to sing a message easily to your friends','Paris','','France','','','Live project',NULL,11,47092,'Sebastien Debry','','Music','50% 50%','','',1,NULL,'2016-05-24 16:56:40',1,0),(62,149,16,'Bisly.co','','Paris',NULL,'France','','','Live project',NULL,5,57690,'Jeremie Nacache','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(63,150,16,'el needO','','Albi',NULL,'France','','','Beta project',NULL,6,69378,'El Needo','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(93,165,3,'D-TWELVE Lamp','Explore the infinite ways of using the first modular, versatile and customizable handmade LED lamp','Rome','','Metropolitan City of Rome','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461313131/g4hsua4buorgtpni2fzk.jpg','<p>Plato Design is running a crowdfunding campaign ending May 16th 2016 to start D-TWELVE production. Please have a look <a href=\"http://kck.st/1qeVfnx\">here</a>.</p>','Live project',NULL,110,11308,'Plato Design','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461312900/stsqh5mukmthqx5ltmmo.jpg','Design','0px -12px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461313119/invmzhb4hgxlvmt8kno0.jpg',1,NULL,'2016-05-24 16:56:40',9,0),(125,169,16,'Blckbox','System which detects when the user is in trouble and alerts friends and family in that case.','Xalapa','','Mexico','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461766888/mbllvdqrotykz49004yt.jpg','<p>Our two co-founders met in an innovation bootcamp in Mexico, where they realised they have lived a similar situation in their lives which is worth solving: Both suffered a kidnapping case in their family. The plan was to create a solution that combats the problem.</p><p>But is has become so much more. Blckbox is now steering at the direction of mainly being a service which alerts the safe and sound arrival at a destination of people\'s loved ones. Additionally, when a problem is being detected by the service (mobile app + web platform), an alert is being sent.</p>','Drafted project',NULL,406,25450,'Marc Backes','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461766602/dn0bp1zpvkr6kucmt8sx.jpg','Technology','0px -387px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461766889/zq27qimwgtcumbdickh4.jpg',1,NULL,'2016-05-24 16:56:40',18,0),(126,174,1,'aaa','','Istanbul','','İstanbul','','','Idea',NULL,79,74792,'Ahmet Sergen DAYANIKLI','https://lh3.googleusercontent.com/-nYaKm0UUUds/AAAAAAAAAAI/AAAAAAAAAZ8/UNRg1u5LqAE/photo.jpgsz=200','Art','','','',1,NULL,'2016-05-24 16:56:40',0,0),(128,186,16,'Democracity','Participatory democracy through open innovation','Bucharest','','Romania','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461917807/e2fsrpxq4xccnlau84eu.jpg','<p>Globalization<br> in its current asymmetrical form demonstrated to be incapable of <br>reducing inequalities in the world as it has let to the emergence of <br>“winners” and “losers”. While market forces demonstrated to be a non <br>sufficient mean to lead to the most efficient allocation of resources, <br>these governments and institutions have failed to meet the needs of the <br>Common Good and bring society together to solve global issues.</p>\n\n<p><i></i></p><i>\n\n</i><p><i>It is widely felt that socio-economic needs are not being addressed, <br>few believe that state institutions act in their best interests, and <br>many communities are dissatisfied with their economic situations. <br>Entrenched power systems tend to favour a selected minority while <br>reinforcing inequalities and discouraging social integration. Surveys <br>indicate that a growing majority of individuals feel they have no <br>control or influence over the economic, political and social factors <br>that affect their lives. The hopes, the aspirations and concerns of <br>those who have no chance to express themselves are frequently overlooked<br> and ignored. Moreover, the urgent environmental problems, the <br>incapability of this type of democracy (accountability problems, <br>legitimacy problems, corruption) and of the market alone to handle them,<br> request a totally fresh approach.<br></i></p>','Idea','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1461917926/zxvy6otv6qohhahdccqd.wmv',196,95540,'Manu Musa','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461917477/zchgzb7k9pc0ctvyyq8r.jpg','Technology','0px -224px','zxvy6otv6qohhahdccqd','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1461917807/dl6wax43uaqe7tu2n0c5.jpg',1,NULL,'2016-05-24 16:56:40',9,0),(130,201,5,'hoop','Where videos gain momentum and evolve into “social video chains” triggered by trends and memes.','Tel Aviv-Yafo','','Israel','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462106301/rvhluuf9ij2ywnyrefyu.jpg','<p><strong>About hoop</strong></p>\n\n<p>Hoop is introducing a new dimension to mobile video. It’s where your videos gain momentum and evolve into “social video chains” triggered by trends, topics and memes. Currently available on iOS, hoop’s app is a continuous experience enabling people to easily switch between watching or joining the creations of others, helping to build dynamic content that’s bigger than the sum of the parts. <br><br><strong class=\"redactor-inline-converted\">How it works</strong><br></p>\n\n\n\n<p>Users can participate in three ways: They can start their own chain by uploading or creating an initial 15-second video. They can also join an existing chain by responding with their own video. Or they can simply upvote individual videos. Upvoted videos move higher up in their &nbsp;chain. Chains can be discussions, trends, compilations, challenges, memes or anything else that can be developed collectively and have a topic or a theme. Current categories include Dance, Sports, Fashion, Animals and more. Creators who start a chain are spotlighted as originators. Each chain has potential to grow dynamically and evolve into new directions with each new video addition and moment.</p>','Live project',NULL,1,63969,'Danielle Meyers','https://lh3.googleusercontent.com/-t96teT8wsjU/AAAAAAAAAAI/AAAAAAAAABY/pYC_JotZCm8/photo.jpgsz=200','Film & Video','0px -169px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462106303/gizevesybgui50s1ns3p.jpg',0,NULL,'2016-05-24 16:56:40',0,0),(131,206,7,'Mayium','','Lille','','France','','','Drafted project',NULL,1,20532,'Guillaume Etienne','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462135573/iczadzujwuuatlqzdkuy.jpg','Games','','','',0,NULL,'2016-05-24 16:56:40',0,0),(132,229,16,'Recast.AI','A collaborative Bot Platform, build your own bot!','Paris','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462225606/nlchqmg59edaj12rind6.jpg','','Live project',NULL,151,38714,'Jasmine Anteunis','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462225405/d5xgkhanvunde36db58m.jpg','Technology','0px -215px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462225605/etqwjrzzus4uf2xsqpnp.jpg',1,NULL,'2016-05-24 16:56:40',11,0),(133,241,16,'WIZPAY','Started in 2013 a mobile marketplace, working with the QR technology.\nProject well advanced.','Bruges','','Belgium','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462274148/xrdbcbgdu22xfmtoryie.jpg','<p>Want to revolutionize the way we shop !!</p><p>WizPay wants to make it easier for sellers and buyers to buy thanks to a multi functional marketplace.</p>','Beta project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1462274283/zvh0npedehoffevbsnrf.mp4',292,90010,'Maximilien Lejeune','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBABFZAYOiScZAX62SCTZABKNzT2bDrr5XXNusZCc1aiZ','Technology','0px -393px','zvh0npedehoffevbsnrf','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462274148/tuow9d5b3uyk5xqhjzze.jpg',1,NULL,'2016-05-24 16:56:40',10,0),(134,251,16,'Synervoz','Synervoz, a Techstars backed company, focuses on always-on voice communication applications.','London','','United Kingdom','','<p>We are looking for an experienced iOS developer to rebuild our music & communications app. You can learn more about our product(s) here:&nbsp;<a href=\"http://www.synervoz.com/\">www.synervoz.com</a></p>\n\n\n\n\n\n<p>We are part of Techstars’ Virgin Media accelerator, and we are looking for someone who can join us in the office in East London (Aldgate East) for at least part of the contract. We have an iOS app on the App Store today, but the code base has become unwieldy and is in need of a total overhaul. The job would start with a white board session including yourself, the CTO, and the CEO. Together we will determine the best architecture given lessons learned to date, and future plans. This is not a job for a beginner. We are looking for experience in the following areas:</p>','Live project',NULL,46,71740,'James Meier','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462356780/lgfzbuir8ejcpaf4aoki.jpg','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(136,256,3,'Lockstone','Capture and enhance the life of your favourite fragrance with Lockstone.','Leeds','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394603/kldkte0412khgkhac0ne.jpg','<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394671/wpt43bohizrqqf4wwgya.jpg\" data-image=\"\"></figure><h1>&nbsp;<a href=\"http://kck.st/1TIHlUy\">Click Here To Help Support Us On Kickstarter!</a></h1>\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393679/zbp6fgfb5etvl3fl3ulq.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p>The revolutionary Lockstone range: crafted from a meticulous study of nature to capture and enhance the life of your fragrances.</p>\n\n\n\n\n\n<p><br>Inspired by nature, developed by science and designed with a focus upon minimalist, streamlined aesthetics.</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393715/y8usqrmpb2jvoortfqey.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p>Capture and enhance your fragrance. &nbsp;Whatever your scent – Lockstone captures it – Just spray with your favourite fragrance and it will last approximately seven times longer than wearing your fragrance without it.<br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393809/oklxiaim1lvtqdw6t30p.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p>We’ve harnessed a high-tech polymer, and combined it with precision turned metal – meaning that Lockstone items will look as good today as they will tomorrow and for years to come; all with a reassuring weight of quality while light enough to go unnoticed when worn.<br></p>\n\n\n\n\n\n<figcaption>The pendant, in a range of designs, can be worn by men and women<br></figcaption>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393854/xgcnqazaatpng5le4vbd.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393874/lu93h6z0igevcspeou5v.jpg\" data-image=\"\" alt=\"\" title=\"\"><figcaption>Easy to charge with any fragrance. Just allow 4 minutes for the fragrance to absorb.</figcaption></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393893/sxveitpitxlijjr9qi8x.jpg\" data-image=\"\" alt=\"\" title=\"\"><figcaption>Customise your range with your own fragrance.</figcaption></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393909/iyl3dfvjtihpot6omdyq.jpg\" data-image=\"\" alt=\"\" title=\"\"><figcaption>The Lockstone range allows your fragrance to last the day</figcaption></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393927/cngtcpmqmvbmosmnizql.jpg\" data-image=\"\" alt=\"\" title=\"\"><figcaption>Available in a range of precious metals</figcaption></figure>\n\n\n\n\n\n<p>The pumice stone: on the outside it’s an incredibly simple object – yet within it are thousands of intricate structures – structures that make for micro aerated pathways, allowing this otherwise innocuous item to absorb and retain moisture for long durations.</p>\n\n\n\n\n\n<p><br>This naturally created material has been under the microscope within our labs – where we’ve been able to harness micro-porous structures to create a revolutionary material.</p>\n\n\n\n\n\n<p><br>This all-new, patent pending material draws fragrance in, slowly releasing the scent over a long duration. For you this means longer lasting and better performing fragrances – where expensive designer scents enjoy a longer life and through which an aroma can be sustained far beyond a single day’s wear.</p>\n\n\n\n\n\n<p><br></p>\n\n<h1>&nbsp;<a href=\"http://kck.st/1TIHlUy\">Click Here To Help Support Us On Kickstarter!</a></h1>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393970/sme02alo6zbgu74sglhe.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<h1>Pendants</h1>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462393990/wuxgnaduma12khbsiqlg.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p>We\'ve reinvented the classic piece that is the pendant; through a focus upon clean lines and an impactful, minimalist design we’ve created an item that delivers long lasting aroma whilst equally adding subtle style to any outfit. For men, for women, for the formal and for the every day.</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p>Each of our pendants are simply infused with any given fragrance via the stem. Our breakthrough material then emanates scent as the stem warms against the skin.</p>\n\n\n\n\n\n<h1><br>Cufflinks&nbsp;</h1>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394023/hjqf2wwb6pyxbzrhtfcu.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p>Through combining machine turned stainless steel and brass with classic style we’ve found powerful partners, creating a design that is as practical as it is elegant.&nbsp;Our cuff links are perfect for anyone who is allergic to commercial fragrance, as the fragrance is not in contact with the skin.</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<h1>Plus Collection</h1>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394057/udrngeqxtvt2dwfxrikh.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394071/ozywn1ljvmbjgzsmvljr.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure><br></figure>\n\n\n\n\n\n<p>Stainless steel will retain a timeless quality and shine throughout its life. Brass and copper will become unique to you as they age and patina naturally, giving yours a finish like no other.</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394095/lljjwlwsogjbtkx3gcfo.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394104/c6nyi1b1ujndtljs5sb8.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394116/ais4m3qthlz7mjfscngh.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<ul><li><strong>Step 1:&nbsp;</strong>Invert your Lockstone and spray with your favourite fragrance; watch as the liquid saturates and is then gradually absorbed.&nbsp;</li><li><strong>Step 2:</strong>&nbsp;Leave upright for a few minutes – allowing the fragrance to be fully infused into the Lockstone.</li><li><strong>Step 3:&nbsp;</strong>Your fragrance will then be locked within the stone and through its micro absorbent structure your scent will be gradually released through contact with the skin</li></ul>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394208/sa2wnl1fkla2jxpulkwx.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394224/lyi1j6akzbyyi7hpnyja.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394230/rqmyn2ndqbkckxfq1cx4.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394237/mdpufequq0nrefkvygaq.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<h1>&nbsp;<a href=\"http://kck.st/1TIHlUy\">Click Here To Help Support Us On Kickstarter!</a></h1>\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394254/vdae0qqhhd9qpdrpqs7k.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p><strong><em>Accidental beginnings</em></strong>&nbsp;</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n<p>Lockstone emerged from a series of failed attempts at creating a new way of producing wallets; it was throughout this process that we noticed the materials we were working with remained damp – even after the washing and drying process, an occurrence that was to become quite the annoyance.<br>Yet this frustration would soon turn to curiosity, and we began to ponder just how this natural characteristic could be harnessed for something useful – and with that, our focus was shifted to refining a material to lock in fragrances.</p>\n\n\n\n\n\n<p><br><strong><em>Metal: A perfect partner to the Lockstone</em></strong><br>The design development phases were filled with exploration as to how the Lockstone could and should be teamed with other materials; pure metals seemed a natural fit to a project that had, by then, become defined by purity and refined by a focus upon simplicity. Equally, metals provided for a contrast, whilst delivering an uncompromising design that could elegantly withstand the rigours of everyday use.<br>By tapping into CNC turning we were then able to achieve perfect geometry – ultimately creating the timeless design that you see before you today: a design that goes on to also deliver rigidity and practicality for easy, stylish everyday use.</p>\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n<p><em><strong>About Us</strong></em></p>\n\n\n\n\n\n<p><em><br></em></p>\n\n\n\n\n\n<p><em><strong></strong>We\'re a small team of designers (and Ryan) that strive to develop innovative everyday products in terms of their function, aesthetic and materials. &nbsp;<br>Kickstarter has been the foundation of our business, starting all the way back in September 2014 with our first campaign for Carbon. Since then, we have launched two more campaigns, Stealth and also our first timepiece.&nbsp;<br>&nbsp;At the end of the day, we\'re designers with a passion for innovation,&nbsp;focusing&nbsp;on a minimalist approach to create and develop new products for everyday use. Lockstone is our first foray into the world of&nbsp;jewelry.&nbsp;We wanted to bring our minimalist approach and apply it to a range of&nbsp;jewelry&nbsp;that also pushed the function of&nbsp;jewelry&nbsp;in the everyday. With that, we introduce Lockstone to Kickstarter as the ultimate platform for innovation and development.<br></em></p>\n\n\n\n\n\n<p><br></p>','Idea','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1462392032/u5wxjuqenudwwepaonpy.mp4',796,95002,'Sean Sykes','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAOWdZByrMXTJt5ChY6g0dm4p6KlDkR9gWav3kyhXVNj','Design','0px 0px','u5wxjuqenudwwepaonpy','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462394603/wsg06ro8p6vqjmjjxdwe.jpg',1,NULL,'2016-05-24 16:56:40',16,0),(137,257,16,'Réseau social','Bonjour, je suis à la recherche d\'un partenaire dev technique pour la création d\'un réseau social','Paris','','France','','','Idea',NULL,151,48587,'Malick Ito','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462367082/pc0qtrivwv7m7p8gwrg3.jpg','Music','','','',1,NULL,'2016-05-24 16:56:40',2,0),(138,258,12,'One Third Stories','Stories that start in English & end in a different language','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462368413/oafvpyhuxdicpco8u13y.jpg','<figure></figure>\n\n<h3>Languages through Stories - <a href=\"http://bit.ly/kickstarterOTS\">Live on Kickstarter</a></h3>\n\n\n\n<p><br></p>\n\n\n\n<p>Language education is broken</p>\n\n\n\n<p><br></p>\n\n\n\n\n\n<p>Languages have so many cognitive, social and economic benefits. But in the UK, we struggle with boring lessons and grammar-heavy textbooks, which destroy interest from an early age. With all that to contend with, it’s no wonder that 58% of us regret not learning another language in school.<br></p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p>Our solution</p>\n\n\n\n<p><br></p>\n\n\n\n\n\n<p>We create stories that start in English and end in a different language, by gradually introducing foreign words in easy to understand contexts. We call this way of learning The&nbsp;Clockwork Methodology<the clockwork=\"\" methodology=\"\">®.</the></p>\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><br>Our vision is to encourage children to love languages by making learning them as simple as reading a story. So far, we’ve had thousands of teachers, parents and children try out different prototype stories and we\'ve launched our first story on Kickstarter. It that sailed past it\'s £10,000 target in just over 24hrs and it is still open so check it out&nbsp;(bit.ly/kickstarterOTS).</the></p>\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><br></the></p>\n\n\n\n<p><the clockwork=\"\" methodology=\"\">The Clockwork Methodology®</the></p>\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><br>Here’s an example of The Clockwork Methodology<the clockwork=\"\" methodology=\"\">®&nbsp;in action.</the></the></p>\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><br></the></the></p>\n\n\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><em>“The little boy looked at the sky and saw the bright, round, yellow&nbsp;</em><em><strong>sol</strong>”</em></the></the></p>\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><br></the></p>\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"></the></the></p>\n\n\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><em></em>You’ve just learnt the Spanish word for ‘sun’ simply by having it introduced in context! When this happens in our stories, we repeat the word lots of times. Words are built into phrases and phrases become whole pages in another language.</the></the></p>\n\n\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><br>The&nbsp;Clockwork Methodologyy<the clockwork=\"\" methodology=\"\">®&nbsp;works because it helps children learn a new language in the same way that they expand their vocabulary in their native tongue. We developed it while studying at university and have had hundreds of teachers, parents, and children help us to improve it.</the></the></the></p>\n\n\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><br>Our Story</the></the></the></p>\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><br>Alex and Jonny met almost eight years ago when Alex moved to the UK from Paraguay. During 6th form, they took part in a Young Enterprise project together with 10 other friends and created a book about a little girl and a penguin travelling the world and learning about foreign languages and cultures.</the></the></the></p>\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><br>Jonny struggled with French lessons when he was at school. But when he was studying English Literature and Linguistics at university, he had an idea about how to help children today learn languages more effectively.</the></the></the></p>\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><br></the></the></the></p>\n\n\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462398314/vd89jjfk4vq7fwpgl8me.jpg\"><br></the></the></the></p>\n\n\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\">Alex all penguin\'ed up</the></the></the></p>\n\n\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><br>That idea came from reading Anthony Burgess’&nbsp;<em>A Clockwork Orange</em>. A hyper-violent novel about a dystopian future might seem like a strange inspiration for a children\'s’ book, but Jonny was intrigued by the way the story worked in words from a made-up Russian dialect.</the></the></the></p>\n\n\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><br>Alex brought his language-learning expertise to the the project, and the two tinkered with the idea until the&nbsp;Clockwork Methodologyy®<the clockwork=\"\" methodology=\"\">&nbsp;was born. The pair founded One Third Stories and have been working to inspire more children to love and learn languages ever since.<br></the></the></the></the></p>\n\n\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><br></the></the></the></the></p>\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\">You can find our first story on Kickstarter today: bit.ly/kickstarterOTS</the></the></the></the></p>\n\n\n\n<p><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><the clockwork=\"\" methodology=\"\"><a href=\"http://onethirdstories.com/audiobooks/\"></a><br></the></the></the></the></p>','Live project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1464909398/owgqmdhfeijqzcnqnipb.mp4',379,31647,'Alex Somervell','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAJoaormGWRZCm3h1Djvl7ZAhxe14fQHqHVONuwZAwf0','Publishing','0px -224px','owgqmdhfeijqzcnqnipb','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462368408/ddibkmsdoe5bujhfw7z9.jpg',1,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464909664/peyjjgaam6k862g3po8x.jpg','2016-05-24 16:56:40',16,0),(140,292,16,'A','','Amsterdam',NULL,'Netherlands','','','Idea',NULL,2,48117,'Alexandru Jijie','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(141,160,16,'MeltingDoc','','Paris',NULL,'France','','','Live project',NULL,5,68111,'Christian Allouche','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(142,299,16,'Dualo du-touch','Experience the joy of creating your own music with one intuitive & stand alone instrument.','France','','Paris','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462900142/pmxemq2q6eurrbz8e861.jpg','<p>In 2014 Dualo brought out <strong class=\"redactor-inline-converted\">the du-touch</strong><the du-touch=\"\">, &nbsp;perhaps the most mobile yet complete&nbsp;instrument of its generation.&nbsp;A burgeoning community of all levels&nbsp;from beginners to experts are taking it up&nbsp;and their feedback is helping it evolve.</the></p>\n\n<p><the du-touch=\"\"><br>Today the Dualo is ready to widen this community,&nbsp;to bring it to the whole world by unveiling, on Kickstarter,&nbsp;a brand new version more complete yet more accessible: &nbsp;<strong class=\"redactor-inline-converted\">The du-touch S</strong><the du-touch=\"\" s=\"\"><br></the></the></p>\n\n\n\n\n\n<p><the du-touch=\"\"></the></p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463059379/xsggn9w0766l3s2vznrd.jpg\" data-image=\"\" alt=\"uses of du-touch S\" title=\"uses of du-touch S\"><figcaption><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463059996/x4s3eprgpuelvj2dvq1h.jpg\" data-image=\"\" alt=\"Dualo du-touch S mobile autonomous\" title=\"Dualo du-touch S mobile autonomous\" style=\"text-align: center; font-size: 16px;\"><br></figcaption></figure>\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n<p><strong>Mobile and Autonomous</strong>&nbsp;- Plug your headphones or speaker in directly, no need for a computer or tablet: the du-touch contains 52 instrument sounds, has 8 hours of battery life and fits easily into your backpack.<br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463060045/rrxwi0qzuxmxvyvybowy.jpg\" data-image=\"\" alt=\"compose music dualo du-touch S\" title=\"compose music dualo du-touch S\"></figure>\n\n\n\n\n\n<p><strong>A powerful tool for composition</strong>&nbsp;- Guitar, piano, bass, percussion, electro, 7 track looper. Let your imagination loose. Record your own loops, upload and sculpt your own sounds then share your covers and creations!<br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463060151/yysmjloargwxpixutg0b.jpg\" data-image=\"\" alt=\"improvize dualo du-touch S\" title=\"improvize dualo du-touch S\"></figure>\n\n\n\n\n\n<p><strong>Intuitive and spontaneous</strong>&nbsp;- The Dualo\'s revolutionary design gives you&nbsp;easy access to the settings. So you can compose your own tunes live and on the spot in whatever style you like. Jam with our new keyboard where all scales and chords are represented by simple shapes.<br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463060546/ukcbcqfaneb5ot4fq1la.jpg\" data-image=\"\" alt=\"easy learn dualo du-touch S\" title=\"easy learn dualo du-touch S\"></figure>\n\n\n\n\n\n<p><strong>Fun and educational&nbsp;</strong>– Follow our series of video tutorials to learn how to play and master the instrument and develop your knowledge of music in general. Just let the lights of the keyboard guide your fingers. No need for sheet music<br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463060568/r9sygqxmj6bhnxo87bdv.jpg\" data-image=\"\" alt=\"Dualo du-touch S midi controller\" title=\"Dualo du-touch S midi controller\"></figure>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p><strong>Connected and scalable</strong>&nbsp;– a community of musicians has already adopted our initial model and has helped us to improve the instrument. You can install regular updates for free to get new features...<br></p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p><em>If you\'re a musician you\'ll be able to compose from the get-go...if you\'re a beginner you will in no time.</em><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463059481/xhz8aw8zeyhkhyjtbxmn.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n\n\n\n\n<div class=\"video-container\"><iframe width=\"500\" height=\"281\" src=\"//www.youtube.com/embed/FrSyjsCAsUA\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div><p><br></p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p><the du-touch=\"\" represents=\"\" the=\"\" new=\"\" generation=\"\" in=\"\" mobility=\"\" and=\"\" playability.=\"\"><strong class=\"redactor-inline-converted\">The du-touch represents the new generation in mobility and playability</strong></the></p>\n\n\n\n\n\n<p><the du-touch=\"\" represents=\"\" the=\"\" new=\"\" generation=\"\" in=\"\" mobility=\"\" and=\"\" playability.=\"\"><br>Create tunes from nothing.</the></p>\n\n\n\n\n\n<p><the du-touch=\"\" represents=\"\" the=\"\" new=\"\" generation=\"\" in=\"\" mobility=\"\" and=\"\" playability.=\"\"><br></the></p>\n\n\n\n\n\n<ul><li>Chose a sound, personalize it, add effects.</li><li>Play rhythms, melodies, chords and loop them.</li><li>Layer your loops and mix the sounds.</li><li>Play with your own samples, use the motion sensors to make changes.</li><li>...then share your creations.</li></ul>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463062579/lowtgijpongoxkxonle3.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p><strong>Demonstration:</strong><br></p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n\n\n\n\n<div class=\"video-container\"><iframe width=\"500\" height=\"281\" src=\"//www.youtube.com/embed/ImGwXBRb5ho\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div><p><br></p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463059523/cog6qzfukbapsryosyb8.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n\n\n\n\n<div class=\"video-container\"><iframe width=\"500\" height=\"281\" src=\"//www.youtube.com/embed/9oWasUPi5wg\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div><p><br></p>\n\n\n\n\n\n<p>The idea was developed by a musician and mathematician who made the prototype at his kitchen table. Today there\'s a team of 10 enthusiasts developing the&nbsp;Dualo. In 2014 we brought out our first range of 5 octave Dualos which are already being lovingly played by the Dualo community.<br></p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463064616/wgls2fnzzpotr8xythng.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figcaption>The Dualo Team in 2016</figcaption>\n\n\n\n\n\n<p><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463059584/sfi0bocerwr1i0yzihxh.jpg\" data-image=\"\"></p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p>You can pre-order now you du-touch S <a href=\"https://dualo.org/shop/\" target=\"_blank\">HERE</a></p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463063259/g5wnb2p3ny50m3lxs3lk.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463063235/cjxtfzcldkyw60ovmuwq.jpg\" data-image=\"\" alt=\"Dualo du-touch specifications spec\" title=\"Dualo du-touch specifications spec\"></figure>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463059644/zgg1p6sj0enkpgi7yn9p.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n\n\n\n\n<div class=\"video-container\"><iframe width=\"500\" height=\"281\" src=\"//www.youtube.com/embed/IFwq0TkvRDA\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div><p><br></p>\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n<p>The Dualo is built to be accessible to everyone – even if you\'ve got no musical background. It\'s designed to be completely intuitive. Dualo wants to give you all the tools to allow you to become a Dualo maestro – but also to better understand the way music works in all its different forms.</p>\n\n\n\n\n\n\n\n<ul><li>To begin with, explore the instruments already loaded on the du-touch S, have fun, play as you feel and record simple loops.&nbsp;</li><li>Then, follow the free tutorials available on-line on Youtube.&nbsp;They will help you develop your technique and more more professional sounding pieces.</li><li>If you still want more, dip into a second series of tutorials that will delve deeper into rhythm and harmony.&nbsp;</li><li>Finally, a third set of practical tutorials will give you the key to understanding how to play a piece in a particular style: (reggae, latin, jazz, soul, hip-hop, rock, metal, electro...). The basic rhythms, which instruments to use, typical chord progressions and much more...</li></ul>\n\n\n\n\n\n<ul><then, follow=\"\" the=\"\" free=\"\" tutorials=\"\" available=\"\" on-line=\"\" on=\"\" youtube.=\"\" they=\"\" will=\"\" help=\"\" you=\"\" develop=\"\" your=\"\" technique=\"\" and=\"\" make=\"\" more=\"\" professional=\"\" sounding=\"\" pieces.&nbsp;=\"\"></then,></ul>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463064501/emenxraa1rwhbiispu2x.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p>Each tutorial is accompanied by a tune that you can load on to your du-touch and learn to play by letting the lights guide your fingers. So, no need for sheet music, or for a teacher. We\'ve thought of everything. <strong>You can teach yourself in a few months what would take years of practice to master on a guitar or piano.</strong><br></p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463064682/nefx3iskauxsurgzc2pw.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n\n\n\n\n<div class=\"video-container\"><iframe width=\"500\" height=\"281\" src=\"//www.youtube.com/embed/xqPNa7Ogk-8\" frameborder=\"0\" allowfullscreen=\"\"></iframe></div><p>The notes are arranged in thirds on each keyboard so that the chords fall naturally under your fingers. <strong class=\"redactor-inline-converted\">The scales ands chords are represented by simple geometric shapes</strong>,<the scales=\"\" and=\"\" chords=\"\" are=\"\" represented=\"\" by=\"\" simple=\"\" geometric=\"\" shapes=\"\">&nbsp;chord progressions can be played by simply sliding your fingers along the keypad.&nbsp;<strong>You will literally see and understand what you play and after a few weeks your reflexes will let you play without thinking.</strong></the></p>\n\n\n\n\n\n<p><the scales=\"\" and=\"\" chords=\"\" are=\"\" represented=\"\" by=\"\" simple=\"\" geometric=\"\" shapes=\"\"><br></the></p>\n\n\n\n\n\n<p><the scales=\"\" and=\"\" chords=\"\" are=\"\" represented=\"\" by=\"\" simple=\"\" geometric=\"\" shapes=\"\">You can have fun with the keyboard straight away: display the scale of your choice, then start by feeling your way, the notes that form chords are grouped together. You&nbsp;can&nbsp;create&nbsp;harmony&nbsp;without even thinking about it and writing catchy melodies even if you\'ve got no musical experience.<br></the></p>\n\n\n\n\n\n<p><the scales=\"\" and=\"\" chords=\"\" are=\"\" represented=\"\" by=\"\" simple=\"\" geometric=\"\" shapes=\"\"><br></the></p>\n\n\n\n\n\n<p><the scales=\"\" and=\"\" chords=\"\" are=\"\" represented=\"\" by=\"\" simple=\"\" geometric=\"\" shapes=\"\"></the></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463065047/l5ofezcl1e3hm9xyz3sf.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<p>If you\'re already a top harmonizer the Dualo will surprise you. When you place your hands on its two keyboards you have a degree at each of your fingertips. So you don\'t have to think about absolute pitch of the note, but in relative intervals. Alternating left and right hands allows a greater virtuosity and makes the du-touch S the real Formula 1 of musical instruments.</p>\n\n\n\n\n\n<p><br><em>Solid music theory and ergonomics have been used combined to create the instrument; is uses a simple geometric design that makes it much faster to learn, in any key. And I’ll bet anyone $100 that new layout will prove way faster to play that a conventional keyboard.</em>&nbsp;<strong>(Ken Rushton, altKeyboards.com)</strong></p>\n\n\n\n\n\n<p><the scales=\"\" and=\"\" chords=\"\" are=\"\" represented=\"\" by=\"\" simple=\"\" geometric=\"\" shapes=\"\"><br></the></p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463059763/cz9wl4qsbu87dskuwrbc.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p><strong>Your du-touch is accompanied by a free application: the du-station.&nbsp;</strong>Software, compatible with Mac, PC and Linux, that lets you:</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n<ul><li>Update your du-touch and benefit from new features and sounds. It\'s also your chance to feedback and contribute. We\'re always happy to find new ways to improve the dualo experience.</li><li>Manage your music: upload and download your sounds in the .wav format. The du-touch has a 1Gb memory which you can fill how you like.</li><li>Save and share your music when your du-touch is full.</li></ul>\n\n\n\n\n\n\n\n<p>In addition, the du-touch can also be used as a <strong class=\"redactor-inline-converted\">MIDI input on all computers without having to install software or drivers.</strong></p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463059779/dcfmwy9yeq07wo7xq22r.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n<p>Dualo has revolutionized the way to play an instrument. The new generation in accessibility, mobility and playability. As, without a doubt, the accordion was in its day. Since then music has evolved, and with it the possibility to compose and mix by computer and even on-line.</p>\n\n\n\n\n\n<p><br>Dualo fuses the tactility of an instrument with the precision of a studio. It lets you compose and play on the same machine, with no need for a computer, with a huge degree of mobility so you can take it anywhere. Allowing you maximum flexibility as a music professional or the power to take the party with you wherever you go.</p>\n\n\n\n\n\n<p><br>Dualo goes further and lets you share your music immediately on-line and to upload other music to learn and develop your style. If you are a musician or have a good sense of rhythm start making music straight away. If you\'re a beginner you won\'t be for long.</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463059789/grpedbeqhpcsecc7zh6b.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463059834/nziyzkxnc7fm3xsfedhr.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463059855/fa0hvkhhp2zxgsbwu4sb.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463059879/hwntpktgppxkolwlzpft.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n<figure><br></figure>','Live project',NULL,1281,69498,'Grégoire ElPastor','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAEorynJxrzNb1VuetJXyuwLFzU2HQXHcgDeKX2xt7AG','Technology','0px -169px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462900142/xt8kw8herjvfkowcyzie.jpg',1,NULL,'2016-05-24 16:56:40',24,0),(143,303,6,'Foody iPhone App','Foody is your personal diary for keeping track of your food and symptoms you may experience from it.','Berlin','','Germany','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462908751/tkhgxgsrdse6hvmirasw.jpg','<p>The idea of making an app for tracking food and symptoms arose as my girlfriend was suffering<br>from food related issues. After several tests on allergies she was asked to do a food and<br>symptom diary by her doctor.</p>\n\n<p>Rather than worrying about a sheet of paper she, wanted to do it on her iPhone. As she couldn\'t<br>find an app that was simple enough (most would have asked her to create a catalog up front or<br>enter various details), she ended up taking plain notes with the build in Notes app.</p>\n\n<p> So I wondered \"who hard can it be to build a food and symptom tracking app that makes writing<br>such a diary as easy as possible\". Turns out it\'s actually a bit of a challenge, but that\'s what<br>makes building apps fun. After several months of having my girlfriend actually be using the app<br>we figured out a lot of details that are important to allow quick entry of meals, drinks and<br>symptoms.&nbsp;</p>','Live project',NULL,134,46711,'Martin Stemmle','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462908335/kyzed3dmdxrlt75lbcjr.jpg','Food','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462908749/nkzrefgztt1ehygiwxet.jpg',1,NULL,'2016-05-24 16:56:40',7,0),(144,310,16,'Group Event Booking Platform','','San Francisco',NULL,'CA','','','Idea',NULL,71,97013,'Myles Tanous','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(145,310,16,'Group Event Booking Platform','','San Francisco',NULL,'CA','','','Idea',NULL,69,39414,'Myles Tanous','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(146,310,16,'Group Event Booking Platform','','San Francisco',NULL,'CA','','','Idea',NULL,13,13925,'Myles Tanous','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(147,310,16,'Group Event Booking Platform','','San Francisco',NULL,'CA','','','Idea',NULL,83,18216,'Myles Tanous','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(149,311,16,'Arc Hub','Get your ports back and unleash the full potential of your USB-C Macbook with Arc Hub.','Los Angeles','','CA','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462946231/kk6ikcuz7us2pmsfuzen.jpg','','Beta project',NULL,0,90064,'Brian Fernandez','https://lh5.googleusercontent.com/-MbZhaDv0thg/AAAAAAAAAAI/AAAAAAAAAEA/hz4jBMgh3jc/photo.jpgsz=200','Technology','0px -191px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1462946230/caumbatphsevnsi7trbp.jpg',0,NULL,'2016-05-24 16:56:40',0,0),(150,335,16,'Fentury','Personal finance Advisor','Ottawa','','ON','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467722755/bfnamvtx4bxqqerth5pr.jpg','','Live project',NULL,83,24082,'Lisa Terziman','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBANKz3aSuY2SclSzvDCTAgTfwwPWUa4ChHBZBPAAWFHV','Technology','0px 0px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467722754/pc4bcoccoo91t5bddqmc.jpg',1,NULL,'2016-05-24 16:56:40',5,0),(153,337,14,'Epiderm','A dermatologist online available anytime and anywhere for 14,99','Rennes','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463078016/rpzbgb6pouvfsr7kau3r.jpg','<p>In a few hours, Epiderm puts in relation patients with a certified dermatologists on a chat conversation to get medical advice on their pathology. The service costs 14,99€ in France and 39$ in the US. You will be connected to the doctor during 7 days. &nbsp;Epiderm is available on every support web or mobile.</p><p><br></p><p><a href=\"https://epiderm.co\"><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463123828/ihq3kr75ndlg74nrb8ql.jpg\" data-image=\"\" style=\"text-align: center; color: black; font-family: FreigBook; font-size: 16px; white-space: normal;\" alt=\"\" title=\"\"></a><br></p><h1>What problem are we&nbsp;solving?</h1><p>Access to cares in dermatology is a global pain. </p><p><br></p>\n\n<p>Today, in France, there are less and less dermatologists. Over next years, numbers of dermatologists will decrease from 3400 to 1 800 by the year 2020. Furthermore, to obtain an appointment with a dermatologist wait times are on average 50 days. Epiderm allows to curb this phenomenon and provide access to a first level of care.</p><p><br></p>\n\n<p>The problem of the lack of dermatologists and of the endless waiting times to obtain an appointement is identical abroad. For example, in Canada and in the USA waiting times for an appointment are over a year, North Americans have to paye $140 by consultation. In Mali, there are only 4 dermatologists for 16M people. </p><p><br></p>\n\n<p>This problem of access to healthcare is global and represents a real opportunity for Epiderm.</p><p><br></p><h1></h1><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463124785/zkoevte4f4wcidrr0yaj.jpg\" data-image=\"\"></figure><h1></h1><h1>Epiderm offers&nbsp;</h1><p>Patients are able to send pictures and &nbsp;The &nbsp;service costs 14,99€. The purpose of the service is to be able to reach immediately and wherever you are a der we are a first level of care thanks to the advice of dermatologists Epiderm is available on every support web or mobile.&nbsp;</p><p><br>Epiderm puts forward a new form of patient’s support which allows to prioritize the care and to improve the treatment of the pathologies.</p><p><br>We think that a new relation patient-doctor is possible, by the use of new means of communication (smartphones, tablets). With Epiderm, you can exchange with the dermatologist using a message service (chat). The chat between patient and doctors is asynchronous and it allows a more exhaustive conversation and improve the way doctors can follow your pathology. <br>This does not replace consultations with dermatologists or doctors, but instead, provides a first medical attention to patients seeking reassurance about their health.</p><p><br></p><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463124601/otvjmzqcncacixsfn5mq.jpg\" data-image=\"\"></figure><p><br></p><p><br></p><h1>Our Market</h1><p>In only 6 months, we have already 5000 users and patients are coming from all around the world (Africa, North America, Europe and Asia). By the end of May, our solution will be available in English to reach US & UK market. We also work on a deployment in India, Italy and Turkey.&nbsp;</p><p><br>Today, 3 500 French dermatologists operate 10 000 000 consultations a year. Besides, the number of skin cancers does not stop increasing. The market of the dermatology is very carrier.</p><p><br></p><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463124635/krptse4immvyolqg38ms.jpg\" data-image=\"\"></figure><p><br></p><p><br></p><h1>What does our&nbsp;solution do better than others?</h1><p>Compared with our competitors, we are focus on user experience. Thanks to it, 95 % of our users are very satisfied with the service. </p><p><br></p>\n\n<p>Having a great product is cool but most important is to get traction. That’s why all our effort today are focus on our growth. By using, “growth Hacking” and others acquisitions tricks we have a trend of 20% of growth each week.</p><p><br></p>\n\n<p>We are actually improving our conversation robot, Julie, via a \"text mining\" solution. in 2 years, we are going to finalize a system to help diagnosis of pathologies thanks to the combination of image recognition and \"text-mining\". With this solution, 50 dermatologist can &nbsp;offer a 1st level of care for 1M patient. This will be a really game changer in the way we provides cares and a competitive advantage on our competitors.</p><p><br></p><h1>Why are we the good team?</h1><p>Epiderm’s team is an extremely complementary team focus on UX and most important Growth. </p><p><br></p>\n\n<p>We have built together a previous telemedecine project and we identified that dermatology is the right vertical. We also know how to deal with health regulation and authorities. </p><p><br></p>\n\n<p><strong class=\"redactor-inline-converted\">Elisabeth&nbsp;Berrissoul,&nbsp;Co-Founder & Medical Officer,</strong><br>Elisabeth is a dermatologist, who worked in private practice in Paris for over 30 years. She uses her skills and experience to help Epiderm develop its dermatology consulting service. Elizabeth coordinates all medical aspects of the service.</p>\n\n<p><br></p><p><strong class=\"redactor-inline-converted\">Antoine Bohuon, Co-founder & CEO,</strong><br>Antoine is a self-taught entrepreneur who has worked in several areas before turning to the digital transformation in healthcare. Antoine focuses on the user experience and the management of the company.</p><p><br></p>\n\n<p><strong>Mickael Lecoq, Co-founder & CTO,</strong><br>An IT engineer, enthusiastic Agilist and Full Stack developer, Michael is responsible for the technical part of the service. Interested in teaching, he has vacations in higher education at INSA and ENSAI.</p><p><br></p><figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463124464/hwnwqy75iia3tkfawgl9.jpg\" data-image=\"\"></figure><p><br></p><p><br></p><p><br></p>','Live project',NULL,420,91454,'Victoria Conseil','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463077098/vyfwk2vf0lzs7vycchul.jpg','Science','0px -125px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463078019/wxldyfq0vjifbf8lxdrc.jpg',1,NULL,'2016-05-24 16:56:40',18,0),(158,342,4,'Mangoo ID','','Paris',NULL,'France','',NULL,'Beta project',NULL,2,82883,'Charlie Chelli','','Fashion','','','',1,NULL,'2016-05-24 16:56:40',0,0),(159,343,16,'Shotgun Covoit','We offer an efficient collaborative platform to organize carpools with your communities','Lille','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463491582/pttql6l6cqmtangjooa3.jpg','<p>Because many individuals struggle to reach their daily destination, we wanted to create <strong class=\"redactor-inline-converted\">an environmen</strong>t where they can find the right drivers and passengers and meet <strong class=\"redactor-inline-converted\">like-minded</strong> people.&nbsp;<br></p>\n\n<p><br></p>\n\n\n\n\n\n\n\n<h1><strong>Shotgun Covoit&nbsp;</strong></h1>\n\n\n\n\n\n<p><strong class=\"redactor-inline-converted\">Shotgun</strong> offers an efficient collaborative platform where you can join or create a community in order to organize a more efficient carpool. Find out other community members of your circles and invite them to form a carpool group. This is more than just sharing travel costs; we strive to bring a true social interaction to carpooling, as we believe it is a key factor for a pleasant rideshare.<br></p>\n\n\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<h1><strong class=\"redactor-inline-converted\">The Story</strong></h1>\n\n\n\n\n\n<p>Today, in France, there are more and&nbsp;more &nbsp;schools far from the city center with difficult access to transportation. Transportation issues are a cause of stress and complicate the daily&nbsp;life of students with high costs and&nbsp;waste of time.</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n<p>Shotgun is the&nbsp;<strong class=\"redactor-inline-converted\">fruit of experiences</strong>, the vision of two students who wanted to bring solutions to their community.<br></p>\n\n\n\n\n\n<p>.After a year of work, Shotgun launched the first version in 2015 to other students from their school to facilitate their&nbsp;journey. The success was immediate and Shotgun&nbsp;is willing&nbsp;to expand its services to all types of communities.<br></p>','Beta project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1463479003/p8jko0vczvnvzot5inrb.mp4',120,26111,'Alexandre Hanot','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463152167/gycyzu9rfjlltrd3lp1j.jpg','Technology','0px -218px','p8jko0vczvnvzot5inrb','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463491584/awx69ff0rctz51leydrr.jpg',1,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463492857/ddxxmmctgrctbye1mfuy.jpg','2016-05-24 16:56:40',5,0),(160,334,16,'OOCAR','OOCAR is car data service to help drive better and save money','Paris','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463221822/tji4rssxlitoybl5fkkm.jpg','<h1>Connect&nbsp;your car to your smartphone</h1>\n\n<p><iframe width=\"736\" height=\"419\" src=\"https://www.youtube.com/embed/1D0T-gXasow\" frameborder=\"0\" allowfullscreen=\"\"></iframe><br></p>\n\n\n\n\n\n\n\n<p><a href=\"http://www.oocar.com\" target=\"_blank\">OOCAR</a>&nbsp;helps you monitor your car’s health and your driving, and proposes simple steps to save money every day.<br></p>\n\n\n\n\n\n\n\n<p> With a small device that plugs into your car, OOCAR\'s mobile app gives you access to your car’s data and the best value car services around you.</p>\n\n\n\n\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463222377/abac3d1bvzymwg4fxxvy.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n\n\n\n\n<p> OOCAR is a B2B2C company, operating a smart car data platform for its partners in the automotive industry, to increase customer loyalty and diversify revenues.&nbsp;</p>\n\n\n\n\n\n\n\n\n\n\n\n<p> OOCAR has been live since November 2015, with a growing driver community in France and plans to expand in adjacent markets from Q4 2016.</p>\n\n\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n<h1>How it works ?</h1>\n\n\n\n\n\n\n\n<p>The app&nbsp;brings together the services that will allow you to monitor the health of your car and reduce your automobile budget.</p>\n\n\n\n\n\n\n\n<p><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463222648/kwplm7xci5duhhsvcwyx.jpg\" data-image=\"\"></p>\n\n\n\n<p><br></p>\n\n\n\n<p><strong><a href=\"mailto:contact@oocar.com\">Contact Us</a></strong><br></p>','Live project',NULL,362,67442,'Thibaud C','','Technology','0px -172px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463221822/uje68xjdrmikentvz8yc.jpg',1,NULL,'2016-05-24 16:56:40',14,0),(161,355,10,'2build','','Utrecht',NULL,'Netherlands','',NULL,'Drafted project',NULL,1,13843,'Jesse van Beek','','Charity','','','',1,NULL,'2016-05-24 16:56:40',0,0),(162,358,16,'ohmega','an accelerator platform for students with ideas to discover, collaborate and hustle their ideas.','Bengaluru','','Karnataka','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463236018/uexlmeftkdbtpgmfezy7.jpg','<p>We make a difference by helping students make a difference.<br></p><p>Our mission is to help students bring their ideas to life.<br></p><p>ohmega is&nbsp;&nbsp;a networking&nbsp;platform&nbsp;backed by an in-house&nbsp;accelerator&nbsp;for students who are looking to take their project to the next level, but lack the resources or the right&nbsp;team or even the right guidance to proceed.</p>','Drafted project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1463236112/da7i0lq96rveau55tgji.mp4',3,54558,'Amrith Shanbhag','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463235243/gxww0rtohj2jhnez70zg.jpg','Technology','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463236018/a6curegzi6s9iiwbwkhu.jpg',0,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463236180/fllpspftknycdqnm77bq.jpg','2016-05-24 16:56:40',0,0),(163,358,16,'ohmega','','Bengaluru',NULL,'Karnataka','',NULL,'Drafted project',NULL,32,74752,'Amrith Shanbhag','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(164,386,6,'A La Carte Burritos','A Delivery only restaurant offering #BurritosOnDemand in NYC!','New York','NY','United States','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463258616/d7asyx39obsehir4tnwe.jpg','<h2><a href=\"http://alacarteburritos.com\">ALaCarteBurritos.com</a></h2>\n\n<h2>What is A La Carte?</h2>\n\n<p>A La Carte is a Delivery Only Restaurant Group based out of NYC.</p><p><br></p>\n\n\n\n\n\n<h2>Why A La Carte Burritos?</h2>\n\n\n\n\n\n<p>We do three things. That\'s it!</p>\n\n\n\n\n\n<ol><li><strong>Guac in a Mason Jar&nbsp;</strong>\n</li><li><strong>A burrito or bowl</strong>\n</li><li><strong>Tres Leches Cake Jar</strong>\n</li><li></li></ol>\n\n\n\n\n\n<h2>Where does A La Carte get it\'s ingredients?</h2>\n\n\n\n\n\n<p>We use all-natural ingredients from local vendors in the Tri-State Area.</p><p><br></p><p><br></p>\n\n\n\n\n\n<h2>What does A La Carte care about?</h2>\n\n\n\n\n\n<p>At A La Carte, we make your delivery our main focus. From finding the best ingredients to creating unique packaging, we aim to provide a one of a kind delivery experience.</p><p><br></p><p><br></p>\n\n\n\n\n\n<h2>How does A La Carte Deliver?</h2>\n\n\n\n\n\n<p>Instead of reinventing the wheel, we are utilizing Uber\'s and Postmates\' vast delivery networks to get you your order fast!&nbsp;</p><p><br></p><p><br></p>\n\n\n\n\n\n<h2>About #ChefDom?</h2>\n\n\n\n\n\n<p><img src=\"https://cdn.shopify.com/s/files/1/1257/9091/files/aboutdom_1024x1024.jpg?13220675510693725890\"></p>\n\n\n\n\n\n<p><br></p><p>Dominick Costa is a graduate of the French Culinary Institute in New York City. He has spent the past 10 years unleashing his quirky ways throughout restaurants, bakeries, and the Food Network. Dominick spent 3 seasons on the culinary team of the Martha Stewart production of \"Everyday Food\" and has competed on Food Network Challenges.</p><p><br></p>\n\n\n\n\n\n<p>\"Á La Carte Burritos is a labor of love. Spending the past 10 years in the food industry in one of the largest food scenes in the world, I have come across a lot of hurdles restaurants face. Particularly, restaurants have no choice but to choose between prioritizing the in-house customers or the delivery customers and unfortunately it is the delivery customers that end up missing out the most. With Á La Carte, we put the deliveries to the front and offer a one of a kind delivery experience.\"</p>','Live project',NULL,83,47517,'Dominick Costa','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAEIuMyeuZBiLT1NO3IQxoD8frMyw8W0KaANYsTQTZB2','Food','0px -169px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463258616/zndnxoals9b9igkohtrn.jpg',1,NULL,'2016-05-24 16:56:40',4,0),(165,379,16,'Pluton','','Bogotá - Bogota',NULL,'Colombia','',NULL,'Beta project',NULL,0,70844,'Ricardo Diaz','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(166,393,16,'Fourier Domains','','Cambridge',NULL,'United Kingdom','',NULL,'Live project',NULL,1,12969,'Krste Pangovski','','Technology','','','',1,NULL,'2016-05-24 16:56:40',1,0),(167,391,9,'loombrand','Loombrand is an ecommerce website that showcases artisan, handloomed goods from around the world.','New York','','NY','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463267314/orlaibdahnnn6qx7bbv0.jpg','<h3>loombrand showcases the stories of people, customs, and cultures by curating premium, artisan goods for people&nbsp;seeking authentic, sustainable, &&nbsp;responsibly sourced goods.</h3>\n\n<h3></h3>\n\n<p>We were tired of hearing about “high quality” products that are made internationally with unsustainable labor pumping out tens of thousands of these products every minute.<i><br>For our first product line, we learned about a changing industry, completely overtaken by others producing fast cheap textiles & products.<br>Thanks to the internet & Kickstarter, we have found many individuals who believe in the uniqueness of each product they use while supporting the artisans who have mastered their traditional crafts.<br>We consciously stimulate economic development and educate our customers on social causes from around the world.<br>We have the opportunity to educate the world about the history carried by the families in Babadag, Turkey that have been working for generations to loom these beautiful, wonderful, Turkish towels.<br>We’ve discovered individuals who have sustained a craft for the last 5,000 years ago. Our appreciation and awe has lead us to source the most authentic products of this trade for our community.<br></i></p>','Live project',NULL,112,71119,'Dimitry Apollonsky','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAAB2Pl0kLDhJt3sDGlSYO2Mh396Jxm0FfwkCM8gsLlc','Heritage','0px -512px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463267314/w0sccanxc7ijnhq3nc8h.jpg',1,NULL,'2016-05-24 16:56:40',7,0),(168,417,10,'GreatPositive','Building the world\'s best and most cost-effective online fundraising platform for nonprofits.','New York','','NY','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463277461/fsx9xfxbxtp78btqads5.jpg','<p>Passionate about social good and impact, my cofounder Carol Luong and myself (Matthew Martindale)&nbsp;started GreatPositive to create the world\'s best and most-effective online fundraising&nbsp;platform&nbsp;for nonprofits. Carol\'s background is in business development, community outreach, and&nbsp;marketing, while I focus on design, engineering, and technology.</p>\n\n<p><br></p>\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463283418/cva6j5qxtyswm7xrtr14.jpg\" data-image=\"\"></figure>\n\n\n\n<p><br></p>\n\n\n\n<p>Great technology, design, automation, etc. is something 99% of all nonprofits (over 2 million in the U.S. alone) cannot afford, build, maintain, scale, and the list goes on. And most fundraising platforms offer a product that is over-generalized, as well as&nbsp;take up to 15% of of each donation and/or are seriously expensive. We are not cool with making money from someone\'s intent to give, so we take 0% (for real).&nbsp;We also understand&nbsp;that&nbsp;nonprofits&nbsp;have much different needs than what most products are&nbsp;offering solutions for. Many nonprofits are doing work nobody else wants to do and have many people relying on them each and every day, yet some struggle to keep the lights on.<br></p><p><br></p>\n\n\n\n\n\n\n\n<p>We believe they deserve better.</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n<p>GreatPositive was started&nbsp;because we wanted to align our own skills and experiences with something meaningful and impactful, all while building a company that does work that is fulfilling and directly contributes to the&nbsp;world we want to live in. We chose to start with a problem almost every&nbsp;nonprofit&nbsp;struggles with&mdash;online fundraising. Only about 7% of all nonprofits fundraising is done online, which is astonishing when you consider how comfortable we have become with online shopping. There\'s an opportunity to make activating supporters and executing successful fundraising campaigns a better experience for all.</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n<p>We are a startup interested in building a&nbsp;self-sustaining company. We are actively seeking angel investors to help us move faster and get us to that point.&nbsp;Currently, we are looking for partners, not employees. Obviously, that means someone&nbsp;who feels what we\'re doing aligns with who you are as a person and that this is a startup you want to be a part of during the early stage. Specifically, a great designer is top of mind, though we are open to anyone who feels they have something to offer, even if it\'s simply elevating some of the responsibilities my cofounder and I have.</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n<p>We have a live product,&nbsp;<a href=\"https://greatpositive.com\">https://greatpositive.com</a>, and though very little, we have started making money.</p>\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n<p>Feel free to reach out&mdash;related or not!</p>','Live project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1463277841/wpi1y2zjfpda1mnc1zjh.mp4',606,48644,'Matthew Martindale','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463277114/ytoo2hywnez1wi8ls3hq.jpg','Charity','0px -334px','wpi1y2zjfpda1mnc1zjh','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463277461/pud0dldt2sc0zqjqxln6.jpg',1,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463278179/liuxhlpnkuqb3rlcailu.jpg','2016-05-24 16:56:40',13,0),(169,419,16,'We Wear Shirts','','Fort Worth',NULL,'TX','',NULL,'Idea',NULL,5,76282,'Thomas Burgess','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(170,426,4,'Scaff & Co.','Proyecto para la creación de un equipo de trabajo relacionado con fotografía de moda.','Barcelona','','Spain','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463283042/cyxqfwsdszi1ure4qlkm.jpg','<p>Quiero comenzar a crear un equipo de trabajo consistente en estilistas, maquilladores, peluqueros,&nbsp;retocadores y&nbsp;asistentes de fotografía para realizar proyectos que nos den publicidad a todos y consigan en un futuro, darnos trabajos remunerados. Entre más tiempo estemos unidos, mejores serán las sinergias entre todo el equipo y por eso quiero un grupo de trabajo habitual y unido que siempre realice todos los proyectos juntos y no estar cambiando cada dos por tres de integrantes.</p>','Idea',NULL,133,50642,'Leo Scaff','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAE3nyikhCp5sUPudDF2tuvBUwpWuYSalyMkZBxXO9WH','Fashion','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463283041/txfsafcfftgttbpozzt7.jpg',1,NULL,'2016-05-24 16:56:40',5,0),(171,430,16,'AltR','','Tel Aviv-Yafo',NULL,'Israel','',NULL,'Drafted project',NULL,0,81848,'Eitan Katz','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(172,430,16,'AltR','','Tel Aviv-Yafo',NULL,'Israel','',NULL,'Drafted project',NULL,1,69024,'Eitan Katz','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(173,432,16,'NOLTE','','Bogotá - Bogota',NULL,'Colombia','',NULL,'Idea',NULL,2,20345,'Sebastian A. Nolte','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(174,440,3,'MyO','','Madrid',NULL,'Spain','',NULL,'Idea',NULL,0,19302,'Pedro Nuñez','','Design','','','',1,NULL,'2016-05-24 16:56:40',0,0)