a4mlba.jpg','<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463417419/egoksjizdr0ornw5yhvk.jpg\" data-image=\"\"></figure>\n\n<p> Whether you are looking for a job or looking for new talents to referfor&nbsp;&nbsp;your company, Refer Me Please has your back.&nbsp;</p>\n\n\n\n<p>We empower job referrals by directly connecting job seekers with&nbsp;employees&nbsp;to get referred.</p>\n\n\n\n<p><br></p>\n\n\n\n<hr>\n\n\n\n<p><br></p>\n\n\n\n<p>The way it works is pretty simple and straightforward:<br>- As a job seeker, create your profile, select \"Refer Me for a job\" and get access to a pool of referrer working in your dream company<br>- As a referrer (employee), create your profile, select \"Can refer for a job\" and get access to a pool of candidates</p>\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463417392/m4waae0tczmx5qmqs8rk.jpg\" data-image=\"\"> </figure>\n\n\n\n<p><br>If a job seeker and an&nbsp;employee&nbsp;match, a real time chat will help them getting to know each other and see if a referral can start.&nbsp;</p>\n\n\n\n<p><br>Bonus point: your profile is public! Your name will have a better ranking on the search engine so you can show the world what you\'ve done!</p>\n\n\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463417299/r3vciu2fcoe9fx7mlnpa.jpg\" data-image=\"\"> </figure>\n\n\n\n<p><br></p>','Live project',NULL,173,78445,'Kevin Bosc','https://lh4.googleusercontent.com/-QbTQcj4Nc_w/AAAAAAAAAAI/AAAAAAAAHTc/QdqZfSVIZDM/photo.jpgsz=200','Technology','0px 0px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463417455/qoygvkegtlaimd0d7xja.jpg',1,NULL,'2016-05-24 16:56:40',4,0),(185,545,16,'SmartMoon','sera una nueva aplicación web para empresas o micro negocio es como una tienda virtual.','Puebla','','Mexico','','<p><font><font></font></font></p>','Idea',NULL,16,38339,'Alfre Perez Castro','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBAPeqBnCxxUkT3ZBkmL9sI4YClaZCVrL5LD1dKZAk28K','Technology','','','',1,NULL,'2016-05-24 16:56:40',1,0),(187,546,16,'Simitless','Simitless proposes to domain experts a platform for data web apps for BI and Market Intelligence.','Le Mayet-de-Montagne','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463431559/soyqe9iz1fn4w5ohi55o.jpg','<p>Simitless originated in the head of François, the main founder of our start-up. He has been developing the idea since 2006 while working in the Market Intelligence industry.&nbsp;</p><p>A PhD in AI helped him in his understanding and focus of the subject matter. He encountered vivid interest from his former mentors and colleagues about the potential of his product, especially from the senior people, the domain experts. Francois realized that it could be a means of unleashing creative energy for them.</p><p><br></p>\n\n<p>In 2014, he decided to actively start working on the project. He found his team and together we have been working on our startup for over a year and a half. We have developed a nice prototype of a platform that is currently in beta, we have built a website, crafted our message, made a couple of videos and started a marketing campaign.&nbsp;</p><p><br></p><p>There are still loads of features left to be developed and we are working on them daily and nightly. But we are excited to be building our platform and would love to hear about your impressions!</p>','Beta project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1463424505/cmzegqdixvfdm4crhlkw.mp4',125,66494,'Alex Weber','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463418481/fy2zdwumkszzy0zxenju.jpg','Technology','0px -273px','cmzegqdixvfdm4crhlkw','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463431557/mtcubbumryqflfda6soh.jpg',1,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463424624/fbiiwbdmr1ymana1sgnm.jpg','2016-05-24 16:56:40',6,0),(189,552,16,'Cyclops','Bike routing web/native app on steroids, utilizing data sets for safe, efficient routes to ride.','San Francisco','','CA','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463438427/kxgn6lghb0ycnpu1oc2q.jpg','<p>Bike routing web/native app on steroids. It layers a few sets of data, along with user feedback to show the best possible bike routes. This goes beyond what traditional mapping tools are providing and take a deeper look into the safest, most efficient routes to ride.</p>','Drafted project',NULL,87,99292,'Nick Kinling','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463437634/rjwbucpzzai5dz0okvwb.jpg','Technology','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463438429/jryyqv4etatdbq7vxwip.jpg',1,NULL,'2016-05-24 16:56:40',8,0),(190,557,15,'Arise','Arise is a yoga alarm clock that integrates yoga into waking up.','East Lansing','','MI','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463448929/sbnhszy7hmqtkrsdvzt1.jpg','<p>In busy modern lives, it is hard to find the time to practice yoga. Arise is a yoga alarm clock that integrates yoga into waking up, so the time for yoga is scheduled with morning routine. Daily morning practice of yoga relieves stress and anxiety, improves overall physical health, and is an excellent natural energy booster, fueling the body with positive energy to face the day ahead. With the arise alarm clock app, the user can create their own personal wake-up with snooze options, yoga difficulty, routine duration, and other customizable options. Animated video and vocal instructions walk the user through the routines, eliminating perceived difficulty of morning yoga practice with personalized, bite-size information.</p>','Beta project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1463453039/z2tthkxyivvxfc8ihcor.mov',47,22653,'Emma Pittsley','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463447404/pmwnvortdyrbmxr7inqb.jpg','Sport','0px -235px','z2tthkxyivvxfc8ihcor','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463448928/qede6wtekr0gyy8ce3iq.jpg',1,NULL,'2016-05-24 16:56:40',6,0),(191,585,16,'Erashome','ERASHOME first site to host foreign students wishing to reside in France.','Paris','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463559250/me0iuvnwqkokzt1olsdp.jpg','<p>ERASHOME first site to host foreign students wishing to reside in France. With more than 650 students from 90 nationalities came in France with Erashome. By registering for free, get discounted prices on all these services: housing, bank, driver, phone,&nbsp;CAF grant.&nbsp;</p>','Live project',NULL,68,72634,'Maewen Bertucat','','Heritage','0px -646.625px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463559250/tvtjuruwbfuzr321x0zg.jpg',1,NULL,'2016-05-24 16:56:40',6,0),(192,261,12,'Zitecraft','','Amsterdam',NULL,'Netherlands','',NULL,'Live project',NULL,6,59945,'Barend Jungerius','','Publishing','','','',1,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463606055/rvwijiyjgclgzr4vne2d.jpg','2016-05-24 16:56:40',0,0),(193,565,1,'Happinessforhumanity','','London',NULL,'United Kingdom','',NULL,'Idea',NULL,5,15434,'Riddhima Ramnani','','Art','','','',1,NULL,'2016-05-24 16:56:40',0,0),(194,606,16,'DEO Shopping','','San Francisco',NULL,'CA','',NULL,'Live project',NULL,5,27344,'David S','','Technology','','','',1,NULL,'2016-05-24 16:56:40',0,0),(195,611,3,'Flying Tent','The world\'s first all-in-one floating tent, hammock, bivy tent and rain poncho.','Sankt Veit an der Glan','','Austria','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463731298/wltaxk0fbssyyr7cpwfb.jpg','<p>If camping, backpacking and&nbsp;bikepacking teaches us one lesson that applies to everyday life, it’s consolidating space. The flying tent is about just that: making four accessories we all take on trips and weaving them into one, convertible gadget. And it’s pretty ingenious.</p>\n\n<p>The fyling tent is a combination of floating tent, bivy tent hammock and rain poncho and especially designed for people who are on the move in diverse terrain. Anywhere a tent can‘t go like the forest, jungle, wilderness or along river beds the flying tent is ready. Inclusive supplies it is squeezed down into a small 15-inch-by-13-inch bag that weighs under three pounds. This makes flying tent perfect for camper, backpacker or bikepacker who need transportable gear to set up fast and go.</p>','Beta project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1463731669/ezwmsuwmyjajlsv89fdt.mp4',243,13067,'Bettina Wenigwieser','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458645841/default_profile/shutterstock_174583592_xqbhio.jpg','Design','0px -361px','ezwmsuwmyjajlsv89fdt','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463731302/jjcevxhpmhloepnqwqza.jpg',1,NULL,'2016-05-24 16:56:40',13,0),(196,616,16,'Safe wallet','Safe wallet is an app that replaces the old, heavy and easy to steal wallet.','Ciudad Autónoma de Buenos Aires','Autonomous City of Buenos Aires','Argentina','','<p>How do you think life is going to be in twenty years? Do you think that we are going to keep carrying wallet and keys in our pockets? Probably not. </p>','Idea',NULL,88,77494,'Gonzalo Manco','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463754124/uhso0ehjyou4hpuek2fi.jpg','Technology','','','',1,NULL,'2016-05-24 16:56:40',1,0),(197,624,16,'Content Sleuth','Social media marketing automation, analytics, and outreach for content marketers.','San Francisco','','CA','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463934870/rvyvbvbzuxxhpfjfwbsq.jpg','<p><a href=\"http://contentsleuth.com/\">Content Sleuth</a> is a plan based subscription SaaS (Software as a Service) application which aims to make social media and content marketing easier, less time-consuming, and enjoyable.<br></p>\n\n<p>It is currently in the early stages of development and is due for MVP (minimum viable product) beta release some time in June, 2016.</p>\n\n<p>Content Sleuth has been an idea in development for over two years and it has slowly evolved into something quite special.</p>\n\n<p>There are&nbsp;plenty of features and tools on the roadmap for development, including:</p><p><br></p>\n\n<ul><li><strong class=\"redactor-inline-converted\">Social Media Scheduling</strong> (Facebook, Twitter, Google+, LinkedIn, Pinterest, Instagram, Snapchat)</li><li><strong>Automated Content Curation &&nbsp;Reputation Management</strong></li><li><strong>Content Library</strong></li><li><strong class=\"redactor-inline-converted\">Influencer Research</strong></li><li><strong>Content Feeds</strong></li><li><strong>Content Exchange Network</strong></li><li><strong>Content Research</strong></li><li><strong>Outreach Campaigns</strong></li><li><strong>Analytics &&nbsp;Tracking</strong></li></ul>','Beta project',NULL,293,58788,'Gareth Daine','','Technology','0px -53px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463934870/lvedajzl1wsyquc8ewwe.jpg',1,NULL,'2016-05-24 16:56:40',8,0),(202,628,16,'YouShould','YouShould is a bar booking platform.\nHttp://www.youshould.co.uk','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464013985/rxa8rinn5zleldugndk9.jpg','<p>We have created YouShould in paris in 2013.&nbsp;At the time it was just a nightlife guide but nobody gave a shit.<br>We switched into a Couponning app but again, succes was not an option with this feature.<br>We finally pivoted into a bar booking platform, since then we have a huge growth because it is a real need and a real problem to find the proper venue for your get together and to organize&nbsp;the party with your friend and the bar.<br><br>We have launched YouShould in 10 cities in&nbsp;France, in Brussells, and now in London ! Other cities in&nbsp;UK are coming, and copenhaguen in July :)<br></p>','Live project',NULL,136,59167,'Paul Sunspikies','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464000280/ohpdymtnmdf04k8fsxzo.jpg','Technology','0px -176.617px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464013985/b