9',0,0),(236,807,16,'La Bise','The first app to allow people to organized event at home','Paris','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465114458/pxbymspslyetxz0o6xhs.jpg',NULL,'Beta project',NULL,NULL,31495,'Charlotte Hamel','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1464864919/iwlajokjl84il8c90kn9.jpg','Technology','0px -149px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465114458/gzszz0uflu0vgbbkablb.jpg',0,NULL,'2016-06-05 05:12:47',3,0),(237,876,16,'CampusList','','Berkeley',NULL,'CA','',NULL,'Idea',NULL,NULL,49175,'varsha sundar','','Technology','','','',1,NULL,'2016-06-05 07:43:36',1,0),(238,596,3,'Nimslo','A digital stereo camera that makes all moments interesting.','Austin','TX','United States','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465316364/hu0wjosxodrfrahe8ob3.jpg','<p><br></p><p>We\'re&nbsp;reviving the iconic 1980s Nimslo&nbsp;3D film camera and&nbsp;making&nbsp;it digital. The camera simultaneously records a scene from four different angles. Each of the four lenses “sees” the shot slightly differently and captures the frame with its own view of the scene.</p><p><br></p><figure><img src=\"https://raw.githubusercontent.com/aristotlemanolakos/aristotlemanolakos.github.io/master/AOAO/tumblr_n3fgohBxc61rv2cu6o1_400.gif\"></figure><p><br></p>','Drafted project',NULL,NULL,49996,'Aristotle Manolakos','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1463612496/ncexhhwnwwsm5e6z9ocg.jpg','Technology','0px 0px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465316364/v70u1ptoshn8a2gzyejp.jpg',1,NULL,'2016-06-06 22:23:42',6,0),(239,888,12,'ReflexEurope','ReflexEurope is the new pan-european newspaper, an editorial (r)evolution in sync with our time ...','Paris','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465316034/fy4drf3qxysegyz6yy7v.jpg','<p>Here we are, the project was born some time&nbsp;ago, and only asks to see the light of day, who knows with WittyCircle \'s&nbsp;help ... you will appreciated.<br></p>\n\n<p><br></p>\n\n<p>Ultimately, this is undoubtedly an ambitious project, both motivating and very&nbsp;exciting.&nbsp;</p>\n\n<p><br></p>\n\n<p>So here&nbsp;is a slice of ReflexEurope\'s&nbsp;story I am happy to share with you today, and I&nbsp;thank you in advance for your help,&nbsp;support, advice.<br></p>\n\n\n\n<p><br></p>\n\n<p><br></p>\n\n<p><br></p>\n\n\n\n<p>- EUROPE -&nbsp;</p>\n\n\n\n<p><br></p>\n\n<p><br></p>\n\n\n\n\n\n<p>Europe is a reality with 60 years of history and construction which make it an actor by rights of the globalization of the fact of the maturity of its project and its power.&nbsp;</p>\n\n<p><br></p>\n\n\n\n<p>The strength of Europe lives in its differences of traditions, languages, cultures and regions, but these wealth appear very often as so many obstacles to the construction of a real common identity.</p>\n\n<p><br></p>\n\n\n\n\n\n\n\n<p>Nevertheless Europe is indeed our present.</p>\n\n<p><br></p>\n\n\n\n\n\n\n\n<p>Beyond the simple feeling of geographical attachment, the circulation of the single currency will have had a decisive psychological effect, strengthening the other symbols of identification within the Union like passport, european driving licences, flag, hymn,&nbsp;&hellip;&nbsp;</p>\n\n<p>The Euro made the first one walked to the world in front of the United States, and&nbsp;Europe manages to face the steady growths of China and India which push aside the famous world order.</p>\n\n<p><br></p>\n\n\n\n\n\n\n\n<p>But Europe&nbsp;is our future.</p>\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n<p>For the majority of the europeans the future contains more checks than bad forerunners, and we want to believe of course&nbsp;that our children and following generations will have a better life thanks to synonymic Europe of freedom and stability.</p>\n\n<p><br></p>\n\n\n\n<p>The sad european reality.</p>\n\n\n\n<p><br></p>\n\n\n\n<p>Regrettably Europe is in crisis, with a blatant deficit of communication and information of the European citizens, this even while we evoke the possibility of electing a President of Europe who of his only way would represent some 500 million individuals stemming from 28 countries.</p>\n\n<p><br></p>\n\n\n\n<p>A wonderful territory of expression&nbsp;</p>\n\n\n\n<p><br></p>\n\n\n\n<p>From the point of view of media, Europe countries its distance and its lack of nearness&nbsp;: it would not be profitable, or bankable.</p>\n\n<p><br></p>\n\n<p>The problem likes at first in little of data processing which is reserved for Europe.&nbsp;</p>\n\n<p>Then, in the mode of treatment which limits Europe to a national approach -&nbsp;or supranational one&nbsp;-&nbsp;of the current events of our European neighbours&nbsp;; in an internal analysis&nbsp;(our point of view) of what takes place in external&nbsp;(to them).</p>\n\n<p><br></p>\n\n\n\n<p><br></p>\n\n\n\n<p>Europe as its citizens cannot be satisfied with one such echos, too weak, too critical and very often committed, and it\'s time now to think of a more modern and justifiable, different mode of information : to the true service of the European citizens.</p>\n\n<p><br></p>\n\n<p><br></p>\n\n\n\n<p>- - - - - - - - - - - - - - - - - - -&nbsp;- - - - - - - - - - - - - - - - - - -&nbsp;- - - - - - - - - - - - - - - - - - -&nbsp;- - - - - - - - - -&nbsp;</p>\n\n\n\n<p><br></p>\n\n<p><br></p>\n\n\n\n\n\n<p>The project presented here&nbsp;works&nbsp;so in this direction for a better knowledge, understanding and integration of Europe.</p>\n\n<p><br></p>\n\n<p>Its ambition is to supply&nbsp;“THE big European information” informing about the current events of our European neighbours and around which to exchange tomorrow to feed the democratic debate and better understand the stakes in our time (...).</p>\n\n<p><br></p>\n\n<p><br></p>','Drafted project',NULL,NULL,42577,'Clyde Morgan-Desouches','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465253387/oyxw5nkgoygphgdxd4ko.jpg','Publishing','0px -66