r></p>\n\n<p>However the daily life is full of foolish questions that one&nbsp;doesn\'t dare to ask.... \"Do i need to wake up my baby to feed him ?\" , \"How many times a week does it need to bath ?\", \" Does it need to finish its bottle ?\"</p>\n\n<p><br></p>\n\n<p>Simple questions that&nbsp;eventually make you very&nbsp;anxious if you don\'t know where to find the right answer....</p><p><br></p><p>My husband and&nbsp;I went through difficult times for the&nbsp;first baby. The only choice we had&nbsp;was to go on the Internet. We were so frustrated with the unappropriate answers...<br></p>\n\n<p><br></p>\n\n<p>This is the reason why i created Petite Question&nbsp;with a pedetrician.&nbsp;</p><p><br></p><p>Petite Question is a service that help&nbsp;parents who struggle with the embarrassing world of maternity and seeking advices everywhere.</p>\n\n\n\n\n\n<p><br></p>\n\n<p>Our&nbsp;service&nbsp;guarantees customized&nbsp;answers&nbsp;to&nbsp;parents and parents-to-be&nbsp;:)</p><p><br></p><p>How does it work ?</p><p>Send your question via SMS and you\'ll receive an answer from the appropriate expert in the 24 hours.</p><p>&nbsp;Pay for a pack of 5 questions&nbsp;OR&nbsp;for a monthy subscription with unlimited questions&nbsp;</p>\n\n\n\n\n\n<p><br></p>','Live project',NULL,NULL,55855,'Caroline Bercegeay','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465979936/vqjmyhhd4qcdrq5lx7jv.jpg','Technology','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1469028755/ilqkaxtlmiwmor8c5uqz.jpg',1,NULL,'2016-06-15 08:59:12',8,0),(249,942,16,'KRONOSDELIVERY','Nous voulons changer la vision que les gens ont de la livraison en proposant des services innovants.','Paris','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466067592/xqybpfy8nckcxoxdn9bo.jpg',NULL,'Drafted project',NULL,NULL,65269,'Guillaume L\'hostis','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466067352/kjqcsivnaac8mpwos8cl.jpg','Technology','50% 50%','','https://res.clo