ULL,NULL,25598,'Alban Jamesse','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466425647/sehtdjcjbcw8vm7uwizn.jpg','Technology','','','',0,NULL,'2016-06-20 16:00:18',0,0),(258,1062,16,'English Perfected','The ecosystem for English. Free resources, learning communities, tuition, services, jobs.','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466604940/oavkbzi77j0jjr6wutv1.jpg','<p>English already&nbsp;accounts for 60% of the $205B Global&nbsp;Language Market, with&nbsp;English education and services requirements&nbsp;set to rise dramatically over the next 5 years. Following comprehensive research into the sector, we\'ve developed a robust strategy to outperform the multitude of competitors, and are now looking to build a World class team prior to launching our beta&nbsp;platform. <a href=\"http://www.englishperfected.com\" target=\"_blank\">www.englishperfected.com</a></p>','Drafted project',NULL,NULL,66908,'Chris Aram','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466447758/sqz1esjzlnls4pqxnmvg.jpg','Technology','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466604942/hnsqphtrl2vk6qgijbto.jpg',1,NULL,'2016-06-20 18:47:01',8,0),(259,785,16,'Bid4Me','','Nice',NULL,'France','',NULL,'Idea',NULL,NULL,94354,'Andy Oliveira','','Technology','','','',1,NULL,'2016-06-20 21:55:39',0,0),(260,1069,4,'Jules & Julie','Jules&Julie offers personalized shopping tours in Paris for foreign tourists','Paris','','France','','<p>We provide foreign visitors wishing to make the most of their shopping time in Paris someone who speaks their language. Thus, they have a personal assistant allowing them to wander peacefully around the City of Lights in a friendly and effective way. The client fills in his shopping list online and we transform this into a boutiques roadmap. We give it to the personal assistant. </p>\n\n\n\n<p><b>Custom-made and district tours</b></p>\n\n<p>If the client wishes to bring together shopping and city sightseeing, we will provide him with four main tours per district based on tree formulas (morning, afternoon and all-day). We can also provide him with a personalized tour if the client already knows what he wants (timetable, places and particular purchases).</p>','Beta project',NULL,NULL,26795,'Hervé PARGUE','https://lh5.googleusercontent.com/-0Yt6n_DeouA/AAAAAAAAAAI/AAAAAAACzfo/1E-NH3yWfEo/photo.jpgsz=200','Fashion','','','',1,NULL,'2016-06-21 08:11:25',2,0),(261,241,16,'WIZPAY','In two words, the WIZPAY project wants to combine interactive advertising and a mobile marketplace.','Paris','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466511626/qkw8xvzmcszmwinl89io.jpg',NULL,'Beta project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1466511817/loopunekzn5sf6kuhio2.mp4',NULL,23075,'Maximilien Lejeune','https://graph.facebook.com/me/picture?width=200&height=200&access_token=EAAG7LqtfGXYBABFZAYOiScZAX62SCTZABKNzT2bDrr5XXNusZCc1aiZ','Technology','50% 50%','loopunekzn5sf6kuhio2','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466511626/cx8xvmt75tjdhdjyeypv.jpg',1,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466511942/zk9xi1fvmfrm0r9ykgbf.jpg','2016-06-21 12:13:56',6,0),(263,1083,16,'Dropcicle | iOS app','A location-based photo sharing community that ties the places we visit to the memories we make!','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1469051340/hrbmmo3uotryjwd4s4or.jpg','<table>\n<tbody>\n<tr>\n<td><strong>Introducing Dropcicle!</strong><br><br>My name is Carlos Carrillo Gutierrez,&nbsp;I first began development on Dropcicle in late 2015.&nbsp; My background is in film and vfx.&nbsp;My original idea for Dropcicle began on my commute to work in central London. The thought occurred to me, how many memories and experiences had taken place around me yet had never been captured?&nbsp; I realised that other social platforms lacked the sense of community.&nbsp;\n<br>&nbsp; &nbsp; <br>I envisioned a tool which would allow a first hand insight to my immediate surroundings from the perspective of those who had come before me. Showing me their experiences, their favourite spots or even aspect of the city not defined by a brand or organisation, such as street art, monuments or just general life moments.&nbsp;Dropcicle was born from this idea.&nbsp;&nbsp;\n\n&nbsp;\n<br>&nbsp;<br>My journey started with establishing the user flow and what I needed the app to do, I then made contact with developers and the work began. After 3 months of exchanging files and ideas, Dropcicle came to life.&nbsp; Dropcicle allows users to reach out and capture moments happening where they are, or leave photos at a place they have been. With Dropcicles radius tool, a user can determine how far across an area their post can be found, thus allowing them to leave posts for other users to find, in a \'treasure hunt\' type way.&nbsp;<br><br>Dropcicle is based around keeping everything local, your posts can reach across a whole city (5km limit) or only a few meters, allowing for some fun when hiding what you’ve captured (if that is what you choose to do)&nbsp; With Dropcicle’s latest update (coming soon)&nbsp;&nbsp;you are able to log-in after creating your account through email (only Facebook before), this means that now anyone, including businesses, are welcome to join in on the fun by sharing posts, running competitions and even promoting themselves.\n<br>&nbsp; &nbsp; <strong class=\"redactor-inline-converted\"><br>However,&nbsp;I have now got to the point where I&nbsp;don\'t think i can do anymore on my own, mainly due to lack of experience. I&nbsp;would greatly appreciate any help i can get :)\n\n</strong></td>\n</tr>\n</tbody>\n</table>','Live project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1469051243/ecgjacigpca80ycp3kcq.mp4',NULL,84672,'Carlos Carrillo','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466545180/ygsndq9clnrejwieos1u.jpg','Technology','50% 50%','ecgjacigpca80ycp3kcq','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1469051339/vt5k5k25edr8tolqi0t0.jpg',1,NULL,'2016-06-21 21:53:36',12,0),(264,1099,3,'CS Designs','My Designs','New York','','NY','',NULL,'Live project',NULL,NULL,13628,'Cody Simons','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466614524/bvxsetzvpi5zyzehcqmx.jpg','Design','','','',1,NULL,'2016-06-22 17:01:50',0,0),(266,567,14,'Sparrho - Democratising Science','We\'re combining human and machine intelligence to democratise cutting-edge scientific knowledge.','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466784631/ntyl2n7wlcr6mp6rrydx.jpg','<p><a href=\"http://www.sparrho.com\" target=\"_blank\">Sparrho</a> is combining human and machine intelligence to help you stay on top of science that matters to you.</p><p><br></p>\n\n<p>Currently holding more than 49 million items from over 45,000 sources, we have the world\'s most comprehensive, structured repository of diverse scientific content, from publications to patents to multimedia, and the most accurate content recommendations developed by world-class scientists.</p><p><br></p>\n\n<p>Sparrho was founded in 2013 out of frustration by two Oxbridge scientists and now has an amazing team based between Cambridge and London, UK.</p>','Live project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1466784273/davsekmuikqzqk9l29en.mp4',NULL,18622,'Sybil Wong','https://lh4.googleusercontent.com/-2b8l8dBGgWg/AAAAAAAAAAI/AAAAAAAAGGM/I9wxXC2eLQU/photo.jpgsz=200','Science','0px -69px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466784631/fxgcv1hygx8pn8xrjvx9.jpg',1,'https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466784654/xplmceljsoe3l8y9mjhz.jpg','2016-06-24 16:01:51',10,0),(267,1176,12,'Politizr','Politizr permet aux élu-e-s de débattre publiquement des sujets proposés par leurs concitoyen-ne-s.','Varilhes','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467035688/ax2qhe9nd25pahxk3bz