América Latina','São Paulo - State of São Paulo','','Brazil','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467122832/msda1dqdjnz7vke8muya.jpg','<p>Product LATAM é o lugar onde geeks, makers e seguidores podem encontrar novos produtos, startups, livros, podcasts e eventos no Brasil e América Latina.</p>','Live project',NULL,NULL,97093,'Filipe Ferreira','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467122522/ybu8x4vnpwgqcx69nmsf.jpg','Technology','0px -11px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467122832/e4s1pwgptokpc6zpkvyp.jpg',1,NULL,'2016-06-28 14:04:45',0,0),(271,1214,3,'Maypop Agency','Maypop Agency is an agency delivering digital projects thanks to resources from emerging countries.','London','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467132904/xrhwtawmbairk1nkhekv.jpg','<p>Few years ago, I observed that many people around me were looking for someone being able to create a website for them. Working in the digital market, that appeared easy to me to deliver some quite simple website but after few months, I understood that me main complexity of a digital agency was to be able to industrialize the processes and frame the potential changes.</p><p><br></p><p>My first attempts were really straight forward. I was just delivering some packaged website with famous CMS and frameworks (such as Wordpress). But after few month, I really had the opportunity to deliver a lot of website. So it was really easier for me to use external resources to be able to do so. I used platforms like Upwork (former oDesk) but&nbsp;finally, I was wasting too much time on some particular technical points :</p><p>&nbsp; - Hosting</p><p>&nbsp; - Resource management</p><p>&nbsp; - Bug management</p><p>&nbsp; - Customer sign-off</p><p><br></p><p>Today, I\'m looking for a technical cofounder allowing me to industrialize the software delivery process :</p><p>&nbsp; - Code management (GitHub, Gitlab)</p><p>&nbsp; - Deployment management (Bitnami, Heroku)</p><p>&nbsp; - Server and hosting (Amazon, Google Cloud, or OVH)</p><p>&nbsp; - Technical resources onboarding (Trello, Slack and so on)</p><p><br></p><p>This will allow me to focus on customer relationship and acquisition.</p><p><br></p><p><br></p>','Beta project',NULL,NULL,14005,'Ludovic de Jouvancourt','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467130844/lctwcmsd2frwdgmpadr1.jpg','Design','0px -167px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467132904/yvpqxx3k547wewv8kyns.jpg',1,NULL,'2016-06-28 16:50:52',2,0),(272,1219,15,'Go! Judo! Go!','The best application to learn and master Judo skills. \nGet a lot of fun with this attractive game!','Salouël','','France','',NULL,'Beta project',NULL,NULL,88298,'William Gacquer','https://lh6.googleusercontent.com/-i0Vy8_qK594/AAAAAAAAAAI/AAAAAAAAAFg/pCBbL1kNUcc/photo.jpgsz=200','Sport','','','',1,NULL,'2016-06-29 08:02:30',0,0),(273,1221,16,'NightBirds','','Paris',NULL,'France','',NULL,'Live project',NULL,NULL,88008,'Camille Bédot','','Technology','','','',1,NULL,'2016-06-29 10:19:43',0,0),(274,1227,16,'We Move Startups','','Paris','','France','',NULL,'Idea',NULL,NULL,45587,'Benedicte Beaugeois','https://lh5.googleusercontent.com/-m-wAr6CsSe8/AAAAAAAAAAI/AAAAAAAADiQ/npRK7FeAr9A/photo.jpgsz=200','Technology','','','',0,NULL,'2016-06-29 11:17:23',0,0),(275,1228,8,'ff','','Paris',NULL,'France','',NULL,'Idea',NULL,NULL,93773,'Laetitia Nlm','','Green','','','',1,NULL,'2016-06-29 11:35:12',0,0),(277,908,16,'Nightlife','','Paris','','France','',NULL,'Drafted project',NULL,NULL,23948,'Antoine Grg','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1465664622/oonfbzbgvagk0fxxytca.jpg','Technology','','','',1,NULL,'2016-07-01 11:44:38',0,0),(278,1266,12,'Skewee.com','Skewee.com aims to attract the attention of recruiters with rich and responsive web CVs.','Rennes','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467498813/dejhryisdrjx5iubhjjm.jpg',NULL,'Beta project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1467499232/iulp3lgl4dasf5otvszy.mp4',NULL,40744,'Aziz Khlat','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467481988/am41ox2qg2kwobwcab65.jpg','Publishing','0px -104px','iulp3lgl4dasf5otvszy','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467498813/hsgyrnefmrrrqqetx8er.jpg',1,NULL,'2016-07-02 22:24:59',1,0),(299,1267,12,'My France Shop','A marketplace dedicated to french products for korean and chinese customers','Seoul','','South Korea','',NULL,'Beta project',NULL,NULL,92194,'Vincent Cap','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467511073/sy5hnuxpknf2otcjprbj.jpg','Publishing','','','',1,NULL,'2016-07-03 02:18:45',0,0),(300,1268,16,'Codentrepreneur','Codentrepreneur provides french online video courses to learn to code by cloning real-life startup.','Paris','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467561042/zvfkqtjlgjucepn4nu28.jpg','<p>With&nbsp;<a href=\"http://codentrepreneur.fr\" target=\"_blank\">codentrepreneur</a> you are going to learn to code by cloning real-life startup as Airbnb, Instagram, Blablacar, Product Hunt, Tinder ...</p>\n\n<p><br></p>\n\n<p>Every clone project is linked to a technology you will learn : Node.js, Angular.js, Ruby on rails, Python, Swift, PHP ... Each course&nbsp;is divided in several chapters composed by&nbsp;short videos (10&nbsp;min max.).&nbsp;Every chapter are focus on building one feature of the clone.</p>\n\n<p><br></p>\n\n<p>Codentrepreneur isn\'t meant to become a web or mobile developer.&nbsp;The purpose is to learn only what entrepreneur need to build their own product quickly.&nbsp;Every single things learned from our video courses can be applied for your startup.&nbsp;We also give pieces of advice about tools&nbsp;which make development faster.&nbsp;</p>','Drafted project',NULL,NULL,92892,'Lucas Willemot','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467561221/jemgkxcdkrfhhx0hmdhy.jpg','Technology','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467561042/stcigvrg3ushmqofpjrw.jpg',1,NULL,'2016-07-03 15:11:02',8,0),(301,1270,10,'Capital For Business','Join me Raise capital for my business. DONATE via\nhttps://secure.changa.co.ke/myweb/share/7377','Nairobi','','Kenya','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467571558/d9gpowhfidjoyzv9e7td.jpg','<h1>Join me in Raising Funds for capital for my new business.</h1><p>via the link: &nbsp;<a href=\"https://secure.changa.co.ke/myweb/share/7377\">https://secure.changa.co.ke/my...</a></p>\n\n<p><strong class=\"redactor-inline-converted\">&nbsp;</strong></p>\n\n<p><strong class=\"redactor-inline-converted\">The Company</strong></p>\n\n\n\n\n\n<p>Brad Supplies & Logistics is a Kenyan Registered company. We focus on supplying quality fortified and Nutritious, supplementary foods and milk powders to Relief Agencies and Hospitals for treatment and management of malnutrition in Kenya and East African Region at large.<br></p>\n\n<p><br></p>\n\n<figure><img src=\"https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467651789/ss6myurz5saob7plnbhc.jpg\" data-image=\"\"></figure>\n\n<p><br></p>\n\n<p><br></p>\n\n<p><strong class=\"redactor-inline-converted\">What we do</strong></p>\n\n\n\n\n\n<p>We are focused on providing quality and efficient services to our clients. We support and Partner with various organizations to respond to the needs of the communities they work with. We endeavor to partner with organizations whose goals are to improve the livelihoods of vulnerable communities.</p><p>&nbsp;</p><p><strong class=\"redactor-inline-converted\">What is MALNUTRITION and the statistics</strong></p><p><em>The term&nbsp;</em><a href=\"http://www.unicef.org/progressforchildren/2006n4/malnutritiondefinition.html\">malnutrition</a><em>&nbsp;refers to both undernutrition and overnutrition. </em>In our case we focus on undernutrition- which is&nbsp;&nbsp;defined as<em> \"the outcome of insufficient food intake (</em><a href=\"http://www.unicef.org/progressforchildren/2006n4/hungerdefinition.html\">hunger</a><em>) and repeated infectious diseases. Undernutrition includes being underweight for one’s age, too short for one’s age (stunted), dangerously thin (wasted), and deficient in vitamins and minerals (micronutrient malnutrition)\". (</em><a href=\"http://www.unicef.org/progressforchildren/2006n4/index_undernutrition.html\">http://www.unicef.org/progress...</a><em>)</em><br></p><p><em class=\"redactor-inline-converted\"><br></em></p><p><em class=\"redactor-inline-converted\">\"Malnutrition is the&nbsp;single greatest contributor to death –malnutrition causes&nbsp;over 45% of the child’s health\" (<a href=\"http://www.unicef.org/kenya/Key_Messages_-_NS_2015.pdf\">http://www.unicef.org/kenya/Ke...</a>)</em></p><br>\n\n<p><br></p>\n\n\n\n\n\n<p><strong class=\"redactor-inline-converted\">Our Mission</strong></p>\n\n\n\n\n\n<p>To provide outstanding, quality Nutritional products at a reasonable price and on time.</p>\n\n<p><br></p>\n\n\n\n\n\n<p><strong class=\"redactor-inline-converted\">Our Vision</strong></p>\n\n\n\n\n\n<p>To help Communities, Humanitarian Organizations and Health Provider cope with Nutrition Challenges and emergencies by making available the necessary Nutritional supplements.</p>\n\n<p><br></p>\n\n\n\n\n\n<p><strong class=\"redactor-inline-converted\">Our Products</strong></p>\n\n\n\n\n\n<p>The company has established partnerships with local and International Manufacturers and suppliers, giving it access to a variety of products and services that that helps it meet the specific needs of its partners for Fortified/ Ready To Use Nutritional Therapeutic Foods and porridges</p>\n\n<p><br></p>\n\n<p><strong class=\"redactor-inline-converted\">How we do it.</strong></p>\n\n<p>We do source the very important and life saving Therapeutic Milks, Ready To Use Therapeutic Foods that has been proven to save live of children and mothers suffering from MALNUTRITION.&nbsp;<br></p>\n\n<p>This started as part of my Giving back(voluntary sourcing agent) to organisations like hospitals and local CBO\'s but in the past month this has grown and we have received confirmed orders in bigger quantities than we can finance&nbsp;</p>\n\n<p><br></p>\n\n<p><strong class=\"redactor-inline-converted\">Our Challenge</strong></p>\n\n<p>Most&nbsp;financiers are not willing to support or&nbsp;back us up as we are less than 6 months as a business entity trying to change a hobby to a business Venture.</p>\n\n<p><br>We do hope that &nbsp;people of good will worldwide will support us with the initial capital needed usd 10,000&nbsp;to ensure that we kick out malnutrition.</p>\n\n<p><br>Help us avail these needed supplements to our hospitals as we also provide Employment to our Young people.</p>\n\n<p><br><a href=\"https://www.facebook.com/BradSuppliesLogisticsltd\">https://www.facebook.com/BradS...</a></p><p><br></p><p><strong>HOW YOU CAN DONATE:&nbsp;</strong></p><p><strong>CLICK the link&nbsp;</strong><strong>Via:&nbsp;&nbsp;<a href=\"https://secure.changa.co.ke/myweb/share/7377\">https://secure.changa.co.ke/my...</a></strong></p>\n\n<p><br><strong class=\"redactor-inline-converted\">Thank You for your Generosity.</strong><br></p>','Live project',NULL,NULL,89408,'Roselyn Opel','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467570623/xkqmxisnhhlstdr4kg7h.jpg','Charity','0px -31px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467571557/ybs1se7tfinouktpcyku.jpg',1,NULL,'2016-07-03 18:34:47',0,0),(302,1278,5,'ccc','wxcwxcwxc','Fréjus','','France','',NULL,'Idea',NULL,NULL,86889,'Jérémy Marcelino','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467629636/f8lk6ce9hcljn8ok8iyz.jpg','Film & Video','','','',1,NULL,'2016-07-04 10:55:13',0,0),(303,1284,16,'OpenVini','Create software under open source license to track winemaking.','Montpellier','','France','',NULL,'Idea',NULL,NULL,37010,'Sylvain Tourrière','https://lh3.googleusercontent.com/-U1Bhpy3JxSg/AAAAAAAAAAI/AAAAAAAAC8I/fighisfMVFI/photo.jpgsz=200','Technology','','','',1,NULL,'2016-07-05 10:04:12',0,0),(304,1292,12,'The mystery of the missing Paratha','','San Francisco',NULL,'CA','',NULL,'Live project',NULL,NULL,25045,'3 Curious Monkeys','','Publishing','','','',1,NULL,'2016-07-05 18:39:14',0,0),(305,1292,12,'The mystery of the missing the Paratha','Preserving Indian Culture Through Children’s Books','San Francisco','','CA','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467743950/wig4m0jqgzk6fvuexysz.jpg','<p>Hi! We’re Shuchi and Shweta, the co-founders of 3 Curious Monkeys. As Indian American parents, we are on a&nbsp;<strong>mission to create a legacy for South Asian children but we can’t do that without your help.</strong></p>\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<figure><img src=\"https://ksr-ugc.imgix.net/assets/012/815/513/3671414a6cc992dd0d47aecb0415565b_original.jpg?w=680&fit=max&v=1466536115&auto=format&q=92&s=7a6cc1076572cecf4c6e1d4b35a4c98c\"></figure>\n\n<p><br><em class=\"redactor-inline-converted\">&nbsp;</em><strong>We want to inspire children to be curious and proud of their rich Indian heritage.</strong>&nbsp;We do this through our adorable and relatable characters&nbsp;<strong>Suno, Dekho Jaano</strong>&nbsp;and our age-appropriate stories that allow children to experience our beautiful Indian culture. Our products are<strong>&nbsp;fun and authentic while being mainstream</strong>, which appeals to kids, parents, and educators.</p><p><br></p>\n\n\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<figure><img src=\"https://ksr-ugc.imgix.net/assets/012/816/151/04ad798817bc04967f32ef7b4d21a282_original.jpg?w=680&fit=max&v=1466539108&auto=format&q=92&s=25b5c2ff145bc45604b536099b3ea97a\"></figure>\n\n<p><br>By pledging your support, you can&nbsp;<strong>help the next generation of Indian American children embrace their cultural identity</strong>.</p>\n\n<p><br>&nbsp;In return of your generous contribution, you can&nbsp;<strong>choose from a host of rewards</strong>&nbsp;based on your pledge including: free shipping, signed copies of both the Paratha and Diwali books or even translating the book to the Indian language of your choice!</p><p><br></p>\n\n\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<figure><img src=\"https://ksr-ugc.imgix.net/assets/012/817/200/4b3939cf07c5de97a6a03f7f667a377f_original.jpg?w=680&fit=max&v=1466543877&auto=format&q=92&s=897e6c92448c14d9f3f77a60bfc2930b\"></figure>\n\n<p><br></p>\n\n<p>The Mystery of the missing parathas takes kids through&nbsp;<strong>a fun food adventure</strong>. It\'s a story that will make them wear detective hats as they hunt for the&nbsp;<strong>parathas ( Indian flat bread)&nbsp;&nbsp;</strong>that suddenly go missing right before Suno’s Dadima’s (grandma) going away party.<br></p>\n\n<p><br></p>\n\n<p><strong><that suddenly=\"\" go=\"\" missing=\"\" right=\"\" before=\"\" suno’s=\"\" dadima’s=\"\" (grandma)=\"\" going=\"\" away=\"\" party.=\"\">Here is a sneak peak of the book:</that></strong></p>\n\n\n\n\n\n\n\n<p><br></p>\n\n<p><br></p>\n\n<figure><img src=\"https://ksr-ugc.imgix.net/assets/012/817/032/9c34c5353f8cbb5a45d0cd589112e11d_original.jpg?w=680&fit=max&v=1466543177&auto=format&q=92&s=f2137bdb7aa1face0cc2808f83dfcaa2\"></figure>\n\n<p><br></p>\n\n<figure><img src=\"https://ksr-ugc.imgix.net/assets/012/817/064/692f9059f440328594d5b2f916924304_original.jpg?w=680&fit=max&v=1466543281&auto=format&q=92&s=c35be7378bb0c768740c90304e54ab56\"></figure>\n\n<p><br></p>\n\n\n\n<p>This page turner will not only make you wonder who stole the parathas but will let you&nbsp;<strong>experience the sights and smells found in an Indian home&nbsp;</strong>along the way. It is sure to make the pickiest of eaters want to try some parathas or even cook them!</p>\n\n<p><br></p>\n\n\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<figure><img src=\"https://ksr-ugc.imgix.net/assets/012/817/151/70ad3d639af7c35135ae57dc53c34bd8_original.jpg?w=680&fit=max&v=1466543600&auto=format&q=92&s=126bf901a0f06492450b899cd24f1ab0\"></figure>\n\n<p><br></p>\n\n<p><br></p>\n\n<figure><img src=\"https://ksr-ugc.imgix.net/assets/012/806/603/af30833183d673a24201fd58572a475e_original.jpg?w=680&fit=max&v=1466471767&auto=format&q=92&s=0ecf0ef4e8b9e3daba90400f3f78e84a\"></figure>\n\n<p><br></p>\n\n\n\n<p>The Diwali Gift and our Dress Up Party App.<br>In the past, we have had great success with our award winning book, <strong>The Diwali</strong>&nbsp;<strong> Gift and our Dress Up Party App.&nbsp;</strong><the diwali=\"\" gift=\"\" and=\"\" our=\"\" dress=\"\" up=\"\" party=\"\" app.=\"\">Our books was sold out across the country and we received great response from parents, grandparents, teachers and more importantly kids!&nbsp;</the></p>\n\n<p><the diwali=\"\" gift=\"\" and=\"\" our=\"\" dress=\"\" up=\"\" party=\"\" app.=\"\"><br><strong>We now can’t wait to bring this mouthwatering adventure story to our young readers!</strong></the></p><p><the diwali=\"\" gift=\"\" and=\"\" our=\"\" dress=\"\" up=\"\" party=\"\" app.=\"\"></the></p>\n\n\n\n\n\n<p><em class=\"redactor-inline-converted\"><br></em></p>\n\n<figure><img src=\"https://ksr-ugc.imgix.net/assets/012/806/497/c8b5989677cda48b8035666ab2aa5689_original.gif?w=680&fit=max&v=1466471014&q=92&s=98ca4ba9362a9bfe7c3f098a7ec17105\"></figure>\n\n\n\n\n\n<p><br></p><p><br></p><figure><img src=\"https://ksr-ugc.imgix.net/assets/012/817/490/6c79447a283f9a92916d4168fd16ba2c_original.jpg?w=680&fit=max&v=1466545119&auto=format&q=92&s=8203daa5d8ddab60f1d427c9a82b22ec\"></figure>\n\n<p>&nbsp;</p>\n\n\n\n<p><br></p>\n\n\n\n<p>Here are a few of the things we\'re offering as rewards to people who pledge their support in this Kickstarter campaign. Don\'t forget to keep an eye out for&nbsp;<strong>EARLY BIRD SPECIAL OFFERS&nbsp;</strong>to get great discounts on the books!</p>\n\n\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<p><em class=\"redactor-inline-converted\"><br></em></p>\n\n<figure><img src=\"https://ksr-ugc.imgix.net/assets/012/829/867/9b07d10d1afb09eb5d71f9dc888b892c_original.jpg?w=680&fit=max&v=1466626171&auto=format&q=92&s=caf554e7e531769b957f015e947188f9\"></figure>\n\n<p><br></p>\n\n<p><br></p><figure><img src=\"https://ksr-ugc.imgix.net/assets/012/760/148/db37e06de398c11f6e4fd0dd321c354b_original.jpg?w=680&fit=max&v=1466050577&auto=format&q=92&s=8a869360b125932a26f45a430cb1daf4\"></figure>\n\n<p><br></p>\n\n\n\n\n\n<p><em class=\"redactor-inline-converted\">&nbsp;</em>Our research showed that even though schools and communities have become a melting pot of cultures, we as parents and educators do not have the tools to share Indian culture with young kids.</p>\n\n\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<p><br></p>\n\n<figure><img src=\"https://ksr-ugc.imgix.net/assets/012/770/052/7073086d72d770717c3525358f75e864_original.jpg?w=680&fit=max&v=1466121406&auto=format&q=92&s=d28af9c7cf92cca8540ce17100236d6f\"></figure>\n\n<p><br></p>\n\n\n\n<p><br>Currently, only 10% of mainstream children’s media such as TV, books and Apps have any characters of color. Out of these, there are none that depicts South Asians in positive and prominent roles. So where are those fun books? We surely could not find them in bookstores and libraries.&nbsp;</p>\n\n<p><br>We urgently need more&nbsp;<strong>avenues for the next generation of kids to validate their cultural roots.</strong></p>\n\n\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<p><br></p><figure><img src=\"https://ksr-ugc.imgix.net/assets/012/760/155/752fd0305ce1bd85e6d417a3eac52435_original.jpg?w=680&fit=max&v=1466050635&auto=format&q=92&s=dfff7cc5562ec0c36ce3d538c1911893\"></figure>\n\n<p><br></p>\n\n\n\n<p><br></p>\n\n\n\n<p>&nbsp;<strong>We want to change the way the world views Indians and break away from current stereotypes</strong>.That is why we\'re making beautifully illustrated hardback books for kids.&nbsp;</p>\n\n\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<p><br></p><figure><img src=\"https://ksr-ugc.imgix.net/assets/012/816/105/b84000983a5b23d4e8342f48006fc6f4_original.png?w=680&fit=max&v=1466538809&auto=format&lossless=true&s=241dc4eb5614aefa23302c7faed25dfe\"></figure>\n\n<p><br></p>\n\n\n\n<p><br>We write our stories in a way such that<strong>&nbsp;kids can relate to the characters</strong>&nbsp;<strong>and become curious about Indian culture while having fun.</strong>&nbsp;For educators, we offer great kid-oriented content which can be&nbsp;<strong>easily shared in their multicultural classrooms.</strong></p>\n\n\n\n\n\n<p><em class=\"redactor-inline-converted\"><br></em></p>\n\n\n\n\n\n<p><br></p><figure><img src=\"https://ksr-ugc.imgix.net/assets/012/817/268/6794c451b177d5aff65890c5de08fcd7_original.jpg?w=680&fit=max&v=1466544114&auto=format&q=92&s=3e76ea255e8073af7f03c45ddf7029e6\"></figure>\n\n<p><br></p>\n\n<p><br></p><figure><img src=\"https://ksr-ugc.imgix.net/assets/012/760/218/3a4ad848f0b96bf33913884aa8fefaf4_original.jpg?w=680&fit=max&v=1466051168&auto=format&q=92&s=15313be22e51983d91fdab6e7b38fcb1\"></figure>\n\n<p><br></p>\n\n\n\n<p>The 3 Curious Monkeys; Suno, Dekho, and Jaano get little readers interested in the story and help them absorb the cultural references more deeply while encouraging them to respond with curiosity.&nbsp;<a href=\"http://3curiousmonkeys.com/\">&nbsp;</a><br></p>\n\n\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<p><br></p><figure><img src=\"https://ksr-ugc.imgix.net/assets/012/774/842/d8ae04bbc5d458b59427eea76929d9ff_original.gif?w=680&fit=max&v=1466168021&q=92&s=c96cc5f47dbd78749858b0e2e389853a\"></figure>\n\n<p><br></p>\n\n<p><br></p><figure><img src=\"https://ksr-ugc.imgix.net/assets/012/767/557/b5c0fd0fe0338308d005cbd9f08e9545_original.jpg?w=680&fit=max&v=1466104667&auto=format&q=92&s=e44a679dd1423ccd1dd6182bd24fee3a\"></figure>\n\n<p><br></p>\n\n\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>Here\'s a quick look at how we\'ll be spending the money and our timeline for completing the project.</p>\n\n\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<p><br></p><figure><img src=\"https://ksr-ugc.imgix.net/assets/012/770/059/9fe8222000c41cfccaaaeb2e3610e74c_original.jpg?w=680&fit=max&v=1466121456&auto=format&q=92&s=8f1b5f498d34f9076695264b3888e371\"></figure>\n\n<p><br></p>\n\n<p><br></p><figure><img src=\"https://ksr-ugc.imgix.net/assets/012/815/636/2c8b448efa045af8d64a9ba0b3e21701_original.jpg?w=680&fit=max&v=1466536648&auto=format&q=92&s=5ad4077ad48a38964cb48044683c8920\"></figure>\n\n<p><br><br></p>\n\n\n\n<p>We’re Shuchi and Shweta, the co-founders of 3 Curious Monkeys. We have been friends for over a decade, and for the past 2 years, we have been trying to revolutionize the way Indian culture is portrayed in young children’s media.</p>\n\n<p><br></p>\n\n<p><br></p><figure><img src=\"https://ksr-ugc.imgix.net/assets/012/815/678/68009cc1bee0118a1943841755033645_original.jpg?w=680&fit=max&v=1466536891&auto=format&q=92&s=d868c4b8e7893eec28e2917722bc2e00\"></figure>\n\n<p><em>Here we are with our 3 Curious Monkeys!</em></p>\n\n\n\n\n\n\n\n\n\n<p><br>&nbsp;</p>\n\n\n\n<p>This journey started when we both become moms. As Indian American parents raising our kids in our multicultural communities, we struggled to find ways to connect our kids to our Indian culture which we both hold so dearly to our hearts.&nbsp;</p>\n\n\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<p><br></p><figure><img src=\"https://ksr-ugc.imgix.net/assets/012/817/350/a96630fd7bb811530d3c47c594e86957_original.jpg?w=680&fit=max&v=1466544454&auto=format&q=92&s=8d2977a6095eaa2f173e5da4d22d1fb7\"></figure>\n\n<p><br><br></p>\n\n\n\n<p>Kids especially those between the ages of 2-7 years are impressionable and vulnerable. We noticed that our kids started to identify themselves as being ‘different’ and on many occasions wanted to change the color of their skin, or were ashamed of taking Indian food for their school lunches and were not as excited about celebrating Indian holidays.</p>\n\n\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<p><br></p><figure><img src=\"https://ksr-ugc.imgix.net/assets/012/817/364/e7f7e148e63920a3cc19859a56dd23ad_original.jpg?w=680&fit=max&v=1466544536&auto=format&q=92&s=0f78489122d29293ae2c949592982c6c\"></figure>\n\n<p><br><br></p>\n\n\n\n<p>We surveyed other parents who were part of blended families and even educators to learn that these issues of low self-esteem were more common than we had imagined and unfortunately everyone was struggling to find a solution.<br>That’s when we decided to leave our corporate jobs and use our combined experience of over 20 years in retail, business development, marketing and sales to create Indian characters who would share authentic yet contemporary stories about Indian culture to young kids.</p>\n\n\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<p><br></p><figure><img src=\"https://ksr-ugc.imgix.net/assets/012/817/412/0b1f7bc1d2e02af219d0fc25fe0f6c54_original.png?w=680&fit=max&v=1466544804&auto=format&lossless=true&s=ac8ebdeaa88672cb6b44deb3dbdbfa1c\"></figure>\n\n<p><br><strong><br></strong></p>\n\n\n\n<p><strong>Why is this project so important to us?</strong></p>\n\n<p><strong><br></strong></p>\n\n<p><strong></strong><strong>Because Indian culture is absolutely amazing and as parents, it should be easy for us to make our kids equally excited about it!</strong></p>\n\n\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<p><br></p><figure><img src=\"https://ksr-ugc.imgix.net/assets/012/816/210/23a47cccd7839741c03b76ade8a96133_original.jpg?w=680&fit=max&v=1466539387&auto=format&q=92&s=53e81415ea9c3bd3ff4940dc33f6bda4\"></figure>\n\n<p><br></p>\n\n<p><br>&nbsp;</p>\n\n<figure><a href=\"https://www.kickstarter.com/projects/1931746557/preserving-indian-culture-through-childrens-books?token=ae068f57\" target=\"_blank\"><img src=\"https://ksr-ugc.imgix.net/assets/012/816/236/f2668c99b756d66f903fc3425c120dc0_original.jpg?w=680&fit=max&v=1466539522&auto=format&q=92&s=ddfd1ee315a3596810893fa45d6cc4a6\" alt=\"Pre-Order\" title=\"Pre-Order\"></a></figure>\n\n<p><br><strong>Help us preserve Indian Culture through children\'s books!</strong></p>\n\n\n\n\n\n\n\n\n\n<figure></figure>\n\n\n\n\n\n\n\n\n\n<p><br>&nbsp;Find us on&nbsp;<br></p>\n\n\n\n\n\n\n\n<p><a href=\"http://bit.ly/3cmkeys\">http://bit.ly/3cmkeys</a></p>\n\n<p><br></p>\n\n\n\n\n\n\n\n\n\n<h3>Risks and challenges</h3>\n\n\n\n\n\n\n\n\n\n<p>We already had a successful book and an App in the market so we know how to bring quality products to our customers. But above all, we have a network of trustworthy, talented artists and designers we have been working closely with for the past 2 years to minimize the risks involved.<br>To further minimize risks, we started working on this project one year ago, researching Indian stories that kids, getting feedback from parents and teachers and even our young readers before we decided on the style and look of \"The Mystery of the missing parathas’<br>We’re working with Nadia Ronquillo, a talented illustrator with heaps of experience, so we know the book is going to look amazing.<br>To meet our fast approaching deadlines, we have printers on standby to receive our order and ship them to us ASAP<br>We’ve given ourselves plenty of time to send out the books and fulfill the other rewards by Diwali ( October) 2016.<br>We now need your support to get our books in the hands of all our little readers.<br>Thank you so much for your support!<br></p>','Live project','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1467744083/nqkqj1tizvz1zvvnivl1.mp4',NULL,90302,'3 Curious Monkeys','https://lh6.googleusercontent.com/-SEqhQDYDNaI/AAAAAAAAAAI/AAAAAAAAAPM/jgcWdXZUtCI/photo.jpgsz=200','Publishing','0px -362px','nqkqj1tizvz1zvvnivl1','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467743944/othq90wzimchwnp2jv92.jpg',1,NULL,'2016-07-05 18:39:16',0,0),(306,1305,16,'Pack\'n\'go','','Nice',NULL,'France','',NULL,'Idea',NULL,NULL,31810,'Andrea AV','','Technology','','','',1,NULL,'2016-07-06 15:19:58',0,0),(307,1305,16,'Pack\'n\'go','','Nice',NULL,'France','',NULL,'Idea',NULL,NULL,90866,'Andrea AV','','Technology','','','',1,NULL,'2016-07-06 15:19:58',0,0),(308,1318,6,'Spiris','Biotechnology, Science, micro algae, research...\nLooking at new production process for microalgae','Paris','','France','',NULL,'Drafted project',NULL,NULL,56246,'Bernard Sacy','','Food','','','',1,NULL,'2016-07-11 16:06:31',0,0),(309,966,16,'Waybot','City traffic counter:\nhttps://waybot.primitivemachine.com/\nhttps://github.com/johnelliott/wb-web','Washington','','DC','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1468258300/l1bp21y0hlc8m7vvhahw.jpg','<p>Waybot is a home-brew traffic counter. Cheap to make and easy to get data directly or via the web. Currently a working open-source prototype.</p>','Beta project',NULL,NULL,17719,'John Elliott','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1466175176/eni5xnmbx7e0pmkstpkn.jpg','Technology','0px -179px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1468258300/bjsitfnfycucd9regvvv.jpg',1,NULL,'2016-07-11 17:30:47',0,0),(310,1326,16,'WOP','','Paris',NULL,'France','',NULL,'Drafted project',NULL,NULL,83586,'Hervé Corsini','','Technology','','','',1,NULL,'2016-07-12 14:23:36',0,0),(311,1326,16,'WOP','','Paris',NULL,'France','',NULL,'Drafted project',NULL,NULL,53996,'Hervé Corsini','','Technology','','','',1,NULL,'2016-07-12 14:23:37',0,0),(312,1327,6,'Mon Terroir a du Gout','','Paris',NULL,'France','',NULL,'Beta project',NULL,NULL,46950,'Pierre Rédarès','','Food','','','',1,NULL,'2016-07-12 15:00:11',0,0),(313,1331,16,'WePetsitty','A PtoP intelligent petsiting service platform. Not just a collaborative platform. It will be better!','Rouen','','France','',NULL,'Beta project',NULL,NULL,99812,'Pauline Genty','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1468365754/cdcy174o9zh2ylemt8oa.jpg','Technology','','','',1,NULL,'2016-07-12 23:33:22',0,0),(315,1194,16,'overbillion.com','overbillion.com is a social network based on sharing of the stocks and the benefits of the company.','Montreal','','QC','',NULL,'Idea',NULL,NULL,21081,'Elliott Hegbor','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1467060458/yobknhhs83m7gkscv3jo.jpg','Technology','','','',1,NULL,'2016-07-20 15:37:06',0,0),(316,407,1,'Artenexo','Artenexo wants to be an online platform that works as a service marketplace for graffiti artists.','Madrid','','Spain','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1469138041/wtsg4chv4kxk2ubdzxpg.jpg',NULL,'Drafted project',NULL,NULL,74076,'Camila Rubio','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458645840/default_profile/shutterstock_134808551_kfgua7.jpg','Art','0px -311px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1469138038/xdaumhwwigtuftac5fpd.jpg',1,NULL,'2016-07-21 21:41:35',2,0),(318,1364,1,'Hermit','','Chicago',NULL,'IL','',NULL,'Live project',NULL,NULL,57467,'Nika Koda','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458645840/default_profile/shutterstock_136128440_wwycb2.jpg','Art','','','',0,NULL,'2016-07-30 03:26:17',0,0),(319,1364,1,'Hermit','We seek to close the gap between artists and customers by making it simple to commission art.','Chicago','','','','<p>Our team struggled as art students, wondering how we can showcase our work and gain work in the style we wanted. As we faced these common issues as emerging artists. The need to feed ourselves and have a roof over our head while we continued to work on our inventions. As passionate artists, it’s always hard to focus on everything at once and as we know, when we get into our creative zones we hermit ourselves into our creative zones. Emerging ourselves in our own little worlds, as a company we want to help artists stay in their zone while being able to create work in there style. We wanted to solve the issues with commissioning work while helping artists gain jobs that they are comfortable with. As students and as artists we all face the same issues. It’s time to change that.</p>','Live project',NULL,NULL,48124,'Nika Koda','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1458645840/default_profile/shutterstock_136128440_wwycb2.jpg','Art','','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1469849399/zfr7nzrndmzvd1ono8l5.jpg',0,NULL,'2016-07-30 03:26:18',0,0),(320,1372,2,'Prueba','','Mexico City','','Mexico','',NULL,'Idea',NULL,NULL,63238,'omar olaes','https://lh6.googleusercontent.com/-TtL_jdDfmJk/AAAAAAAAAAI/AAAAAAAAANA/8fdyyG6_6eg/photo.jpgsz=200','Craft','','','',1,NULL,'2016-08-07 06:37:16',0,0),(321,1384,16,'CitySafe (http://www.city-safe.com/)','City Safe is a website that lets you assess risk levels in over 100 countries and cities worldwide.','Paris','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1471617070/edumebz6t7ewsaakcpar.jpg','<h2><a href=\"http://www.city-safe.com/\">City Safe</a> is a website&nbsp;that lets you assess risk levels in over 100 countries and cities worldwide.</h2>\n\n<p>Designed and thought for travelers, City Safe has gathered data from numerous sources (see&nbsp;<a href=\"http://www.city-safe.com/about#sources\">Sources</a>&nbsp;for more details) in order to give each country and city a safety rating.</p><p><br></p>\n\n\n\n<p><em class=\"redactor-inline-converted\">The Idea:&nbsp;</em>There was no existing website that made it easy for travelers to assess the&nbsp;safety or dangerousness of the country they were going to visit : CitySafe makes it easy and intuitive.&nbsp;</p><p><br></p><h1>Features</h1><p><strong class=\"redactor-inline-converted\">Over a 100 countries and cities</strong></p><ul><li>&nbsp;CitySafe features ratings, rankings, tips & advice on over a hundred cities in the world, and 162 countries. As of 2016&nbsp;CitySafe is still under development, check out the&nbsp;<a href=\"http://www.city-safe.com/work-in-progress/\">Work In Progress</a>page to see which countries and cities are already available.</li></ul><p><strong class=\"redactor-inline-converted\">Detailed Country & City Maps</strong></p>\n\n<ul><li>CitySafe has gathered a safety map for each country from foreign ministry databases : those maps highlight the&nbsp;<strong class=\"redactor-inline-converted\">safe</strong>&nbsp;and<strong class=\"redactor-inline-converted\">&nbsp;dangerous parts</strong>&nbsp;of the country.</li><li>Similarly, every city features a map with its&nbsp;<strong class=\"redactor-inline-converted\">bad neighborhood</strong>s or “<strong class=\"redactor-inline-converted\">no go zones</strong>” (ie. areas more dangerous than others, which are unadvised for tourists), and the spots where&nbsp;<strong class=\"redactor-inline-converted\">pickpockets</strong>&nbsp;are most likely to target tourists.</li></ul><p><strong class=\"redactor-inline-converted\">Danger Rankings</strong></p>\n\n<ul><li>CitySafe has&nbsp;created a&nbsp;<a href=\"http://city-safe.com/danger-rankings/\">Safety Index for 162 countries in the world</a>, as well as for<a href=\"http://city-safe.com/danger-rankings/cities/\">112 cities</a>&nbsp;: each country and&nbsp;city is&nbsp;given a rating from 0 (most dangerous) to 100 (safest), based on over 4 different sources, to make it as accurate as possible.</li></ul><hr><p>The goal of CitySafe is not to&nbsp;create paranoia and prevent people from&nbsp;going abroad, but to provide clear information&nbsp;so that travelers are&nbsp;fully informed when choosing a&nbsp;neighborhood to stay in, planning landmark visits or simply wondering about safety in a city.<br></p>','Beta project',NULL,NULL,32716,'raphael toper','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1471616796/vdnrrqjbpapboadkc6qn.jpg','Technology','0px -221px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1471617070/orranokvzuidgzjybpt3.jpg',1,NULL,'2016-08-19 14:30:51',0,0);
